INSERT INTO `categories_description` VALUES
(48,7,'Sapeli klima dveře','klimatické dveře Sapeli','V rámci projektování budov jsou dveře osazovány do rozdílných klimatických podmínek a musí odolávat chladu, teplu, vlhkosti a slunečnímu záření. Volte tedy vždy vhodné osazení dveří a předejděte následným problémům s jejich používáním a funkčností. Klima dveře mají speciální konstrukci, která obsahuje Al vrstvu, jež zabraňuje pronikání vlhkosti do dveří.\r\n\r\n\r\nURČENÍ\r\n\r\n\r\nl. Standardní bytové interiérové mezipokojové dveře s minimálním rozdílem klima mezi dveřmi oddělujícími prostory.\r\n\r\nll. Dveře pro oddělení prostorů se středním rozdílem klima, jako jsou např. často užívané koupelny nebo vstupy z temperovaných chodeb a schodišť.\r\n\r\nlll. Dveře s oblastí určení pro přechod z nevytápěných prostorů (garáže, sklepy, schodiště, zádveří apod.) do prostorů vytápěných.\r\n\r\n \r\n\r\n \r\n\r\n \r\n\r\n \r\n\r\n \r\n\r\nKLIMA I.  \r\n\r\ndveře\r\n	\r\n\r\nzárubně\r\n\r\nVeškeré dveře z naší nabídky SAPELI\r\n	\r\n\r\nVeškeré dveře z naší nabídky SAPELI\r\n\r\ncena bez příplatku\r\n	\r\n\r\ncena bez příplatku\r\n\r\n\r\n\r\n\r\n \r\n\r\n \r\n\r\n \r\n\r\n \r\n\r\n \r\n\r\n \r\n\r\nKLIMA II.\r\n\r\ndveře\r\n	\r\n\r\nzárubně\r\n\r\nPlné otočné provedení modelů: NORA, RADKA, ESTER, EXKLUSIV, VENECIE, BERGAMO,\r\nVARIANT, MILÁNO, JANOV, ROMA, PALERMO, SOFTLINE,\r\nELEGANT, FEST, LIPNO, STANDART, DAMIER, TENGA,\r\nALEGRO, TARUGO\r\n	\r\n\r\nPouze otočné provedení obložkové zárubně dýhované nebo CPL.\r\n\r\nCena dveřního křídla\r\n+ příplatek 1 950 Kč\r\n	\r\n\r\nCena obložkové \r\n zárubně + příplatek\r\n 450 Kč\r\n\r\n \r\n\r\n \r\n\r\n \r\n\r\n \r\n\r\n \r\n\r\n \r\n\r\n \r\n\r\n \r\n\r\n \r\n\r\n \r\n\r\n \r\n\r\n  \r\n\r\n \r\n\r\n \r\n\r\n  \r\n\r\n \r\n\r\nKLIMA III.\r\n\r\ndveře\r\n	\r\n\r\nzárubně\r\n\r\nOtočné provedení modelů: \r\nELEGANT 10, LIPNO 10, ALEGRO 10, 15, 20,\r\nTENGA 10, 15, 25, DAMIER 10, 15, VARIANT 10 &#8211; 15,\r\nNORA 10, STANDART 10, FEST 10, TARUGO 10 \r\nPozn.: lze osadit pouze do kovové zárubně.\r\n	\r\n\r\nObložková zárubeň NELZE.\r\nPozn.: lze osadit pouze do kovové zárubně.\r\n\r\nCena dveřního křídla\r\n+ příplatek 2 650 Kč\r\n	\r\n\r\nx\r\n\r\n \r\n\r\n \r\n\r\n \r\n\r\n \r\n\r\n \r\n\r\n \r\n\r\n \r\n\r\n \r\n\r\n \r\n\r\n \r\n\r\n \r\n\r\n\r\n\r\n\r\n\r\nDoporučené ceny uvedeny bez DPH. Pozn.: zárubeň ke klima dveřím je osazena třemi závěsy. KLIMA II. a III. nelze bílá na pór. KLIMA DVEØE LZE DODAT I V PROTIPOŽÁRNÍM PROVEDENÍ EI 30 D3 S PØÍPLATKEM 1 950 Kč.','','',''),
(49,7,'Sapeli RTG dveře','RTG dveře Sapeli','Dveře jsou určeny zejména pro zdravotnické provozy - na RTG pracoviště (nemocnice, zubní ordinace apod.) Lze vyrobit ve všech plných modelech, kde není zasahováno do plochy.Max. rozměr RTG dveří je 98/198,5 cm.','','',''),
(50,7,'Sapeli zvukově izolační','zvukově izolační Sapeli','ZVUKOVÌ IZOLAČNÍ DVEØE nabízíme v plném provedení*. Dveře jsou speciální konstrukce doplněné zvukoizolačními doplňky. Tyto dveře Vám umožňují dokonale oddělit hlučné prostory jako jsou např. chodby od běžných provozních prostor, nebo také dosáhnout vysokého užitného komfortu v místnostech s požadavky na klidné prostředí jako jsou např. ložnice nebo pracovny.\r\n\r\n    *\r\n      Kovová zárubeň musí být osazena těsněním.\r\n\r\n60, 70, 80, 90 	Cena dveřního křídla + příplatek za zvukovou izolaci podle\r\nhodnoty útlumu\r\n60, 70, 80, 90 	Cena protipožárního dveřního křídla + příplatek za zvukovou izolaci \r\n1 400,-Kč\r\n\r\nDoporučené ceny uvedeny bez DPH.\r\nPozn.: zárubeň ke zvukově izolačním dveřím je osazena třemi závěsy.\r\nCena dvoukřídlých dveří 125, 145, 165, 185 = dvojnásobek ceny jednokřídlých dveří.\r\nU prosklených modelů je možné použít pouze sklo STRATOPHONE &#8211; provedení čiré.\r\nProsklené dveře M30 příplatek + 2 650,&#8211; Kč, M40 + 4 100,&#8211; Kč. Bezpolodrážkové provedení se skrytými závěsy TECTUS + 3 000,&#8211; Kč.','','',''),
(52,7,'Loprais dveře vchodové','Loprais dveře vchodové','Výrobce Loprais již řadu let vyrábí vchodové a vnitřní dveře z masivního dřeva, obzvlášť je známý výrobou vchodových dveří, modely tohoto výrobce se stali vzorem pro mnoho jiných výrobců, u nás můžete ocenit kvalitu originálu.','','',''),
(53,7,'Loprais dveře interiérové','Loprais dveře interiérové','Výrobce Loprais vyrábí kvalitní vnitřní dveře z masivního dřeva. Využívá k výrobě špičkovou technologii, což se projevuje jak na kvalitě zpracování, vysoké přesnosti truhlářské výroby, lze vytvářet libovolné modely dveří, vše, co lze nakreslit, se dá i vyrobit, fantazii se meze nekladou. Výrobce používá vysoce kvalitní dřevo s minimálním obsahem suků, dřevo je čisté a rovnoleté.\r\n\r\n<a href=\"/File/Cenik-Loprais-vnitrni.xls\"><br />\r\n</a>','','',''),
(224,7,'RASOMURO skryté dveře','rasomuro skryté dveře','Tato řada dveří, které dokonale splývají se stěnou, se zrodila ze zcela nového konceptu:  s novým designovým pojetím rovných linií a náznakovosti. Tradiční plechová zárubeň je nahrazena subtilní tenkou zárubní z eloxovaného hliníku s gumovým těsnění, které zajišťuje těsnost. Závěsy (panty) umožňují dveře otevírat směrem ven i dovnitř, což umožňuje např.  následující: na jedné stěně bude několik dveří vedle sebe, ale některé se budou otevírat do místnosti a některé k nám do chodby. U běžných zárubní budou některé dveře lícovat se stěnou v chodbě a některé se stěnami v místnostech. Dveře Rasomuro umožňují u všech dveří lícovat stěnu v chodbě, ale otevírat se mohou buď do chodby nebo do místnosti.','','',''),
(55,7,'Akční nabídka - zlevněné dveře','Dveře akční','<h2>Výprodej dveří ze skladu</h2>\r\n<br>\r\n<br>\r\nNa našem webu www.burzadveri.com naleznete zlevněné dveře. Většinou se jedná o nové nepoužité dveře, případně demontované s lehkým poškozením nebo s vrtáním na rozetové nebo štítové kování, poškozené dveře nebo dveře starší. Jedná se většinou o jednotlivé kusy, ale od některých modelových  řad lze nalézt více kusů pohromadě.\r\n<br>\r\nPomocí vyhledávače lze hledat dveře podle šířky, výšky, orientace, povrchové úpravy a tak vyfiltrovat ty, které by se Vám mohli hodit. Pokud naopak zbývají nějaké dveře Vám, lze je snadno do burzy vložit.\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n\r\nV RÁMCI MOMENTÁLNÍ SLEVOVÉ AKCE ,,VÝPRODEJ SKLADU\" NABÍZÍME NAŠE DVEŘE NA WWW.BURZADVERI.COM\r\nZA TYTO VELMI ZAJÍMAVÉ CENY:\r\n<br>\r\n<br>\r\nDVEŘE FOLIOVANÉ - JEDNOTNÁ CENA ZA KS 500,- Kč\r\n<br>\r\n<br>\r\nDVEŘE S LAMINÁTOVÝM POVCHEM - JEDNOTNÁ CENA ZA KUS 800,- Kč\r\n<br>\r\n<br>\r\nDVEŘE DÝHOVANÉ PLNÉ - 1200,- Kč\r\n<br>\r\n<br>\r\nDVEŘE DÝHOVANÉ PROSKLENÉ - 1500,- Kč\r\n<br>\r\n<br>\r\n<a href=\"http://www.burzadveri.com\" target=\"_blank\">http://www.burzadveri.com','','',''),
