(46,7,'Sapeli prosklenné stěny','prosklenné stěny Sapeli','','','',''),
(32,7,'dveře Sapeli','dveře Sapeli','<p>Již řadu let prodáváme a montujeme dveře a zárubně od výrobce Sapeli. V jeho nabídce naleznete téměř celou škálu typů vnitřních dveří, dokáže uspokojit i velmi náročné zákazníky, ale pokrývá také běžný sortiment dveří. Doménou výrobce Sapeli jsou dýhované dveře, ale v nabídce nechybí ani dveře lakované, s laminátovým povrchem či folií. Nechybí ani dveře speciální: dveře bezpečnostní, protipožární, protihlukové, s vyšší klima kategorií, s rentgenovou clonou, jež si vždy zachovávají vzhled ostatních dveří, takže je lze vždy snadno zakomponovat do interiéru. Konstrukce většiny dveří je tvořena masivním rámem z měkkého, u některých typů dveří z tvrdého dřeva, výplň je tvořena lehčenou dřevotřískou, v omezené míře papírovou voštinou, u některých typů plnou dřevotřískou. Na povrchu je buď dýha, laminát CPL či HPL nebo folie. U modelových řad pro designově náročnější zákazníky, Harmonie, Kubika, Fantazie, je konstrukce dveří tvořena lepenými lamelami z masivního dřeva a kaleného skla. Výrobce Sapeli pokrývá také širokou škálu typů zárubní, výhradně dřevěných. Většina typů zárubní je vyrobena z dřevotřísky a jako obkladové zárubně. Většina typů je vyráběna z dýhované dřevotřísky, zárubně k některým řadám (Fantazie) jsou vyráběny z lepené vrstvené dýhované lamely. Pro designově náročnejší je zde několik modelů obkladových zárubní, včetně zárubní pro bezpolodrážkové dveře. Vybírat je možné z mnoha variant provedení prosklených stěn či dveří celoskleněných.   Můžete využít mnoho způsobů otevírání dveří: v nabídce jsou kromě dveří otočných dveře posuvné, skládací, lamelové i kyvné. Sapeli nabízí také atypickou výrobu, co se týče rozměru i vzhledu dveří.</p>\r\n<p>&#160;</p>','','',''),
(261,7,'BLUES, krása v jednoduchosti','','Poslední novinkou v produkci Lualdi jsou dveře Blues; jednoduchost a celistvost sbližuje materiály které jsou v ladu se současnými trendy designu interiéru. Různé možnosti provedení dveřního křídla (čiré či matné bezpečnostní sklo, dubová konstrukce, vodorovná dýha nebo matný lak v řadě barev) spolu se zárubní z eloxovaného hliníku vytváří řešení s vysokou tvarovou přesností. Ostění zárubně je ze stejného materiálu jako zárubeň, je teleskopické a přizpůsobí se zdem různých tlouštěk.',NULL,'',''),
(262,7,'ALA, trojrozměrný efekt','','<br><br><br><br><br><br><br><br><br><br><br><br><br><br><br><br><br><br><br><br><br><br><br><br>\r\nDesign dveří Ala se zrodil z konceptu trojrozměrných dveří, jejichž přítomnost v místnosti přináší vnímání prostoru. Tento efekt je způsoben zkoseným tvarem krycích obložek zárubní, který dává dojem, že dveře vystupují ze zdi a vytváří neobvyklou hru stínů na zdi. Dveře mohou být dýhované lakovaným třešňovým nebo dubovým dřevem nebo opatřeny matným nástřikem řadou barev. Ve variantě s vkládanými ocelovými proužky je dýha kladena vodorovně. Závěsy jsou skryté.',NULL,'',''),
(103,7,'kliky kování mt','kliky m&t','První a zároveň jediný český výrobce dveřních klik využívajících moderní technologie pro žádané a velmi kvalitní povrchové úpravy – matný nikl a nitrid titanu v několika barevných odstínech.<br />\r\nSortiment  dveřního a okenního kování se vyznačuje výjimečným moderním designem Romana Ulicha, kvalitou a mnohaletou funkčností. Záruka na funkčnost 3 – 15 let podle druhu povrchové úpravy.','','',''),
(38,7,'Bezpečnostní dveře Bedex','BEZPEČNOSTNÍ DVEØE BEDEX','Cílem výrobků BEDEX je nabídnout každému zákazníkovi perfektní výrobek a servis, odpovídající nárokům na bezpečí, komfort a tomu odpovídající cenu. Filozofii značky BEDEX nejlépe vystihuje její slogan: Bezpečí není luxus ! <br />\r\n<br />\r\nBezpečnostní dveře BEDEX jsou vyráběny na prvotřídních strojírenských zařízeních Trumpf a jsou zkonstruovány z materiálů, které zaručují vysokou kvalitu již od samotných výrobců. Do konstrukce jsou zabudovávány pouze řádně certifikované komponenty a materiály, aby celkový výrobek uspěl v náročných zkouškách odolnosti proti vloupání, resp. protipožárních. <br />\r\n<br />\r\nJednou z hlavních předností dveří BEDEX je oblast zámku. Jsou zde využívány výhradně originální rozvorové zámky renomovaných výrobců. Tyto jsou vyráběny a homologovány k tomu, že spolehlivě ovládají rozvorový systém. Typy a rozdíly mezi jednotlivými zámky ve dveřích BEDEX a zámky používanými jinými výrobci bezpečnostních dveří, objasní odborníci přímo ve výrobě, případně u prodejce. <br />\r\n<br />\r\nVlastní výroba dveří je rychlá. Od podpisu kontraktu jsou standardní výrobky dodávány do 14 dnů, složitější atypické výrobky maximálně do 4 týdnů. <br />\r\nV červnu roku 2004 byla společnost MRB (výrobce značky Bedex) úspěšně certifikována firmou ITC Zlín, a.s. dle ČSN EN ISO 9001:2001. <br />\r\n<br />\r\nDlouholetý český výrobce bezpečnostních a protipožárních dveří, které maximálně splňují bezpečnostní normy, což dokládají certifikáty akreditovaných zkušeben TREZOR-TEST Praha a PAVÚS Veselí nad Lužnicí.  <br />\r\n<br />','bezpečnostní dveře','bezpečnostní dveře','bezpečnostní dveře'),
