(275,7,'JEDNOKŘÍDLÉ','','<p><img src=\"file:///C:/Users/JANSOM~1/AppData/Local/Temp/moz-screenshot-8.png\" alt=\"\" /></p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p><img height=\"67\" width=\"200\" alt=\"\" src=\"/images/UNICO_latosinistro.gif\" /></p>\r\n<p>&#160;</p>\r\n<p>Stavební pouzdro pro jednokřídlé dveře    Základním modelem řady Eclisse  je pouzdro pro jednokřídlé    dveře. Tento typ je ideálním příkladem  účelnosti a kvality    systémů Eclisse. Hodí se pro každé použití jak do     rekonstrukcí, tak i do novostaveb.    Světlost průchodu až 1500mm do  šířky a 2900mm do    výšky (u SDK).</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p><a href=\"/file/01-ECLISSE%20-%20Zdivo%20J.pdf\">TECHNICKÉ PARAMETRY STANDARDNÍCH POUZDER</a></p>\r\n<p>&#160;</p>\r\n<p><a href=\"/file/Zdivo%20jednokridle-%20ATYP.pdf\">TECHNICKÉ PARAMETRY ATYPICKÝCH POUZDER</a></p>\r\n<p><a href=\"../../file/SDK%20jednokridle%20atyp.pdf\"><br />\r\n</a></p>\r\n<p><a href=\"/file/Cen%C3%ADk%20ECLISSE%20standard%2001-2011%20-%20komplet-1.pdf\">KOMPLETNÍ CENÍK POUZDER ECLISSE</a></p>\r\n<p>&#160;</p>',NULL,'',''),
(276,7,'DVOUKŘÍDLÉ','','<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p><img height=\"67\" width=\"373\" src=\"/images/ESTENSIONE.gif\" alt=\"\" /></p>\r\n<p>&#160;</p>\r\n<p><strong>Stavební pouzdro pro dvoukřídlé dveře</strong></p>\r\n<p>&#160; Dvoukřídlé poudzro pro dvoje dveře proti sobě&#160;je</p>\r\n<p>&#160;&#160;vhodné&#160;zejména&#160;ke spojení a oddělení&#160;propojitelných</p>\r\n<p>&#160;&#160;místností.&#160;Tento model udělá z domu příjemný</p>\r\n<p>&#160;&#160;otevřený&#160;prostor,&#160;který usnadní váš každodenní</p>\r\n<p>&#160; život.</p>\r\n<p>&#160;&#160;Světlost průchodu až 3000mm do šířky&#160;a 2900mm do</p>\r\n<p>&#160;&#160;výšky (u SDK).</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p><a href=\"/file/03-ECLISSE%20-%20Zdivo%20DVOUKRIDLE%20STANDARD.pdf\">TECHNICKÉ PARAMETRY STANDARDNÍCH POUZDER</a></p>\r\n<p><a href=\"/file/ZDIVO%20dvoukridle%20ATYP.pdf\"><br />\r\n</a></p>\r\n<p><a href=\"/file/ZDIVO%20dvoukridle%20ATYP.pdf\">TECHNICKÉ PARAMETRY ATYPICKÝCH POUZDER</a></p>\r\n<p><a href=\"../../file/SDK%20jednokridle%20atyp.pdf\"><br />\r\n</a></p>\r\n<p><a href=\"/file/Cen%C3%ADk%20ECLISSE%20standard%2001-2011%20-%20komplet-1.pdf\">KOMPLETNÍ CENÍK POUZDER ECLISSE</a></p>',NULL,'',''),
(40,7,'JAP - POUZDRA','pouzdra pro posuvné dveře JAP','První český výrobce celosvětového trendu zasouvacích dveří realizovaných na bázi inovativního stavebního pouzdra. Záruka 10 let, certifikováno ČSN EN ISO 9001 : 2000<br />\r\n<br />\r\nPro projektanty a architekty jsou připraveny podklady pro projekční programy <font color=\"#ff0000\">. <font color=\"#ff0000\">AutoCad, ArchiCad<font color=\"#000000\">. </font></font><font color=\"#000000\">Data jsou k nahlédnutí a ke stažení na</font> <a href=\"http://www.archweb.cz/jap/\">www.archweb.cz/jap/</a> .</font>','','',''),
(339,7,'Praktické rady','','<p>\r\n<header data-facebook=\"href\" data-facebook-href=\"http://www.sapeli.cz/cs/rady-a-informace/vse-o-dverich/prakticke-rady\">\r\n<h1 data-facebook=\"title\">Rady a informace</h1>\r\n</header>\r\n</p>\r\n<div class=\"left-side printable-content\">\r\n<h2 data-facebook=\"caption\">Praktické rady</h2>\r\n<div class=\"dynamic-content\">\r\n<div class=\"leftside\">\r\n<p class=\"m0\"><img height=\"874\" width=\"441\" alt=\"Rady a informace\" src=\"http://cms.www.sapeli.cz/cs/goto/Image/88518382617560637-dvere-Mgm9_GLl.png?_signature=A3908948A5&amp;height=874&amp;width=441\" /></p>\r\n<p class=\"citate\"><span>,,</span>Pokud jakkoli váháte a nemáte jistotu o  správném výběru dveří, obraťte se na nás. Poradci SAPELI jsou  připraveni zdarma poskytnout řadu užitečných rad a informací.</p>\r\n</div>\r\n<div class=\"rightside\">\r\n<p class=\"light f48 m0 uppercase\">Než poprvé vezmete za kliku</p>\r\n<p class=\"light f29  m0 uppercase\">Aneb jak správně vybrat dveře a vše, co k nim patří</p>\r\n<p class=\"f16 light\">Koupě nových dveří je investicí na léta dopředu.  Od nových dveří budeme požadovat, aby dlouhou dobu dokonale plnily svoji  funkci, ale zároveň se stanou nepřehlédnutelným designovým prvkem v  interiéru. Proto je třeba výběr dveří pečlivě předem zvážit.</p>\r\n<h4><span class=\"subHead\"><span>1</span> Počet dveří a jejich rozměry</span></h4>\r\n<p class=\"notop\">Určete, kolik dveří a zárubní potřebujete a jaké budou  rozměry. Nejběžněji používané rozměry jsou 80/197 cm nebo 90/197 cm.  Pro místnosti jako komora či spíž však stačí například dveře o šíři 60  cm. Uvažovaný rozměr dveří podmiňuje velikost stavebního otvoru, do nějž  budou zasazeny.</p>\r\n<p class=\"special\"><a href=\"http://www.sapeli.cz/cs/rady-a-informace/vse-o-dverich/prakticke-rady/umisteni-dveri\">Správná velikost stavebního otvoru je nezbytná pro bezproblémovou instalaci dveří!</a></p>\r\n<h4><span class=\"subHead\"><span>2</span> Otvírání dveří</span></h4>\r\n<p class=\"special\"><a href=\"http://www.sapeli.cz/cs/rady-a-informace/vse-o-dverich/prakticke-rady/zpusob-otevirani-dveri\">Zvolte otevírání dveří dle dispozic interiéru!</a></p>\r\n<h4><span class=\"subHead\"><span>3</span> Design</span></h4>\r\n<p class=\"notop\">Zamyslete se nad výběrem povrchové úpravy. Tradičním  přírodním materiálem je dýha, která je však náročnější na ošetřování.  Pokud máte malé děti nebo domácí mazlíčky, je vhodnější zvolit třeba  odolný povrch CPL. Atraktivním řešením jsou moderní povrchy vacuo nebo  kamenná dýha.</p>\r\n<p class=\"special\"><a href=\"http://www.sapeli.cz/cs/rady-a-informace/vse-o-dverich/prakticke-rady/povrchova-uprava\">Klasika nebo moderní povrch? Každá volba má své přednosti.</a></p>\r\n<p>Volba dekoru je záležitostí osobního vkusu. SAPELI má v sortimentu  bezkonkurenčně nejširší paletu možností. Nejoblíbenější jsou samozřejmě  dřevěné dekory, ale k dispozici je celá řada dalších variant.  Doporučujeme zvažovat sladění dveří především s podlahami a barvou stěn.</p>\r\n<p class=\"special\"><a href=\"http://www.sapeli.cz/cs/rady-a-informace/vse-o-dverich/prakticke-rady/model-dveri-\">Dekor dveří vtiskne interiéru neopakovatelný charakter. Možných kombinací jsou stovky.</a></p>\r\n<p>Důležitý je i výběr prosklení dveří, které může být důležité pro  celkovou světelnou pohodu v bytě. I dveře do ložnice či koupelny mohou  být prosklené, pokud zvolíte nějakou z matných variant skla. Především  rodinám s dětmi doporučujeme pro větší bezpečnost použít kalené sklo se  zvýšenou pevností.</p>\r\n<p>Prosklení dveří pomáhá osvětlení interiéru. Matné nebo čiré sklo? Variant je bezpočet!</p>\r\n<h4><span class=\"subHead\"><span>4</span> Zárubně</span></h4>\r\n<p class=\"notop\">Nedílnou součást krásných a funkčních dveří  představují zárubně. Slouží nejen k upevnění křídla ve stavebním otvoru,  ale dotváří i celkový design. Mohou povrchovou úpravu dveří  vyzdvihnout, doplnit a sladit s okolním interiérem. Díky tomu se ze  dveří a zárubní stává skutečný dveřní komplet. Zárubeň lze vzhledově i  materiálově zcela sladit s povrchem dveřního křídla nebo ji naopak  postavit do kontrastu. Při rekonstrukcích je ideální využít tzv. obklad  kovové zárubně, s jehož pomocí lze staré a nevzhledné kovové zárubně  zakrýt bez nutnosti bourání.</p>\r\n<p class=\"special\"><a href=\"http://www.sapeli.cz/cs/rady-a-informace/vse-o-dverich/prakticke-rady/zarubne\">Zasaďte své nové dveře do perfektně padnoucí zárubně!</a></p>\r\n<h4><span class=\"subHead\"><span>5</span> Kování</span></h4>\r\n<p class=\"notop\">Výběr závěsů můžete podřídit nejen funkčním, ale i  estetickým kritériím. Především klika by jako výrazný designový prvek  měla tvarově odpovídat dveřnímu křídlu.</p>\r\n<p class=\"special\"><a href=\"http://www.sapeli.cz/cs/rady-a-informace/vse-o-dverich/prakticke-rady/kovani-\">Kování podtrhne design dveří!</a></p>\r\n<h4><span class=\"subHead\"><span>6</span> Speciální vlastnosti dveří</span></h4>\r\n<p class=\"notop\">U některých místností je vhodné použít dveře se  speciálními vlastnostmi. Například pro kotelnu doporučujeme použít  protipožární dveře se zvýšenou odolností vůči ohni a kouři. Pracovnu  zase dokonale od ruchu odstíní protihlukové dveře, koupelně se zvýšenou  vlhkostí pomohou klima dveře. SAPELI většinu svých modelů nabízí i v  těchto speciálních provedeních.</p>\r\n</div>\r\n</div>\r\n</div>',NULL,'',''),
(340,7,'Povrchové úpravy','','<p>\r\n<header data-facebook=\"href\" data-facebook-href=\"http://www.sapeli.cz/cs/rady-a-informace/vse-o-dverich/prakticke-rady/povrchova-uprava\">\r\n<h1 data-facebook=\"title\">Rady a informace</h1>\r\n<ul class=\"social-icons\">\r\n    <li class=\"sep\"><a class=\"print-content\" title=\"Tisk\" href=\"http://www.sapeli.cz/cs/rady-a-informace/vse-o-dverich/prakticke-rady/povrchova-uprava#\">Tisk</a></li>\r\n    <li class=\"last\"><a class=\"share-to-facebook\" title=\"Sdílet na Facebook\" href=\"http://www.sapeli.cz/cs/rady-a-informace/vse-o-dverich/prakticke-rady/povrchova-uprava#\">Sdílet na Facebook</a></li>\r\n</ul>\r\n</header>\r\n</p>\r\n<div class=\"left-side printable-content\">\r\n<h2 data-facebook=\"caption\">Povrchová úprava</h2>\r\n<div class=\"dynamic-content\">\r\n<div data-facebook=\"text\" class=\"annotation\">\r\n<p>Podle  čeho z nabízených možností volit, vždyť výběr je tak široký! V základu  se řiďte tím, co je pro vás přirozené a v čem se cítíte dobře.</p>\r\n<p><img height=\"194\" width=\"700\" src=\"http://cms.www.sapeli.cz/cs/goto/Image/88518382617419767-povrchova-uprava-M9hXLtKl.PNG?_signature=6462A93867&amp;height=194&amp;width=700\" alt=\"\" />&#160;</p>\r\n</div>\r\n<p>A protože příroda na člověka jak dobře působí, tak úchvatně vypadá, obraťte svou pozornost zejména na <strong>PŘÍRODNÍ MATERIÁLY</strong>:</p>\r\n<h3>Dýha</h3>\r\n<p><img height=\"181\" width=\"248\" style=\"float: right;\" src=\"http://cms.www.sapeli.cz/cs/goto/Image/88518382617419770-dyha-MdXAMtKl.PNG?_signature=99161CEA1E&amp;height=181&amp;width=248\" class=\"right-image\" alt=\"\" />Tradiční  povrch dveří s přirozenou texturou dřeva, který je rozhodně nadčasovou a  výjimečnou záležitostí. Dýhovaný model dveří s vámi prožije doslova kus  života a díky široké nabídce uspokojí vaši touhu jak po evropských  dřevinách různých textur a barevných odstínů, tak i po nádherném  exotickém dřevě. Dýha vzniká krájením dřeva na pláty o šíři do 0,5 mm, a  protože žádný strom nevyroste dvakrát stejně, nenaleznete ani vy dvě  vzhledově naprosto stejné textury dýh. Co kus – to originál zde platí  doslova. Pokud by se přeci jen požadavek na úplně sjednocený design  tohoto povrchu objevil, nabízí trh řadu tzv. ARO dýh. Nakrájené pláty  dýh se slepí v různých tvarových šablonách do bloku a ten se znovu  nakrájí. Vzniklé listy dýhy se opět sesadí a výsledkem je jednotně  vypadající přírodní dýha.</p>\r\n<p>&#160;</p>\r\n<h3>Masiv</h3>\r\n<p><img height=\"191\" width=\"248\" style=\"float: right;\" src=\"http://cms.www.sapeli.cz/cs/goto/Image/88518382617419773-masiv-Mr__MtKl.PNG?_signature=1BD0CC4FF1&amp;height=191&amp;width=248\" class=\"right-image\" alt=\"\" />Materiál  určený pro skutečné milovníky přírody. Přírodní dřevo s neopakovatelnou  strukturou a jedinečnou barevností, které svou úlohu v interiéru či  exteriéru splní dokonale. Vzhledem ke skutečně masivnímu materiálu je  ovšem třeba počítat s vyšší finanční investicí, než je tomu v případě  dýhy.</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<h3>Kamenné dýhy</h3>\r\n<p><img height=\"210\" width=\"247\" style=\"float: right;\" src=\"http://cms.www.sapeli.cz/cs/goto/Image/88518382617419776-kamenne-dyhy-MJWnNtKl.PNG?_signature=CD1B9082D6&amp;height=210&amp;width=247\" class=\"right-image\" alt=\"\" />Pokud  je přírodní materiál vaším šálkem kávy, ale rádi byste vyzkoušeli ještě  něco jiného, než dřevo, rozhodně neopomeňte na možnost použít kamenné  dýhy. Na první pohled originální povrchový materiál ze skutečného  štípaného kamene - břidlice, opět přírodní materiál, nikoli ovšem  dřevěný, ale kamenný.</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>Ti, kteří nechtějí mít ve svém interiéru přírodní materiály, ale  dávají přednost jejich umělým náhražkám, mají samozřejmě také z čeho  vybírat. Šíře nabídky <strong>UMĚLÝCH DVEŘNÍCH POVRCHŮ</strong>&#160;je vytvořena materiály rozmanitých vlastností:</p>\r\n<p>&#160;</p>\r\n<h3>Vysoký lesk</h3>\r\n<p>Povrch má tloušťku 0,7 mm a snadno se udžuje. Představuje jednu ze  skutečně luxusních a exkluzivních povrchových úprav, která dveřní křídlo  dolaďuje s interiérovým nábytkem ve vysokém lesku do jednoho uceleného  kompletu.</p>\r\n<p>&#160;</p>\r\n<h3>Vacuo povrch</h3>\r\n<p><img height=\"208\" width=\"245\" style=\"float: right;\" src=\"http://cms.www.sapeli.cz/cs/goto/Image/88518382617419797-vacuo-MKqQVtKl.PNG?_signature=0F4D9630BF&amp;height=208&amp;width=245\" class=\"right-image\" alt=\"\" />Tento  povrchový materiál má tloušťku 0,4 mm. Použitá barevná škála je v  několika trendy odstínech. Speciální fólie představující technologickou  revoluci v zalisování povrchu dveří. Je nanášena v bezprašném prostředí  za využití podtlaku vacua, který zajišťuje zcela ideálního přilnutí k  ploše dveří. Je jako stvořená pro vytvoření 3D motivů a obrázků na  dveřích.&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<h3>CPL a HPL lamináty</h3>\r\n<p><img height=\"265\" width=\"249\" style=\"float: right;\" src=\"http://cms.www.sapeli.cz/cs/goto/Image/88518382617419801-cpl-MwYfWtKl.PNG?_signature=7E7DBA807B&amp;height=265&amp;width=249\" class=\"right-image\" alt=\"\" />Vysoce  mechanicky odolné materiály, které dobře snáší náročnější provoz jak v  bytových domech, kancelářských prostorách nebo veřejných budovách, jedná  se o základní umělý materiál imitující texturu dřeva nebo nabízející  širokou barevnou škálu.&#160;<br />\r\nCPL - střednětlaký laminát tloušťky 0,2 mm.  Tento materiál je odolný proti mechanickému poškození, výhodou je i  snadná údržba a odolnost proti běžně používaným čistícím i dezifenkčním  prostředkům, vhodný do rodinných a bytových domů, kancelářských budov  apod. CPL laminát je povrch, který dobře snáší rodinný provoz s malými  dětmi či domácími mazlíčky.&#160;<br />\r\nHPL - vysokotlaký laminát tloušťky 0,8  mm. HPL má vysokou odolnost proti mechanickému poškození a oděru,  výhodou je také snadná údržba a vysoká odolnost vůči čistícím a  dezifenkčním prostředkům používaným zejména ve zdravotnictví. Je vhodný  do extrémně namáhaných prostor, např.: zdravotnická zařízení, školy,  výrobní prostory, sportovní zařízení, supermarkety, apod.&#160;</p>\r\n<p>&#160;</p>\r\n<h3>Fólie</h3>\r\n<p>Cenově výhodný materiál ve zcela přirozeně působících dekorech dřeva,  vhodný do běžně užívaných prostor rodinných domů a bytů. Její hlavní  předností je nízká cena a jednotná barevnost na výrobcích.</p>\r\n<p>&#160;&#160;</p>\r\n<h3>Stone</h3>\r\n<p>Kamenná dýha – kámen je tradiční stavební materiál, ale použití na  dveřích je překvapivé a velmi efektní v každém interiéru. Kamenná dýha  je vyrobena z pravé štípatelné břidlice, tloušťky 1 – 4 mm, což vytváří  unikátní smyslový zážitek.</p>\r\n<p>&#160;&#160;</p>\r\n<h3>Barva</h3>\r\n<p>Povrchová úprava nástřikem barvy. Vybírat nejvhodnější barvu můžete  ze široké škály vzorníku RAL. Nástřik je citlivější na mechanický otěr,  proto jsou tyto dveře určeny pro nízké namáhání.</p>\r\n</div>\r\n</div>',NULL,'',''),
(341,7,'Způsoby otevírání','','<p>\r\n<header data-facebook=\"href\" data-facebook-href=\"http://www.sapeli.cz/cs/rady-a-informace/vse-o-dverich/prakticke-rady/zpusob-otevirani-dveri\">\r\n<h1 data-facebook=\"title\">Rady a informace</h1>\r\n</header>\r\n</p>\r\n<div class=\"left-side printable-content\">\r\n<h2 data-facebook=\"caption\">Způsob otevírání dveří</h2>\r\n<div class=\"dynamic-content\">\r\n<h3>Otočné dveře</h3>\r\n<p><img height=\"296\" width=\"249\" style=\"float: right;\" src=\"http://cms.www.sapeli.cz/cs/goto/Image/88518382617412448-otocne-dvere-MhlHFqKl.PNG?_signature=893FC11B2F&amp;height=296&amp;width=249\" class=\"right-image\" alt=\"\" />Jedná  se o klasický typ otevírání, kdy dveřní křídlo visí na jedné straně na  pantech a na druhé straně je klika, jejíž pomocí dveře otevřete směrem  buď k sobě, nebo od sebe<br />\r\nRozmyslete si, jestli se budou dveře  otevírat směrem ven, nebo do místnosti a na které straně budou panty a  kde klika, tzn., jestli budete potřebovat levé nebo pravé dveře</p>\r\n<p>Pokud budete měnit stávající dveře a nejste si jisti, jestli jsou to  pravé nebo levé dveře, zkuste tento jednoduchý návod: postavte se tak  abyste viděli panty, tzn., tak že dveře se teď otevírají směrem k vám.  Pokud jsou panty po vaší levé ruce, jedná se o levé dveře, pokud jsou po  pravé, jsou to pravé dveře.&#160;</p>\r\n<h3>&#160;</h3>\r\n<h3>Posuvné dveře</h3>\r\n<p><img height=\"499\" width=\"273\" style=\"float: right;\" src=\"http://cms.www.sapeli.cz/cs/goto/Image/88518382617412454-posuvne-dvere-MXBFGqKl.PNG?_signature=A5F6CE0B96&amp;height=499&amp;width=273\" class=\"right-image\" alt=\"\" />Velmi elegantní a praktický způsob jak v místnosti ušetřit tolik ceněný prostor. Na výběr máte z několika druhů posuvů.</p>\r\n<p><strong>Dveře posuvné do pouzdra&#160;</strong></p>\r\n<ul>\r\n    <li>Jsou vhodné do novostaveb nebo při rozsáhlejších rekonstrukcích, protože vyžadují větší stavební úpravy.</li>\r\n    <li>spočívá v tom, že do stěny je zabudováno \"stavební pouzdro\", do kterého zajíždí dveřní křídlo</li>\r\n    <li>stavební pouzdra jsou uzpůsobena jak pro sádrokartonové tak i pro zděné příčky</li>\r\n    <li>pouzdra se liší podle toho, kde jsou umístěna a kolik dveřních křídel do nich zajíždí.</li>\r\n</ul>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p><strong>Dveře posuvné na stěnu</strong></p>\r\n<p>Tento způsob je stavebně méně náročný,&#160;dveřní křídlo se pohybuje po  kolejnici, která je připevněná přímo na stěnu. Posuv je možné použít na  jednokřídlé i dvoukřídlé dveře a&#160;můžete si vybrat skrytý nebo viditelný  posuv.</p>\r\n<p><img height=\"85\" width=\"646\" style=\"float: right;\" src=\"http://cms.www.sapeli.cz/cs/goto/Image/88518382617412463-dvere-na-stenu-MGCRHqKl.PNG?_signature=73D62827BC&amp;height=85&amp;width=646\" class=\"right-image\" alt=\"\" /></p>\r\n<h3>&#160;</h3>\r\n<h3>&#160;</h3>\r\n<h3>&#160;</h3>\r\n<h3>Lamelové dveře</h3>\r\n<ul>\r\n    <li>\r\n    <p>tento způsob je vhodný do prostorově omezených místností</p>\r\n    </li>\r\n    <li>\r\n    <p>lze ho použít na jednokřídlé i dvoukřídlé dveře</p>\r\n    </li>\r\n    <li>\r\n    <p>zvolit si můžete ze dvou typů:</p>\r\n    </li>\r\n</ul>\r\n<ol>\r\n    <ul>\r\n        <li><strong>Skládací dveře</strong></li>\r\n    </ul>\r\n</ol>\r\n<div>\r\n<ul>\r\n    <ul>\r\n        <ul>\r\n            <li>ve složeném stavu zasahují pouze na jednu stranu</li>\r\n            <li>šířka dveřních lamel je stejná</li>\r\n        </ul>\r\n    </ul>\r\n</ul>\r\n<p><img height=\"128\" width=\"570\" style=\"float: right;\" src=\"http://cms.www.sapeli.cz/cs/goto/Image/88518382617412466-lamelove-dvere-MsXjIqKl.PNG?_signature=9E927A9EC1&amp;height=128&amp;width=570\" class=\"right-image\" alt=\"\" /></p>\r\n<div>\r\n<ul>\r\n    <ul>\r\n        <li><strong>Harmonikové dveře</strong>\r\n        <ul>\r\n            <li>ve složeném stavu zasahují do obou oddělovaných prostorů</li>\r\n            <li>skládá se z&#160;jedné širší a jedné užší lamely</li>\r\n        </ul>\r\n        </li>\r\n    </ul>\r\n</ul>\r\n<p><img height=\"125\" width=\"569\" style=\"float: right;\" src=\"http://cms.www.sapeli.cz/cs/goto/Image/88518382617412470-harmonikove-dvere-McTXIqKl.PNG?_signature=83A58C57EF&amp;height=125&amp;width=569\" class=\"right-image\" alt=\"\" /></p>\r\n<p>&#160;</p>\r\n</div>\r\n<h3>&#160;</h3>\r\n<p>&#160;</p>\r\n<p>&#160;&#160;</p>\r\n<h3>Otevírání v obou směrech</h3>\r\n<p>Tento způsob otevírání, který kombinuje možnosti \"otočného a  posuvného\" křídla v jednom mechanismu, minimalizuje nároky na půdorysný  prostor otevřeného křídla. Jsou vhodné do všech interiérů a nemají žádné  zvláštní požadavky na stavební konstrukci.</p>\r\n<h3><img height=\"123\" width=\"605\" src=\"http://cms.www.sapeli.cz/cs/goto/Image/88518382617412477-otevirani-v-obou-smerech-MNmBKqKl.PNG?_signature=5E16D36E96&amp;height=123&amp;width=605\" alt=\"\" /></h3>\r\n<h3>Kyvné otevírání</h3>\r\n<ul>\r\n    <li><img height=\"199\" width=\"91\" style=\"float: right;\" src=\"http://cms.www.sapeli.cz/cs/goto/Image/88518382617412485-kyvne-otevirani-MvJkMqKl.PNG?_signature=DDE378241F&amp;height=199&amp;width=91\" class=\"right-image\" alt=\"\" />Jinak bychom ho také mohli nazvat \"lítačky\"</li>\r\n    <li>pouhým zatlačením je možné dveře otevřít z obou stran</li>\r\n    <li>jsou vhodné spíš do veřejných prostor – nemocnice,</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>',NULL,'',''),
(344,7,'Plechové ZK dveře Bedex - eshop','','<p><img src=\"http://www.plechove-dvere.cz/images/small/540000025.jpg\" alt=\"detail\" /><img src=\"http://www.plechove-dvere.cz/images/small/540000030.jpg\" alt=\"detail\" /></p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<h2><a href=\"http://www.dvere.com/plechove-zk-dvere-bedex-eshop-zk-dvere-bez-izolace-pozink-c-39_344_345.html\">ZK PLECHOVÉ DVEŘE</a></h2>\r\n<p>&#160;</p>\r\n<p>ZK plechové dveře jsou tvarovou obdobou klasických dřevěných dveří,  skládají se ze dvou částí: užší části (vany) a širší části (víka). Jsou  hladké, bez požární odolnosti. Jednokřídlové jsou standardně vyrobeny z  pozinkovaného plechu o síle 0,55 mm (lze použít i plech 0,8 za příplatek  450,-), dvoukřídlé jsou vyrobeny vždy z pozinkovaného plechu 0,8mm,  který zaručuje vysokou odolnost proti korozi a umožňuje použití téměř  všech povrchových úprav. Dveře jsou osazeny zámkem FAB 190/140 (rozteč  72 mm). V místě závěsů jsou dveře zesíleny dřevěnými a u zámku  plastovými výztuhami. Ocelový plášť je vyplněn papírovou voštinou. Dveře  jsou atestovány na tepelnou a zvukovou propustnost. Tyto atesty platí  pouze pro dveře jednokřídlové.&#160;<span style=\"font-family: Arial\" class=\"Apple-style-span\">Dveře jsou osazeny dveřními závěsy 80/10 VD M8 Ni.</span></p>\r\n<p>ZK plechové dveře lze vyrobit i jako dvoukřídlové, fixace pasivního křídla je zajištěna zadlabacími zastrčeni.</p>\r\n<p class=\"red\">Vážená neprůzvučnost dle ČSN EN ISO140 - 3, ČSN EN ISO 717 - 1:</p>\r\n<p>a) dveře a zárubeň bez prahu - Rw(C;Ctr) =26 (-1; -3) dB</p>\r\n<p class=\"red\">Vážená neprůzvučnost dle ČSN EN ISO140 - 3, ČSN EN ISO 717 - 1:</p>\r\n<p>b) dveře a zárubeň s prahem - Rw(C;Ctr) =30 (-1; -3) dB</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<h2><a href=\"http://www.dvere.com/plechove-zk-dvere-bedex-eshop-zk-dvere-izolovane-pozink-c-39_344_346.html\">ZK PLECHOVÉ DVEŘE IZOLOVANÉ</a></h2>\r\n<p>&#160;</p>\r\n<p>Plechové dveře ZK izolované jsou tvarovou obdobou klasických  dřevěných dveří, skládají se ze dvou částí: užší části (vany) a širší  části (víka). Jsou hladké, bez požární odolnosti. Jednokřídlové i  dvoukřídlové jsou vždy vyrobeny z pozinkovaného plechu o síle 0,8 mm,  který zaručuje vysokou odolnost proti korozi a umožňuje použití téměř  všech povrchových úprav. Dveře jsou osazeny zámkem FAB 190/140 (rozteč  72 mm). V místě závěsů jsou dveře zesíleny dřevěnými a u zámku  plastovými výztuhami. Ocelový plášť je vyplněn tepelně izolačním  materialem. Dveře jsou atestovány na tepelnou a zvukovou prostupnost.  Tyto atesty platí pouze pro dveře jednokřídlové.&#160;<span style=\"font-family: Arial\" class=\"Apple-style-span\">Dveře jsou osazeny dveřními závěsy 80/10 VD M8 Ni.</span></p>\r\n<p>ZK plechové dveře izolované lze vyrobit i jako dvoukřídlové, fixace pasivního křídla je zajištěna zadlabacími zastrčeni.</p>\r\n<p class=\"red\">Součinitel prostupu tepla dle ČSN EN ISO 12567-1:</p>\r\n<p>U<sub>N(D)</sub> = 1,46 W/(m<sup>2</sup>.K)</p>\r\n<p class=\"red\">Vážená neprůzvučnost dle ČSN EN ISO140 - 3, ČSN EN ISO 717 - 1:</p>\r\n<p>R<sub>W</sub> (C; C<sub>tr</sub>) = 28 (-3; -4) dB</p>\r\n<p><strong>Použití ZK plechových dveří</strong></p>\r\n<p>Tyto dveře se díky svým výhodám používají v celé řadě prostředí jako  jsou kancelářské a správní budovy, půdní vestavby a výrobní prostory,  ale také pro obytné kontejnery a z nich zhotovené modulární stavby. Díky  svému plášti z žárově pozinkovaného plechu se výborně hodí do sklepních  prostor a vlhkého prostředí jako jsou např. veřejné sprchy a bazény.  Dveře lze jednoduše udržovat jednoduchým omytím.</p>\r\n<p>&#160;</p>\r\n<h2><a href=\"http://www.dvere.com/plechove-zk-dvere-bedex-eshop-zk-dvere-bez-izolace-pozink-c-39_344_345.html\">ZK PLECHOVÉ DVEŘE</a>SE ZÁKLADOVOU BARVOU</h2>\r\n<h2><a href=\"http://www.dvere.com/plechove-zk-dvere-bedex-eshop-zk-dvere-izolovane-pozink-c-39_344_346.html\">ZK PLECHOVÉ DVEŘE IZOLOVANÉ</a> SE ZÁKLADOVOU BARVOU</h2>',NULL,'',''),
(347,7,'ZK dveře bez izol. se zákl. barv','','',NULL,'',''),
(349,7,'dveře Solodoor','','<p>SOLODOOR a.s. je tradičním, ryze českým výrobcem interiérových dveří a  obložkových zárubní, který na českém trhu figuruje již od roku 1998.</p>\r\n<p>Vyberte si z nabídky, dveří či obložkových zárubní společnosti  SOLODOOR. Samozřejmě nechybí ani kvalitní protipožární dveře, posuvné  dveře do pouzdra či dveře protihlukové. Ke každým dveřím vám můžeme  dodat i zárubně, které se k vám zvoleným dveřím budou skvěle hodit.</p>\r\n<p>&#160;</p>\r\n<p>Sestavte si dveře dle svých představ:</p>\r\n<p><a href=\"http://www.sestavsidvere.cz/dealer-antrea\"><img alt=\"\" src=\"data:image/png;base64,\" /></a></p>',NULL,'',''),
(350,7,'Vchodové dveře','','<p>&#160;</p>\r\n<h1>Vnitřní vchodové dveře</h1>\r\n<p>&#160;</p>\r\n<div class=\"boxik_obsah_left\">&#160;</div>\r\n<table>\r\n    <tbody>\r\n        <tr>\r\n            <td class=\"boxik_dvere\"><img width=\"89\" alt=\"\" src=\"http://www.sestavsidvere.cz/foto/2/b02000003.jpg\" />\r\n            <h2><a href=\"http://www.sestavsidvere.cz/cs/pozarni-odolne/\">Dveře požárně odolné</a></h2>\r\n            <p>Dveře  požárně odolné lze použít jako vchodové do bytu a  všude tam, kde to  z&#160;bezpečnostních důvodů požadují ČSN. Požární  odolnost je EI<sub>2</sub>30 (E30, EW30), to znamená, že odolají požáru 30 min.</p>\r\n            </td>\r\n            <td class=\"boxik_dvere\"><img width=\"89\" alt=\"\" src=\"http://www.sestavsidvere.cz/foto/3/b03000208.jpg\" />\r\n            <h2><a href=\"http://www.sestavsidvere.cz/cs/pozarni-bezpecnostni-tr2/\">Dveře požárně odolné bezpečnostní třída 2</a></h2>\r\n            <p>Dveře požárně odolné bezpečnostní třída 2 mají požární odolnost 30 minut EI<sub>2</sub>30 (E30, EW 30)&#160;dle ČSN EN 1634-1 a splňují požadavky na bezpečnostní třídu B2, dle ČSN P EN 1627.</p>\r\n            <p>Oproti dveřím požárně odolným mají navíc pětibodový  bezpečnostní  zámek TRILOGIA&#160; a u horního a spodního pantu trny proti  vysazení dveří.</p>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td class=\"boxik_dvere\"><img width=\"89\" alt=\"\" src=\"http://www.sestavsidvere.cz/foto/2/b02000006.jpg\" />\r\n            <h2><a href=\"http://www.sestavsidvere.cz/cs/?pageState&amp;global_filter=4&amp;noJump=true\">Protihlukové dveře</a></h2>\r\n            <p>Protihlukové  dveře vytváří pocit soukromí, snižují  prostup zvuku dveřmi (lednice 40  dB, myčka 42 dB, šeptání 20 dB,  napouštění vody do vany 80 dB).</p>\r\n            <p>(při objednávce zaškrtněte příplatek protihlukové)</p>\r\n            </td>\r\n            <td class=\"boxik_dvere\"><img width=\"89\" alt=\"\" src=\"http://www.sestavsidvere.cz/foto/2/b02000005.jpg\" />\r\n            <h2><a href=\"http://www.sestavsidvere.cz/cs/?pageState&amp;global_filter=5&amp;noJump=true\">Kouřotěsné dveře</a></h2>\r\n            <p>Dveře požárně odolné v obložkové protipožární zárubni SOLO mohou být jako kouřotěsné proti průniku studeným a teplým kouřem EI<sub>2</sub>30-S<sub>m</sub>(S<sub>a</sub>).   Na rozdíl od dveří požárně odolných mají vysouvací práh ELLAN MATIC   PRIMERA a dvoukřídlé dveře mají klapačku (těsnění ELLENLEF – K).</p>\r\n            <p>Lze je použít jako vchodové do bytu a všude tam, kde to z&#160;bezpečnostních důvodů požadují ČSN.</p>\r\n            </td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<p>&#160;</p>',NULL,'',''),
