(353,7,'Povrchové úpravy','','<p>&#160;</p>\r\n<h1>Dezény dveří</h1>\r\n<div class=\"boxik_obsah_right vypis\">\r\n<p>Vzhledem k rozdílnostem v technologiích výroby použitých  materiálů, z nichž jsou dveře a obložkové zárubně vyrobeny, nemusí být u  povrchů vždy dosažena 100% shoda barevnosti dekorů a toto se nepovažuje  za vadu a nemůže být předmětem reklamace.</p>\r\n<h2>MDF</h2>\r\n<div>\r\n<div class=\"item\"><img src=\"http://www.sestavsidvere.cz/data/dezen/116.png\" alt=\"\" />                                                                                                                  <strong>                                                                                                                      bílá speciál                                                                                                                  &#160;</strong></div>\r\n</div>\r\n<h2>fólie</h2>\r\n<div>\r\n<div class=\"item\"><img src=\"http://www.sestavsidvere.cz/data/dezen/000.png\" alt=\"\" />                                                                                                                  <strong>                                                                                                                      bílá                                                                                                                  &#160;</strong></div>\r\n<div class=\"item\"><img src=\"http://www.sestavsidvere.cz/data/dezen/001.png\" alt=\"\" />                                                                                                                  <strong>                                                                                                                      buk                                                                                                                  &#160;</strong></div>\r\n<div class=\"item\"><img src=\"http://www.sestavsidvere.cz/data/dezen/002.png\" alt=\"\" />                                              