(355,7,'dveře Sapeli na splátky','','<div class=\"left-side\">\r\n<div class=\"printable-content\">\r\n<h2 data-facebook=\"caption\">SAPELI nabízí prodej na splátky</h2>\r\n<div class=\"dynamic-content\">\r\n<div data-facebook=\"text\" class=\"annotation\">\r\n<h4>Zákazníci SAPELI mají nově možnost zakoupit si dveře a zárubně na splátky.</h4>\r\n</div>\r\n<img class=\"master-image left-image\" title=\"SAPELI nabízí prodej na splátky\" alt=\"SAPELI nabízí prodej na splátky\" data-facebook=\"image\" src=\"http://cms.www.sapeli.cz/cs/goto/Image/88518382617549567-home-credit-logo-cmyk-MKtDDkLl.png?_signature=5C1FFD8D41&amp;width=300\" />\r\n<p>Splátkový prodej zajišťují smluvní autorizovaní prodejci SAPELI prostřednictvím společnosti Home Credit.</p>\r\n<p>Nákup na splátky probíhá již od 3 000 Kč. Délka splátky je volitelná, a to od 10 do 60 měsíců.</p>\r\n<h4>Jak na to?</h4>\r\n<ul>\r\n    <li>Úvěr uzavřete ihned při výběru zboží na prodejně.</li>\r\n    <li>Předložíte dva doklady totožnosti:o u občanů ČR musí být jeden z  nich vždy občanský průkaz,o druhým dokladem může být například řidičský  průkaz, cestovní pas, rodný list, zbrojní průkaz, průkaz zdravotní  pojišťovny nebo platební karta</li>\r\n    <li>Při úvěru nad 50 000 korun je nutný doklad o výši příjmů v podobě  potvrzení o výši příjmu od zaměstnavatele na formuláři od Home Credit,  kopie daňového přiznání, důchodový výměr či jiný doklad.</li>\r\n    <li>Smlouva bude schválena na počkání.</li>\r\n</ul>\r\n<h4>Kdo může o úvěr na dveře a zárubně zažádat?</h4>\r\n<ul>\r\n    <li>osoba, která dosáhla plnoletosti</li>\r\n    <li>osoba se stálým zdrojem svých příjmů, které může doložit.</li>\r\n</ul>\r\n<p>Nákup na splátky je možný u smluvních autorizovaných prodejců SAPELI, kteří poskytnou i všechny potřebné upřesňující informace.</p>\r\n</div>\r\n</div>\r\n</div>',NULL,'',''),
