(104,7,'kliky kování Twin','kliky kování Twin','Dodavatel kvalitního dveřního kování z nerezové oceli, mosazi a hliníku v širokém sortimentu, založena 1992. Kování jsou vyráběna dle standardů jakosti ČSN EN ISO 9001 : 2000 s užitím nejmodernějších povrchových úprav proti povrchovému poškození Inoxchrom a Zirkonium. Dlouholetá záruka.','','',''),
(105,7,'kliky kování Act servis','kliky Act servis','Nabízí kvalitní dveřní kování, moderní design a funkčnost. Kliky jsou vyrobeny z ušlechtilých<br />\r\nmateriálů, jako je mosaz a nerez ocel. Záruka u některých kolekcí 20 let.','','',''),
(106,7,'kliky kování Holar','kliky Holar','Klika jako šperk.<br />\r\nKování, které splňuje požadavky bytových a občanských staveb., je elegantní, moderní a trvanlivé kvality, vyrobené z ušlechtilých materiálů., příjemné na dotek, ladné na pohled a vkusně dotváří harmonii užitného prostoru. Jedná se o výrobky s absolutní odolností povrchu proti opotřebení, tvarově stálé, probarvené ve hmotě a hygienicky nezávadné. <br />\r\nProces výroby je certifikován dle ČSN EN ISO 9001 : 2000.<br />\r\n<br />\r\n<br />\r\n<a href=\"/File/Cenik-Holar_cerven07.xls\">ceník ke stažení </a>','','','kliky kování holar'),
(107,7,'kliky kování Cobra','kliky Cobra','Jako dodavatel kování na českém trhu se etablovala v roce 1991.<br />\r\nNabízí nejširší sortiment stavebního a nábytkového kování sestávající se z několika desítek modelů kování a dalších stovek typových provedení, v nejrůznějších designech, mnoha povrchových úpravách a také bohaté nabídce doplňků.','','',''),
(108,7,'kliky kování Martinelli','kliky Martinelli','FMN Martinelli S.p.A. je jedním z největších producentů mosazného kování v Itálii. Firma FMN Martinelli vznikla v roce 1968 v oblasti Valle Sabia v severní Itálii, kde je tradicí vášeň a odbornost pro zpracování mosazi. Sortiment tvoří kliky, koule, madla, zámky, klepadla, věšáky, dveřní doplňky, okenní kování, držáky zábradlí, dveřní zarážky, rozety.','','',''),
