(253,7,'dveře Lualdi','Designové dveře','<p>Unikátní, originální a vysoce moderní dveře Lualdi od italského výrobce jsou navrhovány předními italskými návrháři. Uspokojí jakkoliv náročné požadavky zákazníků. Jednotlivé modelové řady mají originální tvary a umožňují výběr z mnoha povrchových úprav: odstínů barev, dýh, skel. Unikátní a špičkově moderní modely dveří Lualdi jsou vhodné do bytů, kanceláří, hotelů a komerčních prostor. Každá modelová řada představuje originální a netradiční řešení, o žádné z nich nelze říci ,,normální dveře\", vždy se jedná o dveře, které potěší jak svým nápadem technického řešení, tak dokonalým designem. Dveře Lualdi dodají ,,šmrnc\" jakémukoliv interiéru, oceníte i praktické stránky technického řešení.</p>\r\n<p>V posledních letech je firma Lualdi velice úspěšná v prodeji dveří na Miami. V Americe mají lidé trochu odlišný vkus a používají se různá alternativní řešení interiérů. Firma Lualdi pojímá řešení interiérů opravdu osobitým způsobem a ve spojení s požadavky náročných klientů přichází na nevídané designy a technická řešení.</p>\r\n<p>Můžete se sami přesvědšit prohlídkou&#160; <a href=\"/file/Lualdi_news-June_2011.pdf\">katalogu novinek</a> a katalogu <a href=\"/file/American_Collection.pdf\">Americká kolekce</a></p>',NULL,'',''),
