(112,7,'dveře Lualdi','dveře Lualdi','<p>Unikátní, originální dveře Lualdi od italského výrobce, diktující nové designové směry.\r\n<br />\r\n Ke dveřím dodává výrobce také nábytek a lehké příčkové systémy, které umožňují variabilní řešení oddělení prostor a úložného prostoru, z totožnou povrchovou úpravou jako mají dveře, interiérové prvky lze tedy sladit dokonale dle individuálních požadavků. Dále výrobce vyrábí speciální zakázkové dveře do hotelů a reprezentativních prostor, vstupů do komerčních či veřejných budov apod., výstavní nábytek do obchodů a na výstavy, kompletní vybavení interiérů kancelářských budov a komerčních prostor. </p>\r\n<p><br />\r\nJednotlivé modelové řady mají originální tvary a umožňují výběr z mnoha odstínů barev, dýh, skel.  \r\n<p><br />','','',''),
