(264,7,'SWING, posuvné hliníkové','','Systém posuvných dveří s prosklením z jednoduchého skla, které mohou být použity jako jednoduché posuvné dveře nebo tvořit plně funkční část zdi. Schopnost systému vytvořit plný vjem průhlednostii, prosvětlenosti se velice dobře hodí do designovým trendům směrem k otevřeným a komunikativním prostorům. Zárubeň a posuvný mechanismus jsou vyrobeny z eloxovaného hliníku. Dveře jsou zaskleny bezpečnostními skly v čirém či matném provedení nebo osazeny výplné z dubového dřeva. Madlo je neviditelně zakomponované do úzkého rámu dveří. Systém Swing se dodává také v pevném provedení pro maximální funkčnost jako dělící příčky.',NULL,'',''),
