(268,7,'dveře FerreroLegno','','<p>J<img width=\"788\" height=\"290\" src=\"http://www.ferrerolegnoporte.it/img_sito/prodotto/testata_970x290/01_cze.jpg\" alt=\"Ferrero Legno\" /></p>\r\n<div style=\"z-index: 986;\" class=\"wrap_colonne testo\">\r\n<div style=\"z-index: 985;\" class=\"colonna prima\">\r\n<p>Detaily nejsou jen pouhými detaily, ale prvky, které ka<span class=\"car\">ž</span>dému z  výrobk<span class=\"car\">ů</span> zaji<span class=\"car\">š</span><span class=\"car\">ť</span>uj<span class=\"car\">í</span> nenapodobitelnost. Dve<span class=\"car\">ř</span>e FerreroLegno jsou jedine<span class=\"car\">č</span>né,</p>\r\n<p>proto<span class=\"car\">ž</span>e svým vynikaj<span class=\"car\">í</span>c<span class=\"car\">í</span>m pom<span class=\"car\">ě</span>rem kvalita-cena v<span class=\"car\">š</span>estrann<span class=\"car\">ě</span> uspokojuj<span class=\"car\">í</span> i n<span class=\"car\">á</span>ro<span class=\"car\">č</span>n<span class=\"car\">ě</span>j<span class=\"car\">š</span><span class=\"car\">í</span> z<span class=\"car\">á</span>kazn<span class=\"car\">í</span>ky.</p>\r\n</div>\r\n<div style=\"z-index: 984;\" class=\"colonna seconda\">\r\n<p>Tato rovnov<span class=\"car\">á</span>ha je dosa<span class=\"car\">ž</span>ena d<span class=\"car\">í</span>ky nad<span class=\"car\">š</span>en<span class=\"car\">í</span>, pe<span class=\"car\">č</span>livému studiu a ka<span class=\"car\">ž</span>dodenn<span class=\"car\">í</span> pr<span class=\"car\">á</span>ci t<span class=\"car\">ě</span>ch, kdo se sna<span class=\"car\">ž</span><span class=\"car\">í</span> nab<span class=\"car\">í</span>dnout v<span class=\"car\">á</span>m to nejlep<span class=\"car\">š</span><span class=\"car\">í</span>, a to ve v<span class=\"car\">š</span>ech sm<span class=\"car\">ě</span>rech.</p>\r\n</div>\r\n</div>\r\n<div style=\"z-index: 983;\" class=\"wrap_liste_prodotto\"><br />\r\n<div style=\"z-index: 982;\" class=\"singola_lista_prodotto prima\">\r\n<div style=\"z-index: 981;\" class=\"cont_lista sx\">\r\n<h2>Lakov<span class=\"car\">á</span>n<span class=\"car\">í</span> polyesterovými laky - osvobozuje t<span class=\"car\">ř</span>pyt</h2>\r\n<p>Svou dokonalost<span class=\"car\">í</span> se n<span class=\"car\">á</span>t<span class=\"car\">ě</span>r lesklým polyesterovým lakem  FerreroLegno  st<span class=\"car\">á</span>v<span class=\"car\">á</span> zrcadlem, je<span class=\"car\">ž</span> ve va<span class=\"car\">š</span>em obl<span class=\"car\">í</span>beném barevném odst<span class=\"car\">í</span>nu mnohokr<span class=\"car\">á</span>t v<span class=\"car\">ě</span>rn<span class=\"car\">ě</span></p>\r\n<p>zobraz<span class=\"car\">í</span> v<span class=\"car\">á</span><span class=\"car\">š</span> obraz. Tato technologie zaru<span class=\"car\">č</span>uje nejen typické vlastnosti jako je lesk, plnost a povrchovou tvrdost polyesteru, ale také dlouhodobou <span class=\"car\">ž</span>ivotnost</p>\r\n<p>n<span class=\"car\">á</span>t<span class=\"car\">ě</span>rového povlaku.</p>\r\n<div style=\"z-index: 980;\" class=\"link_prodotto\">&#160;</div>\r\n</div>\r\n</div>\r\n<br />\r\n<div style=\"z-index: 979;\" class=\"singola_lista_prodotto seconda\">\r\n<div style=\"z-index: 978;\" class=\"cont_lista dx\">\r\n<h2>Texture trame</h2>\r\n<h3>Osvobozuje fantazii</h3>\r\n<p>I p<span class=\"car\">ř</span>es perfektn<span class=\"car\">í</span> zpracov<span class=\"car\">á</span>n<span class=\"car\">í</span> pod nep<span class=\"car\">ř</span>etr<span class=\"car\">ž</span>itou kontrolou kvality, kterou FerreroLegno pravideln<span class=\"car\">ě</span> prov<span class=\"car\">á</span>d<span class=\"car\">í</span> v ka<span class=\"car\">ž</span>dé výrobn<span class=\"car\">í</span> f<span class=\"car\">á</span>zi, d<span class=\"car\">ř</span>evo z<span class=\"car\">ů</span>st<span class=\"car\">á</span>v<span class=\"car\">á</span> d<span class=\"car\">ř</span>evem a textura</p>\r\n<p><span class=\"car\">ž</span>ilek odpov<span class=\"car\">í</span>d<span class=\"car\">á</span> p<span class=\"car\">ř</span>edev<span class=\"car\">š</span><span class=\"car\">í</span>m fantazii p<span class=\"car\">ř</span><span class=\"car\">í</span>rody ne<span class=\"car\">ž</span> v<span class=\"car\">ů</span>li designer<span class=\"car\">ů</span>. Výsledkem jsou origin<span class=\"car\">á</span>ln<span class=\"car\">í</span> dve<span class=\"car\">ř</span>e jedine<span class=\"car\">č</span>né svou exkluzivn<span class=\"car\">í</span> individualitou.</p>\r\n</div>\r\n</div>\r\n<br />\r\n<div style=\"z-index: 976;\" class=\"singola_lista_prodotto terza\">\r\n<div style=\"z-index: 975;\" class=\"cont_lista sx\">\r\n<h2>Technologie pantograf - osvobozuje tvar</h2>\r\n<p>Speci<span class=\"car\">á</span>ln<span class=\"car\">í</span> brýle nejsou nutné, trojrozm<span class=\"car\">ě</span>rnost tohoto zp<span class=\"car\">ů</span>sobu zpracov<span class=\"car\">á</span>n<span class=\"car\">í</span> je viditeln<span class=\"car\">á</span> na prvn<span class=\"car\">í</span> pohled: hrany jsou perfektn<span class=\"car\">í</span>, sled geometrických tvar<span class=\"car\">ů</span> do sebe p<span class=\"car\">ř</span>esn<span class=\"car\">ě</span> zapad<span class=\"car\">á</span>.</p>\r\n<p>Je zde s<span class=\"car\">í</span>la, materi<span class=\"car\">á</span>l, p<span class=\"car\">ř</span>esnost, technologie, je zde um<span class=\"car\">ě</span>n<span class=\"car\">í</span>. Jsou p<span class=\"car\">ř</span>ipraveny des<span class=\"car\">í</span>tky barev. Jediné, co na dve<span class=\"car\">ř</span><span class=\"car\">í</span>ch FerreroLegno nenajdete, je zp<span class=\"car\">ů</span>sob je imitovat.</p>\r\n</div>\r\n</div>\r\n<br />\r\n<div style=\"z-index: 974;\" class=\"singola_lista_prodotto quarta\">\r\n<div style=\"z-index: 973;\" class=\"cont_lista dx\">\r\n<h2>Systém dvojité sklo - osvobozuje sv<span class=\"car\">ě</span>tlo</h2>\r\n<p>Ka<span class=\"car\">ž</span>dé dve<span class=\"car\">ř</span>e s tvrzeným sklem FerreroLegno vzbuzuj<span class=\"car\">í</span> p<span class=\"car\">ř</span><span class=\"car\">í</span>jemný estetický dojem: bytové prostory tak z<span class=\"car\">í</span>skaj<span class=\"car\">í</span> na lehkosti, zd<span class=\"car\">ů</span>razn<span class=\"car\">í</span> se hra sv<span class=\"car\">ě</span>tel a z<span class=\"car\">á</span>sluhou <span class=\"car\">š</span>iroké <span class=\"car\">š</span>k<span class=\"car\">á</span>ly kone<span class=\"car\">č</span>ných</p>\r\n<p>úprav se podtrhnou ur<span class=\"car\">č</span>ité architektonické tendence. To ale nen<span class=\"car\">í</span> v<span class=\"car\">š</span>echno. Technologie dvojitých skel zachov<span class=\"car\">á</span>v<span class=\"car\">á</span> diskrétnost a umo<span class=\"car\">ž</span><span class=\"car\">ň</span>uje pouze sv<span class=\"car\">ě</span>tlu proniknout do interiéru.</p>\r\n</div>\r\n</div>\r\n<br />\r\n<div style=\"z-index: 972;\" class=\"singola_lista_prodotto quinta\">\r\n<div style=\"z-index: 971;\" class=\"cont_lista sx\">\r\n<h2>Sylent System - osvobozuje ticho</h2>\r\n<p>Dve<span class=\"car\">ř</span>e FerreroLegno um<span class=\"car\">ě</span>j<span class=\"car\">í</span> být tiché. Jejich p<span class=\"car\">ř</span><span class=\"car\">í</span>tomnost je n<span class=\"car\">á</span>padn<span class=\"car\">á</span> a m<span class=\"car\">á</span> velkou expres<span class=\"car\">í</span>vn<span class=\"car\">í</span> schopnost, ale ve spr<span class=\"car\">á</span>vné chv<span class=\"car\">í</span>li dok<span class=\"car\">á</span><span class=\"car\">ž</span><span class=\"car\">í</span> ztichnout. Inova<span class=\"car\">č</span>n<span class=\"car\">í</span> skryté t<span class=\"car\">ě</span>sn<span class=\"car\">ě</span>n<span class=\"car\">í</span></p>\r\n<p>silent system nedovoluje dve<span class=\"car\">ř</span>n<span class=\"car\">í</span>mu k<span class=\"car\">ř</span><span class=\"car\">í</span>dlu p<span class=\"car\">ř</span>i p<span class=\"car\">ř</span>ir<span class=\"car\">á</span><span class=\"car\">ž</span>en<span class=\"car\">í</span> k z<span class=\"car\">á</span>rubni d<span class=\"car\">ě</span>lat hluk: jsou to detaily, na které my ov<span class=\"car\">š</span>em klademe velkou pozornost. V<span class=\"car\">š</span>e ostatn<span class=\"car\">í</span> je u<span class=\"car\">ž</span> dokonalé.</p>\r\n</div>\r\n</div>\r\n<br />\r\n<div style=\"z-index: 970;\" class=\"singola_lista_prodotto sesta\">\r\n<div style=\"z-index: 969;\" class=\"cont_lista dx\">\r\n<h2>Kompletn<span class=\"car\">í</span> or<span class=\"car\">á</span>mov<span class=\"car\">á</span>n<span class=\"car\">í</span> systém 4 - osvobozuje <span class=\"car\">č</span>as</h2>\r\n<p>Chr<span class=\"car\">á</span>n<span class=\"car\">í</span>me k<span class=\"car\">ř</span><span class=\"car\">í</span>dlo, je<span class=\"car\">ž</span> je centr<span class=\"car\">á</span>ln<span class=\"car\">í</span> <span class=\"car\">č</span><span class=\"car\">á</span>st<span class=\"car\">í</span> dve<span class=\"car\">ř</span><span class=\"car\">í</span>, dbaj<span class=\"car\">í</span>ce p<span class=\"car\">ř</span>edev<span class=\"car\">š</span><span class=\"car\">í</span>m na bo<span class=\"car\">č</span>n<span class=\"car\">í</span> a horn<span class=\"car\">í</span> li<span class=\"car\">š</span>ty, je<span class=\"car\">ž</span> je zpev<span class=\"car\">ň</span>uj<span class=\"car\">í</span>. Pokro<span class=\"car\">č</span>il<span class=\"car\">á</span> technologie FerreroLegno, pomoc<span class=\"car\">í</span> speci<span class=\"car\">á</span>ln<span class=\"car\">í</span>ho systému</p>\r\n<p>Bordatura totale system 4, potahuje li<span class=\"car\">š</span>ty stejným d<span class=\"car\">ř</span>ev<span class=\"car\">ě</span>ným materi<span class=\"car\">á</span>lem, jen<span class=\"car\">ž</span> tvo<span class=\"car\">ř</span><span class=\"car\">í</span> panel, <span class=\"car\">č</span><span class=\"car\">í</span>m<span class=\"car\">ž</span> se vytv<span class=\"car\">á</span><span class=\"car\">ř</span><span class=\"car\">í</span> l<span class=\"car\">í</span>bivý estetický efekt. P<span class=\"car\">á</span>sek ABS, který potahuje spodn<span class=\"car\">í</span> hranu k<span class=\"car\">ř</span><span class=\"car\">í</span>dla,</p>\r\n<p>je nepostradatelným  spojencem proti mechanickému po<span class=\"car\">š</span>kozen<span class=\"car\">í</span>, p<span class=\"car\">ř</span><span class=\"car\">í</span>padnému nas<span class=\"car\">á</span>knut<span class=\"car\">í</span> vlhkosti z podlahy a proti opot<span class=\"car\">ř</span>ebov<span class=\"car\">á</span>n<span class=\"car\">í</span>.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<p>&#160;</p>',NULL,'',''),
