(274,7,'DVOUKŘÍDLÉ','','<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;<img height=\"67\" width=\"373\" src=\"/images/ESTENSIONE.gif\" alt=\"\" /></p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;<img alt=\"\" src=\"file:///C:/Users/JANSOM~1/AppData/Local/Temp/moz-screenshot-3.png\" /><img alt=\"\" src=\"file:///C:/Users/JANSOM~1/AppData/Local/Temp/moz-screenshot-4.png\" /><img alt=\"\" src=\"file:///C:/Users/JANSOM~1/AppData/Local/Temp/moz-screenshot-5.png\" /></p>\r\n<p>&#160;</p>\r\n<p><a href=\"/file/SDK%20dvouk%C5%99%C3%ADdl%C3%A9.pdf\">TECHNICKÉ PARAMETRY STANDARDNÍCH POUZDER</a></p>\r\n<p><a href=\"/file/SDK%20dvoukridle%20atyp.pdf\">TECHNICKÉ PARAMETRY ATYPICKÝCH POUZDER</a></p>\r\n<p><a href=\"/file/Cen%C3%ADk%20ECLISSE%20standard%2001-2011%20-%20komplet-1.pdf\">KOMPLETNÍ CENÍK POUZDER ECLISSE</a></p>\r\n<p><strong>Stavební pouzdro pro dvoukřídlé dveře</strong></p>\r\n<p>&#160; Dvoukřídlé poudzro pro dvoje dveře proti sobě&#160;je</p>\r\n<p>&#160;&#160;vhodné&#160;zejména&#160;ke spojení a oddělení&#160;propojitelných</p>\r\n<p>&#160;&#160;místností.&#160;Tento model udělá z domu příjemný</p>\r\n<p>&#160;&#160;otevřený&#160;prostor,&#160;který usnadní váš každodenní</p>\r\n<p>&#160; život.</p>\r\n<p>&#160;&#160;Světlost průchodu až 3000mm do šířky&#160;a 2900mm do</p>\r\n<p>&#160;&#160;výšky (u SDK).</p>',NULL,'',''),
