(271,7,'Dveře','','ZK - dveře jsou vyrobeny ve tvaru klasických vnitřních dřevěných dveří. Konstrukci dveřního křídla tvoří dva ocelové korpusy vylisované ze žárově pozinkovaného ocelového plechu o síle 0,6 mm. Výplň dveřního křídla tvoří papírová voština. V místě závěsů a zámku jsou dřevěné výztuhy. Pozinkovaná vrstva vnějšího pláště ZK-protipožárních dveří zaručuje nejen vysokou antikorozní ochranu, ale umožňuje provedení téměř všech povrchových úprav.',NULL,'',''),
(272,7,'Standardní pouzdra do SDK','','',NULL,'',''),
(273,7,'JEDNOKŘÍDLÉ','','<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;<img height=\"67\" width=\"200\" alt=\"\" src=\"/images/UNICO_latosinistro.gif\" /></p>\r\n<p>&#160;</p>\r\n<p>Stavební pouzdro pro jednokřídlé dveře    Základním modelem řady Eclisse je pouzdro pro jednokřídlé    dveře. Tento typ je ideálním příkladem účelnosti a kvality    systémů Eclisse. Hodí se pro každé použití jak do    rekonstrukcí, tak i do novostaveb.    Světlost průchodu až 1500mm do šířky a 2900mm do    výšky (u SDK).</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p><a href=\"/file/02-ECLISSE%20-%20SDK%20J.pdf\">TECHNICKÉ PARAMETRY STANDARDNÍCH POUZDER</a></p>\r\n<p><a href=\"/file/SDK%20jednokridle%20atyp.pdf\">TECHNICKÉ PARAMETRY ATYPICKÝCH POUZDER</a></p>\r\n<p><a href=\"/file/Cen%C3%ADk%20ECLISSE%20standard%2001-2011%20-%20komplet-1.pdf\">KOMPLETNÍ CENÍK POUZDER ECLISSE</a></p>\r\n<p>&#160;</p>',NULL,'',''),
(103,3,'M&T handles and fittings','M&T handles and fittings','The first and the only Czech producer of door handles using modern technology and the demand for high quality surface finishes - matte nickel and titanium nitrite in several colours. <br />\r\nThe assortment of door and window hardware is characterised by exceptional Roman Ulich modern design, quality and long-time functions. Guarantee the functionality of 3 to 15 years depending on the type of surface treatments.','','',''),
(38,3,'Bedex security doors','Bedex - security doors','The aim of Bedex sortiment is to offer to every customer perfect product and service, according to demands of security, comfort and appropriate price. The philosophy of Bedex label is best captured by its slogan: \"Security is not a luxury!\".<br />\r\n<br />\r\nThe security doors Bedex are produced on first-classed engineering machines Trumpf and are constructed from high quality materials delivered from individual producers. Construction of doors consists of built in properly certificated components and materials to succeed demanding tests of resistance against housebreaking or fire.<br />\r\n<br />\r\nThe main advantage of Bedex doors is the area of locker. Bedex doors use exclusively original wheel base locker from renowned producers. Types and differences between individual lockers of Bedex doors and lockers used by other producers of security doors will be explained more by our specialists.<br />\r\n<br />\r\nThe production of doors itself is very fast. The term of product delivery is up to 14 days from signing the contract, more difficult atypical goods max. 4 weeks. Company Bedex is successfully certificated by the company ITC Zlín with a ČSN EN ISO 9001:2001.<br />\r\n<br />\r\nCompany Bedex is long-time Czech producer of security and fire protective doors fulfilling maximum security standards tested and certificated by testers TREZOR-TEST Prague and PAvUS Veseli nad Luznici.\r\n<br />\r\n<br />\r\n<a href=\"/File/CENIK_ BEDEX02-2008.xls\">Bedex price list to download</a>','','',''),
