(106,3,'Holar handles and fittings','Holar handles and fittings','Handle as a jewel.\r\nForging, which meets the requirements of housing and civil buildings. Is a sleek, modern and durable quality, made of precious materials. Pleasant to the touch, graceful to view and tastefully completed harmony utility. These are the products with absolute surface resistance against wear and tear, a permanent shape, coloured in the mass and sanitised.\r\nThe production is certified according to CSN EN ISO 9001: 2000.\r\n\r\n<br />\r\n<br />\r\n\r\n<a href=\"/File/Cenik-Holar_cerven07.xls\">price list to download </a>','','',''),
(107,3,'Cobra fittings and handles','Cobra fittings and handles','As a supplier of hardware on the Czech market has been established in 1991.\r\nIt offers the widest assortment of construction and furniture fittings, consisting of several dozens of models of hardware and other types of hundreds of implementation, in various designs, many finishes and a wide selection of supplements.','','',''),
(108,3,'Martinelli handles and fittings','Martinelli handles and fittings','FMN Martinelli S.p.A is one of the largest producers brass fittings in Italy. The company FMN Martinelli was founded in 1968 in Valle Sabia, in northern Italy, where the tradition of passion and expertise for the treatment of brass. The range consists of handles, balls, handles, locks, knockers, hangers, door accessories, window fittings, holders rails, door stops, rosettes.','','',''),
