(254,7,'Zakázkový nábytek','Zakázkový nábytek','Výrobce Lualdi dodává kompletní vybavení prodejen, kanceláří na míru. Povrchová úprava může být stejná s dveřmi a tak lze sladit dokonale interiér. Design je řešen s lehkostí, je vždy vysoce estetický, prostory se stanou velice reprezentativními.',NULL,'',''),
