(213,7,'ECLISSE - POUZDRA','posuvné dveře - pouzdro Eclisse','Stavební pouzdra pro zasouvací dveře do zdi jsou velmi elegantním a chytrým řešením do všech typů interiérů - bytů i kanceláří, skladů, hotelových pokojů, nemocničních i sociální zařízení. Pouzdra pro posuvné dveře umožní efektivní využívání těchto prostorů. K praktickým přednostem tohoto systému patří oproti klasickým otáčivým dveřím v první řadě úspora místa vzniklá díky tomu, že se dveře zasunou přímo do stěny. Otevírání klasických otáčivých dveří zabírá prostor, který často není k dispozici, nebo by mohl být využitý k jiným účelům. Zásuvné dveře fungují efektivně a neomezují.<br />\r\n  <br />\r\nJako první představila na trhu stavební pouzdra pro posuvné dveře roku 1989 italská společnost ECLISSE s.r.l., která díky mnohaletým zkušenostem a neustálému vývoji výrobní technologie nabízí výrobky z kvalitních materiálů. Stále více projektantů, architektů a zákazníků volí přednosti posuvných dveří a stále více z nich upřednostňuje kvalitu pouzder ECLISSE.<br />\r\n<br />\r\nV zahraničí jsou zásuvné dveře již běžným prvkem v mnoha domácnostech. Systém posuvu dveří do zdi využívají i v restauracích a dalších veřejných zařízeních. V České republice teprve popularita šoupaček začíná narůstat. Vzhledem k výši cen bytů, které na našem trhu stále rostou, jsou kapsy pro zasouvací dveře zajímavým a důmyslným řešením. Systém ECLISSE Vám dá prostor, který standardně zabírají klasické dveře.<br />\r\n<br />\r\nDo široké nabídky standardních modelů patří jednokřídlá pouzdra, dvoukřídlá pouzdra pro zasunovací dveře proti sobě, teleskop pro paralelně posuvné dveře, stavební pouzdro zákryt, které schová dvoje dveře do jedné kapsy uprostřed nebo cirkulár pro kruhové a půlkruhové dveře. Všechny nabízené modely se připravují v provedení do zděné nebo sádrokartonové příčky. Společnost ECLISSE vychází zákazníkovi vstříc i výrobou pouzder atypických rozměrů do výšky 260cm u řešení do zdiva a do výšky 290cm u modelů do sádrokartonové příčky. Pouzdra je možno osadit do příček již od 10cm (dokončená síla stěny).<br />\r\n<img width=\"520\" height=\"281\" src=\"/Image/planek.jpg\" alt=\"\" /><br />\r\nPouzdra ECLISSE se vyrábí z profilovaného pozinkovaného plechu. Veškeré spoje jsou bez svárů, které poškozuje zinkování. Výhodou je vysoká pevnost kapsy, kterou zajišťují vodorovné vyztužené profily a svislé profilované stojny. Šoupačky do zděné příčky jsou navíc vybaveny profilovaným plechem a jsou pokryty hustou omítkářskou sítí s přesahem okraje pouzdra, což zajišťuje pevné spojení pouzdra se zdivem a zamezuje praskání omítky.<br />\r\n<br />\r\nVýrobky ECLISSE jsou chráněny více jak dvaceti patenty. Jedním z nich je například odnímatelná horní pojezdová kolejnice, která umožňuje i po zabudování pouzdra nastavení koncového dorazu dveří, dodatečnou montáž synchronizace pro teleskop a pro dvoukřídlé dveře, instalaci protizávaží či elektrického pohonu. Snadný pohyb dveří zajišťují bezúdržbové nosné vozíčky s kuličkovými ložisky, které mají nosnost 80kg nebo 120kg.<br />\r\n<br />\r\nDalšími výhodami jsou například snadná montáž či skladnost při dopravě i na stavbě.<br />\r\nModerní systém zasouvání dveří do příčky Vám nabízí účelné i estetické řešení interiéru. Do tohoto systému lze osadit jakýkoli typ dveří od standardních, masivních až po celoskleněné. Pouzdra pro zasunovací dveře nabízí nový prostor ve vašem interiéru.<br />\r\n<br />\r\n<u><strong>Přednosti Eclisse - pouzdra do zdiva<br />\r\n</strong><br />\r\n<br />\r\n<em>odnímatelná horní pojezdová kolejnice</em><br />\r\n-lze ji vyjmout i po zazdění pouzdra<br />\r\n-možnost nastavení zadního dorazu dveří<br />\r\n-dodatečná montáž synchronizace u dvoukřídlých dveří<br />\r\n-uzavírání dveří pomocí protizávaží<br />\r\n-dodatečná montáž synchronizace pro teleskop<br />\r\n<strong>-možnost osadit pouzdra do příček od tl. 100 mm</strong><br />\r\n(zdivo 108, 125, 150 mm a SDK 100, 125 mm) <br />\r\n<br />\r\n-veškeré spoje jsou bez svárů, které poškozují zinkování plechu<br />\r\n-celé pouzdro je z kvalitního pozinkovaného plechu<br />\r\n-vodící trn s přesným vymezením na střed pouzdra<br />\r\n-pouzdro do SDK v balení 220x15x15 cm (odveze se i v osobním autě) a v balení jsou k dispozici obě tloušťky SDK příček (100 i 125 mm)<br />\r\n<br />\r\n-standardní rozměry skladem<br />\r\n-atypické rozměry do dvou dnů<br />\r\n-možnost výroby atyp. rozměrů do výšky 290 cm a šířky jednokř. průchodu 180 cm<br />\r\n-možnost exkluzivního řešení motorizace - elektrický pohon příprava na kabelové vedení<br />','','',''),
