(225,7,'DRIVE, posuvné dveře bez zárubně','Dveře posuvné Drive','NOVINKA ! \r\n<br />\r\nPosuvné dveře Drive mají jedinečné řešení způsobu posouvání dveří, které nevyžaduje montáž obložkové zárubně ani pouzdra pro posuvné dveře, posuvný mechanismus je skrytý a objeví se jen při otevření dveří. Dveře lze úspěšně kombinovat s otočnými dveřmi řady Outline, které při zavřeném stavu mají totožný vzhled jako posuvné dveře Drive: vtip je v tom, že dveře vypadají stejně, ale některé se posouvají, jiné otevírají jako běžné, otočné dveře.','','',''),
