(314,7,'Na našem webu naleznete','','<h3><a href=\"http://www.dvere.com/dvere-vnitrni-dvere-sapeli-c-243_32.html\">Dveře Sapeli</a></h3>\r\n<h3><span style=\"font-size: 12pt; font-family: &quot;Times New Roman&quot;,&quot;serif&quot;;\"><img width=\"120\" height=\"64\" alt=\"\" title=\"Logo Sapeli\" src=\"/images/Sapelilogo.gif\" /></span></h3>\r\n<p>V současnosti je SAPELI ryze českou firmou,  která Vám kromě tradice  nabízí i bezkonkurenční šíři sortimentu dýhovaných dveří. Tato nabídka,  která je doplněna i o sortiment dveří foliovaných a profilovaných, zcela  jistě uspokojí každého zákazníka. Vybírat můžete dveře a zárubně všech  druhů otevírání - otočné, kyvné, posuvné, lamelové, maximálního  provedení dřevin, barev a funkčnosti - plné, prosklené, <a href=\"http://www.dvere.com/dvere-sapeli-sapeli-protipozarni-dvere-c-243_32_44.html\">protipožární</a>, <a href=\"http://www.dvere.com/dvere-sapeli-sapeli-zvukove-izolacni-c-243_32_50.html\">protihlukové</a>, <a href=\"http://www.dvere.com/dvere-sapeli-sapeli-bezpecnostni-c-243_32_45.html\">bezpečnostní</a>, dveře do různých <a href=\"http://www.dvere.com/dvere-sapeli-sapeli-klima-dvere-c-243_32_48.html\">klima</a>tických  podmínek a další speciální dveře a zárubně včetně prosklených stěn.  Dveře SAPELI naleznete v interiérech od běžných bytových prostor, přes  hotelové, školní nebo administrativní prostory až po budovu Parlamentu  České republiky. Výrobky firmy SAPELI jsou vyráběny v různých evropských  normách a mají své pevné místo na trzích Čech a Moravy, Slovenska,  Polska, Maďarska a dalších okolních států v rámci Evropské unie.</p>\r\n<p>Sapeli předkládá opravdu bohatou nabídku modelů dveří, jejich  povrchových úprav, technických řešení, dveří pro speciální použití s  různými speciálními úpravami (v tom se Sapeli nevyrovná dnes již ani  žádný zahraniční výrobce). Kvalita a kontrola kvality dveří je špičková.</p>\r\n<h3><a href=\"http://www.dvere.com/loprais-dvere-z-masivu-c-241.html\">Dveře Loprais</a></h3>\r\n<p><br />\r\nDveře firmy LOPRAIS prochází ve výrobě mnoha fázemi, obrábění masivního  dřeva při použití nejmodernějších strojů, včetně CNC. Důležitou fází  výroby, na niž je kladen velký důraz, je povrchová úprava.<br />\r\nVchodové dveře jsou vyráběny z masivního dřeva smrk, dub, meranti,  lepeného do třívrstvých lamel. Standardní dveře jsou z lamel 52 mm,  dveře Luxus jsou vyrobeny z profilu 68 mm.<br />\r\nDveře jsou standardně vybaveny izolačními dvojskly, povrchovou úpravou  vodou ředitelnými barvami v široké škále odstínů lazurovaných barev nebo  dle RAL.<br />\r\nStrojní vybavení firmy moderními stroji jak číslicově řízené tak  počítačem řízené CNC obráběcí centrum, které je schopno vyrobit vše, co  dokážeme naprogramovat, od všech druhů dveří, oken rovných tak tvarových  nebo kruhových. <br />\r\nVšechny výrobky jsou projektovány v AUTOCADu a přeneseny do CNC. <br />\r\nDnes má firma 25 zaměstnanců. <br />\r\nZ důvodů kvality si veškeré dřevěné polotovary vyrábí firma sama.</p>\r\n<h3><a href=\"http://www.dvere.com/bezpecnostni-dvere-bedex-c-38.html\">Bezpečnostní dveře Bedex</a></h3>\r\n<p><br />\r\nCílem výrobků BEDEX je nabídnout každému zákazníkovi perfektní výrobek a  servis, odpovídající nárokům na bezpečí, komfort a tomu odpovídající  cenu. Filozofii značky BEDEX nejlépe vystihuje její slogan: „Bezpečí  není luxus !“ 	<br />\r\nBezpečnostní dveře BEDEX&#160; jsou vyráběny na prvotřídních strojírenských  zařízeních Trumpf a jsou zkonstruovány z materiálů, které zaručují  vysokou kvalitu již od samotných výrobců. Do konstrukce jsou  zabudovávány pouze řádně certifikované komponenty a materiály, aby  celkový výrobek uspěl v náročných zkouškách odolnosti proti vloupání,  resp. protipožárních. <br />\r\n<br />\r\nJednou z hlavních předností dveří BEDEX je oblast zámku. Jsou zde  využívány výhradně originální rozvorové zámky renomovaných výrobců. Tyto  jsou vyráběny a homologovány k tomu, že spolehlivě ovládají rozvorový  systém. Typy a rozdíly mezi jednotlivými zámky ve dveřích BEDEX a zámky  používanými jinými výrobci bezpečnostních dveří, objasní odborníci přímo  ve výrobě, případně u prodejce. <br />\r\n<br />\r\nVlastní výroba dveří je rychlá. Od podpisu kontraktu jsou standardní  výrobky dodávány do 14 dnů,  složitější atypické výrobky maximálně do 4  týdnů. <br />\r\nV červnu roku 2004 byla společnost MRB (výrobce značky Bedex) úspěšně  certifikována firmou ITC Zlín, a.s.  dle ČSN EN ISO 9001:2001.</p>\r\n<h3><a href=\"http://www.dvere.com/dvere-designove-dvere-lualdi-c-244_112.html\">Dveře Lualdi</a></h3>\r\n<p>Unikátní, originální a vysoce moderní dveře Lualdi od italského výrobce jsou navrhovány předními italskými návrháři.<br />\r\n<br />\r\nJednotlivé modelové řady mají originální tvary a umožňují výběr z  několika odstínů barev, dýh, skel. Unikátní a špičkově moderní modely  dveří Lualdi jsou vhodné do bytů i kanceláří, nekomformní řešení  otevírání dveří otevírají nové dimenze pojetí dveří v prostoru jako  takových. Každá řada dveří má svou specialitu a je zcela originální, s  každou řadou jde výrobce vždy o krok vpřed před konkurenci, dá se říci,  že je nyní o několik kroků vpřed před většinou výrobců po designové  stránce,&#160; přes nápaditost řešení způsobu otevírání dveří či provedení  zárubní po kvalitu dveří.</p>\r\n<p>&#160;</p>\r\n<p>V posledních letech je firma Lualdi velice úspěšná v prodeji dveří na   Miami. V Americe mají lidé trochu odlišný vkus a používají se různá   alternativní řešení interiérů. Firma Lualdi pojímá řešení interiérů   opravdu osobitým způsobem a ve spojení s požadavky náročných klientů   přichází na nevídané designy a technická řešení.</p>\r\n<p>Můžete se sami přesvědšit prohlídkou&#160; <a href=\"/file/Lualdi_news-June_2011.pdf\">katalogu novinek</a> a katalogu <a href=\"/file/American_Collection.pdf\">Americká kolekce</a></p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<h3><a href=\"http://www.dvere.com/bezpecnostni-dvere-bezpecnostni-dvere-ferwall-c-257_258.html\">Bezpečnostní dveře Ferwall</a></h3>\r\n<p>Dovážíme, prodáváme a montujeme bezpečnostní dveře Ferwall. . Nabízí  se výběr z nezpočetného množství plášťů dveří i variant technických -  zateplené dveře, protipožární, vnitřní, vnější, protihlukové. Montáž je  snadná, i když vyžaduje zednickou úpravu - dveře mají vždy svou vlastní  ocelovou dvoudínou zárubeň.</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<h3><a href=\"http://www.dvere.com/dvere-vnitrni-dvere-ferrerolegno-c-243_268.html\">Vnitřní dveře Ferrero Legno</a></h3>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>Jedná se o předního italského výrobce dveří, který se soustřeďuje jak  na kvalitu dveří, tak na jejich cenu. Nabízí širokou škálu povrchových  úprav dveří, laminátové povrchy, dýhované, lakované a dýhované i  lakované s vysokým leskem. Nabízí několik modelů zárubní. Společnost  FerreroLegno vyrábí kvalitní designové interiérové dveře, k  jejich  výrobě používá nejmodernější technologie. Vybrané materiály  jsou mezi  sebou různě kombinovány lidmi, kteří po desetiletí s nadšením  vyrábí  ideální bytové doplňky pro Váš domov.</p>\r\n<p>&#160;</p>\r\n<h3><a href=\"http://www.dvere.com/pouzdra-pro-posuvne-dvere-eclisse-pouzdra-c-242_213.html\">Pouzdra pro posuvné dveře Eclisse</a></h3>\r\n<p>Jako první představila na trhu stavební pouzdra pro posuvné dveře  roku  1989 italská společnost ECLISSE s.r.l., která díky mnohaletým   zkušenostem a neustálému vývoji výrobní technologie nabízí výrobky z   kvalitních materiálů. Stále více projektantů, architektů a zákazníků   volí přednosti posuvných dveří a stále více z nich upřednostňuje kvalitu   pouzder ECLISSE.</p>\r\n<p>&#160;</p>\r\n<h3><a href=\"http://www.dvere.com/pouzdra-pro-posuvne-dvere-jap-pouzdra-c-242_40.html\">Pouzdra pro posuvné dveře JAP</a></h3>\r\n<p>Společnost J.A.P. vznikla roku 1991 a sídlí v Přerově. Její filozofií  je  dodávat na trh stavební kovové prvky vysoké kvality s nápaditým   designem, za přijatelnou cenu.  Svým zákazníkům nabízí  stahovací  schodiště , interiérová a exteriérová točitá schodiště, interiérová   segmentová schodiště ,  stavební pouzdra JAP  pro zasouvací dveře,  požární a  zateplené uzávěry. Svoji obchodní politiku směřuje především  za hranice  České republiky, ale v posledních letech stále více  zakotvuje i na trhu  českém.</p>\r\n<p>&#160;</p>',NULL,'',''),
(235,7,'Celoskleněné','Celoskleněné dveře','Moderní design, kvalita a bezpečnost jsou charakteristické znaky celoskleněných dveří. Ve všech svých variantách se stávají působivým prvkem bytových interiérů, kanceláří, hotelů, prodejen a jiných objektů. Tvrzená skla mají vysokou odolnost vůči nárazům a zcela vylučují možnost zranění ostrými střepy, pokud by k rozbití skla vůbec došlo. Dveře lze osadit do obložkové zárubně i do zárubně OKZ v jednokřídlém i dvoukřídlém provedení. Ornamentní skla a pískované motivy lze vybírat dle katalogu skel.','','',''),
