(249,7,'OUTLINE, objekt v prostoru','Dveře Outline','NOVINKA! \r\n<br />\r\nDveře Outline jsou dveře vystupující ze stěny, vzdalují se tradičním vzorům, inovativním designem poskytují nový estetický dojem a jednodché technické provedení. Dveře Outline jsou jako panel, který viditelně i hmatatelně vstupuje do prostoru, jakoby oddělený od stěny, tvoříce tak dojem objektu v prostoru. Na rozdíl od obvyklých řešení dveří ,,srovnaných\" s povrchem stěny, dveře Outline stojí vně a tvoří tak výrazný dekoracivní prvek. Také montáž dveří Outline je jednoduchá, dveře se montují přímo na zeď, otvor se buď pouze začistí štukovou omítkou nebo sádrokartonem nebo lze obložit obložkovou zárubní, která je pak viditelná pouze z opačné strany.','designové dveře','designové dveře','dveře \\lualdi, designové dveře, dveře Outline'),
(249,3,'Outline Doors','Outline Doors','A door that emerges from the wall, taking its distance from traditional schemes to offer, in an innovative design, new aesthetic emotions and simplified technical performance. The Outline door is a panel of great visual and tactile impact, detached from the wall for the same effect created by a volume in a space. Unlike the usual solutions of doors &#8220;aligned&#8221; with the wall surface, Outline stands out to make a strong decor contribution. Assembly of Outline is also easy; the door is directly installed on the wall.','','',''),
(257,7,'Bezpečnostní dveře','bezpečnostní dveře','',NULL,'',''),
(278,7,'Pouzdro Standard jednokřídlé','Pouzdro JaP Standard','<p>Pouzdro pro posuvné dveře je možné dodat ve variantě pro sádrokartonovou nebo pro zděnou příčku.</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>',NULL,'',''),
(279,7,'Hotel Atrium Otrokovice','Hotel Atrium Otrokovice','<p>Dodávka a montáž dveří do 4* hotelu Atrium v Otrokovicích</p>\r\n<p>Investor: soukromý investor</p>\r\n<p>Generální dodavatel: Metrostav a.s.</p>\r\n<p>Objedm dodávky : 2,8 mil.</p>\r\n<p>Typy dodávaných dveří: standardem byly dveře Sapeli Elegant 10, plné hladké dýhované dveře s dýhou javor. JAko vstupní dveře so pokojů byly dodány dveře kouřotěsné, protipožární, protihlukové se vstupním hotelovým systémem EVVA včetně ocelových zárubní HSE. Do hotelových pokojů byly dodány plné hladké dveře s dýhou javor včetně obložkových zárubní. Na chodbách a společných prostorách opět dveře Elegant s požární odolností, v zázemí kuchyně&#160; a do bytů v horních patrech bílé hladké lakované dveře, do bytů v horních patrech dále vstupní bezpečnostní dveře Sapeli s bezp. třídou 3. Do pobočky České spořitelny a prostoru bankomatu pak bezpečnostní dveře Bedex. Jako běžné vnitřní kování jsme zvolili kování nerez rozetové značky Tupai, model Favorit. Samozavírače byly použity GEZE 3000 s lištou. Jako speciální protipožární dveře atypických rozměrů byly použity dveře Topdoors, opět dýhované hladké dýhou javor.</p>\r\n<p><a href=\"http://www.atriumotrokovice.cz/uvod.do\">&#160;Další informace o projektu Hotel Atrium</a></p>',NULL,'',''),
(281,7,'Články, informace','','Tuto kategorii jsme vytvořili nově jako průvodce světem dveří, naleznete zde články o dveřích, zrubních  a kování.',NULL,'',''),
