(283,7,'Interiérové dveře','','',NULL,'',''),
(284,7,'Celoskleněné dveře','','<h2>Fenomén celoskleněné dveře</h2>\r\n<p>Poslední dobou stále narůstá zájem o celoskleněné dveře. Hlavními  důvody volby celoskleněných dveří je samozřejmě velký prostup světla,  který zajišťuje prosvětlenost prostor a&#160; estetický přínos: celoskleněné  dveře velice odlehčují&#160; interiér, nechávají proudit světlo i energii  celým obývaným prostorem. Dalším velice důležitým faktorem je obrovská  variabilita použití skleněných prvků nejen z oblasti dveří a uzavření  rúzných stavebních otvorů, sko se používá pro stěny, dělící příčky v  koupelnách či chodbách, obývacích pokojích, dnes se již sklo používá  dokonce již na schodišťové stupně, zábradlí či výplně plotů, možnosti  využití jsou dnes opravdu široké.</p>\r\n<p>Pracovat se sklem v interiéru nám umožňuje moderní technologie, která  se rozvinula v oblasti vývoje různých typů skel a v&#160; možnostech jeho  zpracování na jedné straně, ve vývoji kování, které je potřebné pro  spojení, připevnění či jiné zprovoznění celoskleněného prvku na straně  druhé.</p>\r\n<p>&#160;</p>\r\n<p>V tomto článku se soustředím na celoskleněné dveře a s nimi spojené  prosklené stěny. Stejně jako u dveří z ostatních materiálů se dají  celoskleněné dveře rozdělit na několik základních typů dle funkce dveří a  způsobu otevírání.</p>\r\n<p>&#160;</p>\r\n<h3>Typy celoskleněných dveří</h3>\r\n<p><b>otočné dveře</b></p>\r\n<p><b>posuvné dveře</b></p>\r\n<p>Oba typy dveří mohou být zakomponované v prosklené stěně</p>\r\n<p>&#160;</p>\r\n<h4>Otočné dveře</h4>\r\n<p>U všech typů dveří je třeba vždy vybírat typ skla, což je ta  estetická část výběru a typ kování, které má hlavní vliv na funkci  celku. Různé typy kování umožňuji dveře osadit buď do předem zabudované  zárubně, ta může být buď klasická ocelová, případně od některého  designově zdatnějšího výrobce takových zárubní jako je například <a href=\"http://www.dvere.com/zarubne-c-43.html\">HSE</a>,  hliníková, designově lepší nebo dřevěná obložková, z masivního dřeva  nebo z dřevotřísky, kterou výrobci opatřují rúznou povrchovou úpravou,  lakem, dýhou, laminátem či folií.</p>\r\n<p>Další variantou je osadit dveře pomocí kování přímo do zděného otvoru či otvoru v SDK, případně včetně pevného zasklení.</p>\r\n<p>Pro každý způsob se používá jiný typ kování. V případě osazení dveří  do zárubní je kování vždy tvořeno závěsy neboli panty a klikou se zámke,  který umožní uzavření dveří zapadnutím střelky zámku do protikusu na  zárubni. ávěsy s klikou a zámkem dodává několik výrobců, tvoří vždy  jeden set, který&#160; má jednotný styl: závěsy jsou v podobném tvaru a  designu jako zámek, tvar samotné kliky bývá většinou na výběr.</p>\r\n<p>Dveře, které jsou osazené bez zárubně, to znamená buď přímo do otvoru  nebo jako součást celoskleněné pevné stěny, se zpravidla osazují  podlahovým saozavíračem, který v podstatě nahrazuje zapadnutí střelky do  zámku u běžných dveří: drží dveřní křídlo aretované v zařžené poloze, v  případě otevření, které bývá možné na obě strany, je pak možné  zpravidla dveře také aretovat samozavíračem např. v poloze otevření na  90 či 110°. Na takové dveře se pak nepoužívají zámky s klikou (i když  uzamčení je také možné realizovat samostatným např. podlahovým zámkem),  ale madla, kterými lze dveře ovládat.</p>\r\n<p>&#160;</p>\r\n<h4>Posuvné dveře</h4>\r\n<p>I u posuvných dveří je hned několik variant, jak dveře uchytit.</p>\r\n<h5>Posuvné dveře do stěny</h5>\r\n<p>To je ideální varianta, dveře nijak nepřekáží v prostoru, v momentě  otevření jsou ukryté v pouzdru ve stěně. V případě, že jsou dveře tak  velké, že se ještě vejdou do standardně vyráběných stavebních pouzder  pro posuvné dveře, jejichž velikost je omezena výškou 270cm a šířkou  výsledného průchodu 245cm (to už musí být ale dvoukřídlé dveře), je  optimální použít standardní <a href=\"http://www.dvere.com/pouzdra-pro-posuvne-dvere-c-242.html\">pouzdra pro posuvné dveře</a>.</p>\r\n<p>Pokud rozměr dveří standardní rozměry přesahuje, je třeba ve zdi  vytvořit kapsu tradičním způsobem, to znamená v podstatě postavit dvě  příčky (ať už zděné nebo sádrokartonové) vedle sebe, pojezdová kolejnice  se předem připevní na spodní strany překladu, který může být dřevěný,  ocelový nebo keramický.</p>\r\n<h5>Posuvné dveře na stěnu</h5>\r\n<p>To je designově lákavější varianta, sklo je vidět a působí jako  samostatný ozdobný prvek prostoru. I kování se používá pohledově  vzhledné. Buď se používají různé lišty, většinou z hliníku či nerezové  oceli nebo zcela přiznané posuvné kování, které nic neskrývá a vyloženě  se vyžívá v robustním technickém vzhledu.</p>',NULL,'',''),
