(319,7,'Kolekce','','<p>&#160;</p>\r\n<div class=\"wr wrap_collezione_fl intro_collezioni\" style=\"z-index: 984;\">\r\n<table cellspacing=\"0\" cellpadding=\"0\" border=\"0\">\r\n    <tbody>\r\n        <tr>\r\n            <td>\r\n            <div class=\"collezione_fl sfondo_top\" style=\"z-index: 983;\">\r\n            <div class=\"visual\" style=\"z-index: 982;\"><a href=\"http://www.dvere.com/kolekce-kolekce-fl-c-243_268_319_317.html\"><img width=\"773\" height=\"208\" alt=\"Ferrero Legno Collections\" src=\"http://www.ferrerolegnoporte.it/img_sito/collezioni/intro_collezioni/collezione_FL.jpg\" /></a></div>\r\n            <div class=\"wrap_testo\" style=\"z-index: 981;\">\r\n            <h2><a href=\"http://www.dvere.com/kolekce-kolekce-fl-c-243_268_319_317.html\">Od Suite po Equa, od Kévia po Intaglio.</a></h2>\r\n            <h3><a href=\"http://www.ferrerolegnoporte.it/cze/collections/equa\">Dokonalá rovnováha mezi funk<span class=\"car\">č</span>ností a estetikou</a></h3>\r\n            <div class=\"wrap_colonne testo\" style=\"z-index: 980;\">\r\n            <div class=\"colonna prima\" style=\"z-index: 979;\">\r\n            <p>Za kolekcemi FerreroLegno se ukrývá celý sv<span class=\"car\">ě</span>t vytvo<span class=\"car\">ř</span>ený z&#160;vá<span class=\"car\">š</span>n<span class=\"car\">ě</span> pro vlastní práci: pe<span class=\"car\">č</span>livý výb<span class=\"car\">ě</span>r surovin a hledání inovativních <span class=\"car\">ř</span>e<span class=\"car\">š</span>ení jsou zárukou</p>\r\n            <p><span class=\"car\">š</span>iroké <span class=\"car\">š</span>kály <span class=\"car\">ř</span>e<span class=\"car\">š</span>ení, jejich<span class=\"car\">ž</span> konstantou je rovnováha mezi estetikou a technologií.</p>\r\n            </div>\r\n            <div class=\"colonna seconda\" style=\"z-index: 978;\">\r\n            <p>Hlavním cílem firmy je vyhov<span class=\"car\">ě</span>t Va<span class=\"car\">š</span>emu osobnímu stylu, p<span class=\"car\">ř</span>edcházet Va<span class=\"car\">š</span>im po<span class=\"car\">ž</span>adavk<span class=\"car\">ů</span>m a p<span class=\"car\">ř</span>ekvapit Vás detaily, v&#160;nich<span class=\"car\">ž</span> spo<span class=\"car\">č</span>ívá rozdíl.</p>\r\n            <p>Vyberte si z&#160;na<span class=\"car\">š</span>ich kolekcí model, který nejvíce odpovídá Va<span class=\"car\">š</span>emu stylu: to budou dokonalé dve<span class=\"car\">ř</span>e pro Vá<span class=\"car\">š</span> byt, „Va<span class=\"car\">š</span>e FerreroLegno“.</p>\r\n            </div>\r\n            </div>\r\n            </div>\r\n            </div>\r\n            </td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n</div>\r\n<div class=\"wr wrap_exit intro_collezioni\" style=\"z-index: 977;\">\r\n<table cellspacing=\"0\" cellpadding=\"0\" border=\"0\">\r\n    <tbody>\r\n        <tr>\r\n            <td>\r\n            <div class=\"exit sfondo_top\" style=\"z-index: 976;\"><br />\r\n            <div class=\"visual\" style=\"z-index: 975;\"><a href=\"http://www.ferrerolegnoporte.it/cze/collections/exit\"><img width=\"778\" height=\"209\" alt=\"Exit Collections\" src=\"http://www.ferrerolegnoporte.it/img_sito/collezioni/intro_collezioni/exit.jpg\" /></a></div>\r\n            <div class=\"wrap_testo\" style=\"z-index: 974;\">\r\n            <h2><a href=\"http://www.ferrerolegnoporte.it/cze/collections/exit\">Pé<span class=\"car\">č</span>e o detail pro moderní eleganci.</a></h2>\r\n            <h3><a href=\"http://www.ferrerolegnoporte.it/cze/collections/exit\">Objevte r<span class=\"car\">ů</span>znorodé tvary krásy</a></h3>\r\n            <div class=\"wrap_colonne testo exit\" style=\"z-index: 973;\">\r\n            <div class=\"colonna prima\" style=\"z-index: 972;\">\r\n            <p>Dokonalost je nápadem, který se konkretizuje, je to maximální rovnováha mezi tvarem, podstatou a funk<span class=\"car\">č</span>ností. Dokonalost kolekce Exit FerreroLegno</p>\r\n            <p>spo<span class=\"car\">č</span>ívá ve vyt<span class=\"car\">ř</span>íbenosti zárubn<span class=\"car\">ě</span> InQuadro,je<span class=\"car\">ž</span> povzná<span class=\"car\">š</span>í tradi<span class=\"car\">č</span>ní zárube<span class=\"car\">ň</span> na úrove<span class=\"car\">ň</span> rámu, a v&#160;mnoha dal<span class=\"car\">š</span>ích detailech.  Lesklé polyesterové lakování</p>\r\n            <p>je zárukou trvalé krásy: nekompromisní kvalita a lesklost vydr<span class=\"car\">ž</span>í nav<span class=\"car\">ž</span>dy.</p>\r\n            </div>\r\n            <div class=\"colonna seconda\" style=\"z-index: 954;\">\r\n            <p>Nová materiálnost odli<span class=\"car\">š</span>uje vyhledávanou povrchovou úpravu Trame: textura, náro<span class=\"car\">č</span>ná a jemná, zvýraz<span class=\"car\">ň</span>uje p<span class=\"car\">ř</span>irozenou kresbu d<span class=\"car\">ř</span>eva.</p>\r\n            <p>Soulad dosa<span class=\"car\">ž</span>ený mezi estetikou a prakti<span class=\"car\">č</span>ností je odm<span class=\"car\">ě</span>nou za odhodlání tomu, kdo nep<span class=\"car\">ř</span>estává oce<span class=\"car\">ň</span>ovat p<span class=\"car\">ř</span>irozenost d<span class=\"car\">ř</span>eva a dívá se dál, v<span class=\"car\">ě</span>dom si toho,</p>\r\n            <p><span class=\"car\">ž</span>e neodmyslitelné detaily <span class=\"car\">č</span>iní z&#160;dve<span class=\"car\">ř</span>í sou<span class=\"car\">č</span>ást za<span class=\"car\">ř</span>ízení. Vstupte do sv<span class=\"car\">ě</span>ta Exit a objevte r<span class=\"car\">ů</span>znorodé tvary krásy.</p>\r\n            </div>\r\n            </div>\r\n            </div>\r\n            </div>\r\n            </td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n</div>\r\n<p><a href=\"http://www.ferrerolegnoporte.it/cze/collections/logica\"><img width=\"785\" height=\"274\" alt=\"Replica Collections\" src=\"http://www.ferrerolegnoporte.it/img_sito/collezioni/intro_collezioni/replica.jpg\" /></a></p>\r\n<h2><a href=\"http://www.ferrerolegnoporte.it/cze/collections/logica\">Kvalita dostává nové tvary.</a></h2>\r\n<h3><a href=\"http://www.ferrerolegnoporte.it/cze/collections/logica\">Vy<span class=\"car\">ř</span>e<span class=\"car\">ž</span>te si své sny a dejte tvar Va<span class=\"car\">š</span>emu domovu</a></h3>\r\n<div class=\"colonna prima\" style=\"z-index: 931;\">\r\n<p>FerreroLegno obrací svou pozornost k&#160;inovativním materiál<span class=\"car\">ů</span>m a roz<span class=\"car\">š</span>i<span class=\"car\">ř</span>uje estetickou a technologickou vyt<span class=\"car\">ř</span>íbenost, je<span class=\"car\">ž</span> charakterizuje výrobky ze d<span class=\"car\">ř</span>eva,</p>\r\n<p>na syntetickou  povrchovou úpravu. Replica je kolekce dve<span class=\"car\">ř</span>í se syntetickou povrchovou úpravou, vytvo<span class=\"car\">ř</span>ená proto, aby dala volnost Va<span class=\"car\">š</span>í tvo<span class=\"car\">ř</span>ivosti a obklopila</p>\r\n<p>Vás krásou; je to série návrh<span class=\"car\">ů</span> vyvá<span class=\"car\">ž</span>ených tak, aby Vám nabídla kvalitu, je<span class=\"car\">ž</span> je zárukou zna<span class=\"car\">č</span>ky FerreroLegno, za výhodnou cenu.</p>\r\n</div>\r\n<p>Replica Vám umo<span class=\"car\">ž</span><span class=\"car\">ň</span>uje <span class=\"car\">č</span>asovat sloveso „vybrat si“ v&#160;<span class=\"car\">š</span>iroké <span class=\"car\">š</span>kále model<span class=\"car\">ů</span> a dekorací vysoké kvality. Logica, Liss, Forma a Sintesi jsou prostorem,</p>\r\n<p>v&#160;n<span class=\"car\">ě</span>m<span class=\"car\">ž</span> se <span class=\"car\">ř</span>ady vyvíjejí, detaily se zdokonalují,kvalita získává nové tvary. Novinkou kolekce Replica je zárube<span class=\"car\">ň</span> Genius, vytvo<span class=\"car\">ř</span>ená tak, aby byla zárukou</p>\r\n<p>dokonalé komplanarity k<span class=\"car\">ř</span>ídla se zárubní a zárove<span class=\"car\">ň</span> nabídla snadno montovatelný výrobek.</p>',NULL,'',''),
