(330,7,'Vnitřní dveře','','Interiérové dveře jsou jednou z nejvýraznějších ozdob domu, podtrhnou například nově položenou podlahu i celkově zařízený interiér domu. Naše interiérové dveře jsou především adresovany zákazníkům, pro které jsou dveře, kromě jim dané funkce velmi důležitým dekorativním prvkem. Každé interiérové dveře mají svůj osobitý charakter, který si najde místo v daném interiéru. Jejich výroba není sériová, zákazníkovi tedy nabízíme možnost vymýšlet si nadstandartní modely a ladit každý detail dle své chuti.\r\nstyly - interiérové dveře\r\nmoderní dveřetrendové bydlení\r\nmoderní dveře\r\ndesignové dveředominanty interiéru\r\ndesignové dveře\r\nhistorické dveřekouzlo let minulých\r\nhistorické dveře\r\n \r\nvarianty provedení - interiérové dveře\r\nposuvné dveřehezký prvek s úsporou místa\r\nposuvné dveře\r\nprotipožární dveřebuďte v bezpečí\r\nprotipožární dveře\r\n \r\ntechnická knihovna - interiérové dveře\r\nmateriálydřeviny, dýhy\r\nmateriály\r\nvarianty otevíráníotočné, posuvné...\r\nvarianty otevírání\r\npovrchová úpravatransparent, color...\r\npovrchová úprava\r\nvnitřní profilyzasklívací lišty, kontraprofily\r\nvnitřní profily\r\nvýplněkazety, skla\r\nvýplně\r\nzárubněobložkové, rámové\r\nzárubně\r\nprovedení falcefalcové, bezfalcové...\r\nprovedení falce\r\n \r\n\r\ninteriérové dveře\r\nInteriérové dveře jsou jednou z nejvýraznějších ozdob domu, podtrhnou například nově položenou podlahu i celkově zařízený interiér domu. Naše dveře jsou především adresovany zákazníkům, pro které jsou dveře, kromě jim dané funkce velmi důležitým dekorativním prvkem. Interiérové dveře mají více způsobů otevírání. Otočné dveře jsou klasickým a nejstarším způsobem, dveře se točí kolem své osy. Posuvné dveře před zeď jsou dveře, které se, laicky řečeno, posunují po zdi, a tedy zeď zakryjí ve chvíli, kdy jsou otevřeny. Posuvné dveře do stavebního pouzdra, jsou dveře, které mají pouzdro ve zdi a při otevření se zasunou do zdi (do pouzdra). Interiérové dveře dělíme na konstrukčně na rámové a hladké. Dveře jsou vyráběny z přírodních materiálů dřevin a dýh. Například z třívrstvého lepeného smrkového hranolu, dýhované sedmivrstvé laťovky, fixního hranolu dřeviny merbau apod. Každé interiérové dveře mají svůj osobitý charakter, který si najde místo v daném interiéru. Jejich výroba není sériová, zákazníkovi tedy nabízíme možnost vymýšlet si nadstandartní modely a ladit každý detail dle své chuti.',NULL,'',''),
(331,7,'Špaletová okna Janošík','','<div id=\"primary-content\">\r\n<h2>Špaletová okna</h2>\r\n<p><a href=\"http://www.dvere.com/profily-p-1757.html\">Špaletová okna</a> a kastlová okna jsou historická okna, která zdobí historické budovy již více než sto let. Jejich krása způsobila, že se špaletová okna stala neodmyslitelnou součástí renesančních budov a dnes tvoří spolu s&#160;těmito budovami zlatý fond české architektury<strong>.</strong></p>\r\n<p>Námi vyráběná špaletová okna (kastlová okna)  vychází z původní originální konstrukce nicméně jejich výroba využívá  technologie spojené s&#160; poznatky 21. století. Symbióza historických  zkušeností s&#160;nejnovějšími poznatky oboru nám umožňuje vyrábět špaletová okna a kastlová okna o <a href=\"http://www.dvere.com/8-parametry-p-1764.html\">parametrech</a> srovnatelných s&#160;vlastnostmi eurooken.</p>\r\n<p>Historická okna nabízíme ve čtyřech základních <a href=\"http://www.dvere.com/1-profily-p-1757.html\">profilech</a>.  V případech, kdy se nároky zadavatelů rekonstrukcí objektů památkové  péče přece jen vymknou standardní nabídce, vytvoříme zcela věrné repliky  historických špaletových oken.</p>\r\n<p>Velmi široký sortiment profilů špaletových oken, <a href=\"http://www.dvere.com/2-poutce-p-1758.html\">ozdobných poutců</a>, <a href=\"http://www.dvere.com/3-klapacky-p-1759.html\">ozdobných klapaček</a>, <a href=\"http://www.dvere.com/4-hlavice-a-patice-p-1760.html\">řezby ozdobných patic a hlavic</a> ale také historizujícího okenního kování, jako <a href=\"http://www.dvere.com/6-kliky-p-1762.html\">kličky</a>, <a href=\"http://www.dvere.com/5-panty-p-1761.html\">panty</a>, <a href=\"http://www.dvere.com/7-distancniky-p-1763.html\">distančníky</a>&#160;umožňují uspokojit nároky architektů a úřadů památkové péče dbajících úzkostlivě na čistotu linií historických objektů.</p>\r\n</div>\r\n<div id=\"secondary-content\">\r\n<h2 class=\"title-front\">Proč špaletová okna JANOŠÍK?</h2>\r\n<ul>\r\n    <li><strong>tradice od roku 1926</strong></li>\r\n    <li><strong><a href=\"http://www.dvere.com/1-profily-p-1757.html\">různé profily</a>&#160;pro špaletová okna</strong></li>\r\n    <li><strong>přesné repliky jako původní špaletová okna</strong></li>\r\n    <li><strong>dodáváme včetně všech služeb</strong></li>\r\n    <li><strong>připravíme veškerou dokumentaci a povolení</strong></li>\r\n    <li><strong>stovky <a href=\"http://www.dvere.com/94-referencni-stavby-p-1769.html\">referencí </a>po celé České republice</strong></li>\r\n    <li><strong>jeden z předních výrobců oken a dveří<a href=\"http://www.janosik.cz/\"><br />\r\n    </a></strong></li>\r\n</ul>\r\n</div>\r\n<p><a id=\"book\" class=\"galleryslide\" target=\"_blank\" href=\"http://www.spaletova-okna.com/root/obsah/smlouva2_original_janosik_1926.jpg\"><img width=\"376\" height=\"265\" alt=\"Účet na špaletová okna stolárnou Františka Janošíka z roku 1926.\" src=\"http://www.spaletova-okna.com/root/obsah/book.png\" /></a></p>',NULL,'',''),
(333,7,'dveře Masonite','','Počátek výroby dveří v Jihlavě spadá do šedesátých let minulého století. Tradiční výrobce dveří v Jihlavě, Masonite CZ spol. s r.o., je od června 2004 začleněn do skupiny Masonite. Masonite je nadnárodní společnost, která vyrábí stavební komponenty (dveře, okna). Hlavní sídlo se nachází v Tampě na Floridě v USA. Společnost působí v 17 zemích světa, zaměstnává více jak 7000 zaměstnanců a prodává své produkty do více než 50 zemí světa. Firma Masonite CZ spol. s r.o. Jihlava se zabývá výrobou a prodejem především interiérových dveří a zárubní, má výhodnou polohu ve středu České republiky. Od vstupu do skupiny Masonite se společnost snaží vycházet vstříc stále náročnějším požadavkům trhu a přáním zákazníků a postupně rozšiřuje svůj výrobní sortiment.',NULL,'',''),
(334,7,'Minikuchyně, studia, hotely','','<p>Výrobce Mobilspazio, kterého zastupujeme, se zabývá výrobou speciálního nábytku pro hotelové pokoje, malé či studiové byty. Jedná se o kompaktní řešení ložnic, pokojového nábytku, a minikuchyní, přestavitelný nábytek, který řeší nedostatek prostoru v bytě.</p>\r\n<p>&#160;</p>',NULL,'',''),
(342,7,'Zárubně HSE','','<p>Výrobce HSE, Humpolecké stavební elementy, vyrábí moderní ocelové zárubně dle nejnovějších světových trendů. Všechny zárubně lze použít pro protipožární dveře, všechny jsou opatřené těsněním v drážce. Nabízí mnoho možností řešení a tvarů, polodrážkové i bezpolodrážkové, osazení mnoha typů závěsů atd. Povrchová úprava je standardně základová světle šedá, lze dodat i žárově pozinkované či stříkané komaxitem jakoukoliv barvou dle stupnice RAL i jiných stupnic. Všechny zárubně mají moderní ostré hrany s minimálním poloměrem ohybu.</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>',NULL,'',''),
