&#160;</p>\r\n<p>Dejte vašemu bytu nový moderní look, který vás bude denně těšit.  Interiérové dveře SAPELI vám nabízíme ve 20 modelových řadách a stovkách  přírodních i umělých povrchů. Užitnou hodnotu vašich dveří zvýší naše  speciální vlastosti - zvukově izolační, termo, klima, protipožární či  voděodolné.<strong> To vše můžete nyní pořídit s 12% slevou. A navíc na výrobky SAPELI máte 5letou záruku.&#160;</strong></p>\r\n</div>\r\n<p>&#160;</p>\r\n<p><img width=\"600\" height=\"147\" alt=\"\" src=\"http://cms.www.sapeli.cz/cs/goto/Image/88518382618832183-na-stranku-o-sleve-M_nOUZdn.png?_signature=A23CABBC04&amp;height=147&amp;width=600\" /></p>\r\n<p>&#160;</p>\r\n<p><strong>&#160;Proč SAPELI a proč právě nyní?</strong></p>\r\n<ul>\r\n    <li>Od roku 1993 jsem dodali do českých domácností přes 3 miliony dveří.</li>\r\n    <li>Naše dveře sami testujeme a neustále vylepšujeme. Kvalita je u nás na prvním místě.</li>\r\n    <li>Věnujeme pozornost současnýcm trendům v bytovém designu, každý rok přicházíme s top novinkami.</li>\r\n    <li>Máme dveře do každé místnosti, s různými funkčními vlastnostmi.</li>\r\n    <li>U nás si vyberete - 20 modelových řas, stovky přírodních i umělých povrchů, tisíce možných kombinací.</li>\r\n    <li><strong>A NYNÍ NAVÍC NOVOROČNÍ SLEVA 12 % !</strong></li>\r\n</ul>\r\n<p><strong>&#160;</strong></p>\r\n<table cellspacing=\"2\" border=\"0\">\r\n    <tbody>\r\n        <tr>\r\n            <td><img width=\"368\" height=\"300\" alt=\"\" src=\"http://cms.www.sapeli.cz/cs/goto/Image/88518382618832198-render-1-MPhd_Zdn.png?_signature=FC7014674B&amp;height=300&amp;width=368\" /></td>\r\n            <td><img width=\"290\" height=\"300\" alt=\"\" src=\"http://cms.www.sapeli.cz/cs/goto/Image/88518382618832200-render-2-MdNn_Zdn.png?_signature=9968C90165&amp;height=300&amp;width=290\" /></td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<p>&#160;</p>\r\n<p><em>Sleva se vztahuje na celý sortiment výrobků SAPELI, včetně jejich  provedení za příplatek a doplńků k nim, s výjimkou kategorie Praktik a  doplňků k nim. Sleva se rovněž nevztahuje na cenu montáže. Podmínkou  uplatnění slevy je zakoupení kompletu dveře + zárubeň a uzavření smlouvy  v termínu 4. 1. do 29. 2. 2016. SAPELI si vyhrazuje právo na předčasné  ukončení této akce dle kapacit výroby. Akce platí u všech smluvních  partnerů SAPELI. Nelze kombinovat s jinými akčními nabídkami a slevami.  Na zakoupené výrobky lze při splnění podmínek záručního programu  uplatnit 5letou záruku. Základní podmínkou pro nárokování 5leté záruky  je nákup kompletu vč. kování.</em> </p>\r\n<p>&#160;</p>',NULL,'','');
