INSERT INTO `products_description` VALUES
(818,7,'Entero madlo','<p>&#160;</p>',NULL,NULL,'',762,'','',''),
(797,7,'BEDEX Vario V3 dvoukřídlové','<p>Bezpečnostní dveře BEDEX Vario V3 dvoukřídlové <br />\r\n<br />\r\n<br />\r\nPopis a užití Bezpečnostní dveře vhodné do stávajících i nových zárubní k ochraně domů, bytů, kanceláří a jiných prostor v domech, vyrábí se jako dveře otevírané VEN z chráněného prostoru <br />\r\nStandardní rozměry Š. 1 200 - 2 400 mm, v. 1 970 - 2 500 <br />\r\nBezpečnostní třída 3 dle ENV 1627 <br />\r\nStupeň utajení Tajné <br />\r\nPožární odolnost <br />\r\nVzduchová neprůzvučnost Rw 33 dB <br />\r\nCertifikáty výrobku Centrum stavebního inženýrství a. s. Praha <br />\r\nTREZOR TEST s. r. o. <br />\r\nNárodní bezpečnostní úřad ČR <br />\r\nKonstrukce Oboustranně ocelová konstrukce s jeklovým rámem, 4 aktivní, 2 pasivní čepy a zámek MUL-T-LOCK 235 na pohyblivé části, 2 aktivní a 2 pasivní čepy a páka METALUX na pevné části, povrchy z výběrů 17 odstínů nebo základní nástřik, izolační výplň, obvodové těsnění <br />\r\nSoučinitel prostupu tepla k &lt; 2, 8 W. m-2K -1 <br />\r\nPovrch Speciální dveřní fólie d-c-fix dle výběru ze vzorníku , případně čalounění , nástřik dvousložkovým polyuretanovým emailem nebo kazetový obklad <br />\r\nVnitřní výbava Vnitřní antikorozní nátěr, pětibodový aktivní rozvorový mechanismus a 2 pevné čepy proti vysazení v aktivním křídle, dvoubodový aktivní pákový mechanismus a 2 pevné čepy proti vysazení v pasivním křídle, minerální vata <br />\r\nZárubeň Možnost montáže i do stávající ocelové zárubně nebo se zárubní MRB <br />\r\nDoporučená výbava Individuální výběr z aktuální nabídky bezpečnostního kování, zámků a vložek <br />\r\nVýroba Zakázková <br />\r\nCena od 21 650,- bez DPH (včetně rozvorového zámku, páky ovládající neaktivní křídlo, obvodového těsnění, bez zárubně)</p>',NULL,NULL,'',1628,'','',''),
(798,7,'BEDEX Vario D4 dvoukřídlové','<p>Bezpečnostní dveře BEDEX Vario D4 dvoukřídlové <br />\r\n<br />\r\n<br />\r\nPopis a užití Bezpečnostní dveře vhodné do stávajících i nových zárubní k ochraně domů, bytů, kanceláří a jiných prostor v domech, vyrábí se jako dveře otevírané DO chráněného prostoru <br />\r\nStandardní rozměry Š. 1 200 - 2 400 mm, v. 1 970 - 2 500 <br />\r\nBezpečnostní třída 4 dle ENV 1627 <br />\r\nStupeň utajení Přísně tajné <br />\r\nPožární odolnost <br />\r\nVzduchová neprůzvučnost Rw 33 dB <br />\r\nCertifikáty výrobku Centrum stavebního inženýrství a. s. Praha <br />\r\nTREZOR TEST s. r. o. <br />\r\nNárodní bezpečnostní úřad ČR <br />\r\nKonstrukce Oboustranně ocelová konstrukce s jeklovým rámem, speciální výztuhy <br />\r\nSoučinitel prostupu tepla k &lt; 2, 9 W. m-2K -1 <br />\r\nPovrch Povrch z výběrů 17 odstínů nebo základní nástřik, případně čalounění, nástřik dvousložkovým polyuretanovým emailem nebo kazetový obklad <br />\r\nVnitřní výbava Vnitřní antikorozní nátěr, 9-bodový rozvorový mechanismus 6 aktivních a 2 pasivní čepy proti vysazení mezi závěsy, zámek MUL-T-LOCK 235, izolační výplň, obvodové těsnění <br />\r\nZárubeň Typ MRB, ocelový hlubokotažný plech s. 2 mm, základní nástřik <br />\r\nDoporučená výbava Individuální výběr z aktuální nabídky bezpečnostního kování, zámků a vložek <br />\r\nVýroba Zakázková <br />\r\nCena od 26 250,- bez DPH (včetně rozvorového zámku, páky ovládající neaktivní křídlo,obvodového těsnění a zárubně MRB - podmínkou)</p>',NULL,NULL,'',1713,'','',''),
(799,7,'BEDEX Vario EL VD 3','<p><strong>Bezpečnostní dveře BEDEX Vario EL VD 3</strong> <br />\r\n<br />\r\nPopis a užití bezpečnostní dveře vhodné do stávajících i nových zárubní k ochraně domů, kanceláří a jiných nebytových prostorů. Vyrábí se jako dveře otvíratelné do i ven chráněného prostoru, s možností elektronické kontroly vstupu. Otevírají se pomocí čipové karty nebo kódu, který vlastní oprávněná osoba. Dveře jsou vhodné do různých režimových místností z hlediska kontroly vstupu. <br />\r\nStandardní rozměry 600 - 900 / 1970 <br />\r\nBezpečnostní třída 3 dle EVN 1627 <br />\r\nStupeň utajení tajné <br />\r\nPožární odolnost <br />\r\nVzduchová neprůzvučnost Rw = 33 dB <br />\r\nCertifikáty výrobku CSi, Trezor test, NBU <br />\r\nKonstrukce oboustranná ocelová konstrukce s jeklovým rámem a speciálními vnitřními výztuhami, 7 aktivních a 3 pasívní uzamykací čepy, rozvorový zámek MUL-T-LOCK 240 nebo zámek Rostek typ 210 v horní třetině křídla, příprava pro samozamykací zámek BERA nebo ABLOY v místě hlavního zámku(nejsou v ceně), kabelová průchodka vyúsťující v polodrážce na straně závěsů, obvodové těsnění <br />\r\nSoučinitel prostupu tepla k &lt; 3,5 W. m-2K -1 <br />\r\nPovrch z výběru 17 odstínů nebo základní nástřik <br />\r\nVnitřní výbava vnitřní antikorozní a protipožární nátěr, desetibodový zajišťovací mechanismus, minerální vata <br />\r\nZárubeň přibalen krycí profil a výztuha zárubně, které se montují dle přiloženého návodu. Možnost montáže i do stávající ocelové zárubně nebo se zárubní MRB <br />\r\nDoporučená výbava individuální výběr základní nabídky bezp. kování a vložek příslušné třídy <br />\r\nVýroba zakázková <br />\r\nCena od 17 840,- bez DPH ( včetně rozvorového zámku, bez elektromechanického zámku a kabeláže ) <br />\r\n</p>',NULL,NULL,'',1522,'','',''),
(800,7,'BEDEX Vario EL VD 3 s požární odolností','<p><strong>Bezpečnostní dveře BEDEX Vario EL VD 3 s požární odolností EI 30D1</strong> <br />\r\n<br />\r\nPopis a užití bezpečnostní dveře s požární odolností vhodné do stávajících i nových zárubní k ochraně domů, kanceláří a jiných nebytových prostorů. Vyrábí se jako dveře otevírané do i ven chráněného prostoru, s možností elektronické kontroly vstupu. Otevírají se pomocí čipové karty nebo kódu, který vlastní oprávněná osoba. Dveře jsou vhodné do různých režimových místností z hlediska kontroly vstupu. <br />\r\nStandardní rozměry 600 - 900 / 1970 <br />\r\nBezpečnostní třída 3 dle EVN 1627 <br />\r\nStupeň utajení tajné <br />\r\nPožární odolnost EI 30 D1 <br />\r\nVzduchová neprůzvučnost Rw = 33 dB <br />\r\nCertifikáty výrobku CSi, Trezor test, NBU <br />\r\nKonstrukce oboustranná ocelová konstrukce s jeklovým rámem a speciálními vnitřními výztuhami, 7 aktivních a 3 pasívní uzamykací čepy, rozvorový zámek MUL-T-LOCK 240 nebo zámek Rostek typ 210 v horní třetině křídla, příprava pro samozamykací zámek BERA nebo ABLOY v místě hlavního zámku(nejsou v ceně), kabelová průchodka vyúsťující v polodrážce na straně závěsů, obvodové těsnění <br />\r\nSoučinitel prostupu tepla k &lt; 3,5 W. m-2K -1 <br />\r\nPovrch z výběru 17 odstínů nebo základní nástřik <br />\r\nVnitřní výbava vnitřní antikorozní a protipožární nátěr, desetibodový zajišťovací mechanismus, minerální vata <br />\r\nZárubeň přibalen krycí profil a výztuha zárubně, které se montují dle přiloženého návodu. Možnost montáže i do stávající ocelové zárubně nebo se zárubní MRB <br />\r\nDoporučená výbava individuální výběr základní nabídky bezp. kování a vložek příslušné třídy <br />\r\nVýroba zakázková <br />\r\nCena od 18 970,- bez DPH ( včetně rozvorového zámku, bez elektromechanického zámku a kabeláže ) <br />\r\n</p>',NULL,NULL,'',1754,'','',''),
(801,7,'BEDEX Vario EL VD 4','<p><strong>Bezpečnostní dveře BEDEX Vario EL VD 4 se zárubní MRB</strong> <br />\r\n<br />\r\nPopis a užití bezpečnostní dveře s ocelovou zárubní vhodné k ochraně domů, kanceláří a jiných nebytových prostorů. Vyrábí se jako dveře otevírané do i ven chráněného prostoru, s možností elektronické kontroly vstupu. Otevírají se pomocí čipové karty nebo kódu, který vlastní oprávněná osoba. Dveře jsou vhodné do různých režimových místností z hlediska kontroly vstupu. <br />\r\nStandardní rozměry 600 - 900 / 1970 <br />\r\nBezpečnostní třída 4 dle EVN 1627 <br />\r\nStupeň utajení přísně tajné <br />\r\nVzduchová neprůzvučnost Rw = 33 dB <br />\r\nCertifikáty výrobku CSi, Trezor test, NBU <br />\r\nKonstrukce oboustranná ocelová konstrukce s jeklovým rámem a speciálními vnitřními výztuhami, 7 aktivních a 3 pasívní uzamykací čepy, rozvorový zámek MUL-T-LOCK 240 nebo zámek Rostek typ 210 v horní třetině křídla, příprava pro samozamykací zámek BERA nebo ABLOY v místě hlavního zámku(nejsou v ceně), kabelová průchodka vyúsťující v polodrážce na straně závěsů, obvodové těsnění <br />\r\nSoučinitel prostupu tepla k &lt; 3,5 W. m-2K -1 <br />\r\nPovrch z výběru 17 odstínů nebo základní nástřik <br />\r\nVnitřní výbava vnitřní antikorozní a protipožární nátěr, desetibodový zajišťovací mechanismus, minerální vata <br />\r\nZárubeň typ MRB na zazdění, ocelový hlubokotažný plech s. 2mm, základní nástřik <br />\r\nDoporučená výbava individuální výběr základní nabídky bezp. kování a vložek příslušné třídy <br />\r\nVýroba zakázková <br />\r\nCena od 19 490,- bez DPH ( včetně rozvorového zámku a ocelové zárubě, bez elektromechanického zámku a kabeláže ) <br />\r\n</p>',NULL,NULL,'',1606,'','',''),
(802,7,'BEDEX Vario EL VD 4 s požární odolností','<p><strong>Bezpečnostní dveře BEDEX Vario EL VD 4 s požární odolností se zárubní MRB</strong> <br />\r\n<br />\r\nPopis a užití bezpečnostní dveře s požární odolností s ocelovou zárubní vhodné k ochraně domů, kanceláří a jiných nebytových prostorů. Vyrábí se jako dveře otevírané do i ven chráněného prostoru, s možností elektronické kontroly vstupu. Otevírají se pomocí čipové karty nebo kódu, který vlastní oprávněná osoba. Dveře jsou vhodné do různých režimových místností z hlediska kontroly vstupu. <br />\r\nStandardní rozměry 600 - 900 / 1970 <br />\r\nBezpečnostní třída 4 dle EVN 1627 <br />\r\nStupeň utajení přísně tajné <br />\r\nPožární odolnost EI 30 D1 <br />\r\nVzduchová neprůzvučnost Rw = 33 dB <br />\r\nCertifikáty výrobku CSi, Trezor test, NBU <br />\r\nKonstrukce oboustranná ocelová konstrukce s jeklovým rámem a speciálními vnitřními výztuhami, 7 aktivních a 3 pasívní uzamykací čepy, rozvorový zámek MUL-T-LOCK 240 nebo zámek Rostek typ 210 v horní třetině křídla, příprava pro samozamykací zámek BERA nebo ABLOY v místě hlavního zámku(nejsou v ceně), kabelová průchodka vyúsťující v polodrážce na straně závěsů, obvodové těsnění <br />\r\nSoučinitel prostupu tepla k &lt; 3,5 W. m-2K -1 <br />\r\nPovrch z výběru 17 odstínů nebo základní nástřik <br />\r\nVnitřní výbava vnitřní antikorozní a protipožární nátěr, desetibodový zajišťovací mechanismus, minerální vata <br />\r\nZárubeň typ MRB na zazdění, ocelový hlubokotažný plech s. 2mm, základní nástřik <br />\r\nDoporučená výbava individuální výběr základní nabídky bezp. kování a vložek příslušné třídy <br />\r\nVýroba zakázková <br />\r\nCena od 20 620,- bez DPH ( včetně rozvorového zámku a ocelové zárubě, bez elektromechanického zámku a kabeláže ) <br />\r\n</p>',NULL,NULL,'',1622,'','',''),
