(445,7,'Sapeli bezpečnostní kovové','Dveře mají uvnitř trezorový mechanizmus se šesti až sedmi bezpečnostními čepy, které se zasouvají do zárubní a tím zajišťují celý dveřní otvor. Povrchově jsou upraveny jako klasické dveře dle modelových řad SAPELI podle přání zákazníka. Komplet dveří a zárubní je vybaven 3D seříditelnými závěsy. Bezpečnostní uzávěry jsou vyráběny i s požární odolností EI 30 a EI 45. Všechny typy dveří jsou zkoušeny a certifikovány a splňují veškeré právní a technické požadavky stanovené na území ČR na stavební prvky. Bezpečnostní dveře SAPELI jsou nabízeny ve 2. a 3. bezpečnostní třídě a jsou určeny k zabezpečení bytů, kanceláří a dalších chráněných prostorů. Povrch dveří může být z obou stran v povrchové úpravě CPL (bílá, šedá, buk, javor, olše, dub, třešeň). Z vnitřní strany je dýha ve Vámi zvolené modelové řadě. Montáž bezpečnostních dveří může provádět pouze pověřená firma.  \r\n\r\n \r\n\r\nNelze dodat dveře s přídavným zámkem, s hranami KARNIS a SOFT. Polodrážka dveří je 29 mm.',NULL,NULL,'',5965,'','',''),
(446,7,'Sapeli protipožární','',NULL,NULL,'',3169,'','',''),
(447,7,'Sapeli zvukově izolační','ZVUKOVÌ IZOLAČNÍ DVEØE nabízíme v plném provedení*. Dveře jsou speciální konstrukce doplněné zvukoizolačními doplňky. Tyto dveře Vám umožňují dokonale oddělit hlučné prostory jako jsou např. chodby od běžných provozních prostor, nebo také dosáhnout vysokého užitného komfortu v místnostech s požadavky na klidné prostředí jako jsou např. ložnice nebo pracovny.\r\n\r\n    *\r\n      Kovová zárubeň musí být osazena těsněním.\r\n\r\n Zvukově izolační dveře lze dodat v šířkách 60, 70, 80, 90. 	Cena dveřního křídla + příplatek za zvukovou izolaci podle\r\nhodnoty útlumu. Cena protipožárního dveřního křídla + příplatek za zvukovou izolaci 1 400,-Kč\r\n\r\nDoporučené ceny uvedeny bez DPH.\r\nPozn.: zárubeň ke zvukově izolačním dveřím je osazena třemi závěsy.\r\nCena dvoukřídlých dveří 125, 145, 165, 185 = dvojnásobek ceny jednokřídlých dveří.\r\nU prosklených modelů je možné použít pouze sklo STRATOPHONE &#8211; provedení čiré.\r\nProsklené dveře M30 příplatek + 2 650,&#8211; Kč, M40 + 4 100,&#8211; Kč. Bezpolodrážkové provedení se skrytými závěsy TECTUS + 3 000,&#8211; Kč.',NULL,NULL,'',7108,'','',''),
