(1766,7,'91 Povrchová úprava','<p>&#160;</p>\r\n<div id=\"primary-content\">\r\n<h1>POVRCHOVÁ ÚPRAVA</h1>\r\n<p>Povrchová úprava špaletových oken je prováděna technologií HighRes,  která představuje trvanlivost, která byla donedávna nepředstavitelná.  Okna jsou povrchově upravována vysoce elastickými akrylovými barvami a  lazurami s vynikající odolností proti povětrnostním vlivům a ochranou  proti UV záření. Tato povrchová úprava respektuje vlastnosti dřeva, je  pružná, pohybuje se dřevem a proto nepopraská. Na výběr je z několika  odstínů lazur, celé škály barev RAL nebo transparantní povrchové úpravy.</p>\r\n<p>TŘÍVRSTVÁ POVRCHOVÁ ÚPRAVA SPOČÍVÁ:</p>\r\n<ul>\r\n    <li>hloubková impregnace ponořením v namáčecí vaně (ochrana proti houbám a plísním)</li>\r\n    <li>barevná impregnace ponořením v namáčecí vaně (podtonování pod vrchní lazuru)</li>\r\n    <li>vysokotlakém nanesení jedné vrstvy lazury o tloušťce 300 mikronů.</li>\r\n</ul>\r\n</div>',NULL,NULL,'',0,NULL,'',''),
