(1757,7,'1. Profily','<p>&#160;</p>\r\n<h1>PROFILY</h1>\r\n<p>Základní nabídku špaletových oken tvoří čtyři profily, profil okna je  možno také vyrobit na základě dodaných výkresů nebo dle původního okna  jako přesnou kopii včetně všech ozdobných prvků.</p>\r\n<ol>\r\n    <li>castle - standardní špaletové okno</li>\r\n    <li>duplik - nejstarší profil špaletových oken, kde se křídla otvírají na opačné strany</li>\r\n    <li>slim - špaletová okno v kombinaci se zúženým eurooknem má vynikající izolační a zvukové vlastnosti</li>\r\n    <li>neoold - standardní profil špaletového okno s celoobvodovým kováním</li>\r\n    <li>rustikal - eurookno s rustikálními prvky pro historicky  stylizované budovy, nebo historické budovy, kde památková péče poleví s  požadavků na špaletová okna</li>\r\n</ol>\r\n<div class=\"border\"><a title=\"pro zvětšení klikněte\" target=\"_blank\" class=\"galleryslide\" href=\"http://www.spaletova-okna.com/root/sortiment/profily/castle,-neoold.jpg\"><img height=\"108\" title=\"castle pro zvětšení klikněte\" alt=\"castle\" src=\"http://www.spaletova-okna.com/root/sortiment/profily/spaletova_okna_castle.png\" /></a><a title=\"pro zvětšení klikněte\" target=\"_blank\" class=\"galleryslide\" href=\"http://www.spaletova-okna.com/root/sortiment/profily/duplik.jpg\"><img height=\"108\" title=\"duplik pro zvětšení klikněte\" alt=\"duplik\" src=\"http://www.spaletova-okna.com/root/sortiment/profily/spaletova_okna_duplik.png\" /></a><a title=\"pro zvětšení klikněte\" target=\"_blank\" class=\"galleryslide\" href=\"http://www.spaletova-okna.com/root/sortiment/profily/slim.jpg\"><img height=\"108\" title=\"slim pro zvětšení klikněte\" alt=\"slim\" src=\"http://www.spaletova-okna.com/root/sortiment/profily/spaletova_okna_slim.png\" /></a><a title=\"pro zvětšení klikněte\" target=\"_blank\" class=\"galleryslide\" href=\"http://www.spaletova-okna.com/root/sortiment/profily/castle,-neoold.jpg\"><img height=\"108\" title=\"neoold pro zvětšení klikněte\" alt=\"neoold\" src=\"http://www.spaletova-okna.com/root/sortiment/profily/spaletova_okna_neoold.png\" /></a><img height=\"108\" title=\"rustikal pro zvětšení klikněte\" alt=\"rustikal\" src=\"http://www.spaletova-okna.com/root/sortiment/profily/rustikalni_okno_rustikal.png\" /></div>',NULL,NULL,'',0,NULL,'',''),
(1758,7,'2. Poutce','<h1>POUTCE</h1>\r\n<p>Poutec špaletového okna může být ozdoben buď připevněnou speciální  okrasnou lištou nebo drážkami o různých rozměrech v různých rozestupech  vyfrézovanými přímo v poutci. Základní tvary ozdobných poutců jsou  uvedeny níže. Vybírat ale nemusíte jen z naší nabídky, okrasu na poutec  umíme také vyrobit podle dodaných výkresů nebo podle vzorku původního  okna.</p>\r\n<div class=\"border\"><a title=\"pro zvětšení klikněte\" target=\"_blank\" class=\"galleryslide \" href=\"http://www.spaletova-okna.com/root/sortiment/poutce/2a.png\"><img height=\"108\" title=\"OP0 pro zvětšení klikněte\" alt=\"OP0\" src=\"http://www.spaletova-okna.com/root/sortiment/poutce/2.png\" /></a><a title=\"pro zvětšení klikněte\" target=\"_blank\" class=\"galleryslide\" href=\"http://www.spaletova-okna.com/root/sortiment/poutce/5a.png\"><img height=\"108\" title=\"OP2 pro zvětšení klikněte\" alt=\"OP2\" src=\"http://www.spaletova-okna.com/root/sortiment/poutce/5.png\" /></a><a title=\"pro zvětšení klikněte\" target=\"_blank\" class=\"galleryslide\" href=\"http://www.spaletova-okna.com/root/sortiment/poutce/7a.png\"><img height=\"108\" title=\"OP4 pro zvětšení klikněte\" alt=\"OP4\" src=\"http://www.spaletova-okna.com/root/sortiment/poutce/7.png\" /></a><a title=\"pro zvětšení klikněte\" target=\"_blank\" class=\"galleryslide\" href=\"http://www.spaletova-okna.com/root/sortiment/poutce/10a.png\"><img height=\"108\" title=\"OP5 pro zvětšení klikněte\" alt=\"OP5\" src=\"http://www.spaletova-okna.com/root/sortiment/poutce/10.png\" /></a><a title=\"pro zvětšení klikněte\" target=\"_blank\" class=\"galleryslide\" href=\"http://www.spaletova-okna.com/root/sortiment/poutce/4a.png\"><img height=\"108\" title=\"OP6 pro zvětšení klikněte\" alt=\"OP6\" src=\"http://www.spaletova-okna.com/root/sortiment/poutce/4.png\" /></a><a title=\"pro zvětšení klikněte\" target=\"_blank\" class=\"galleryslide\" href=\"http://www.spaletova-okna.com/root/sortiment/poutce/8a.png\"><img height=\"108\" title=\"OP7 pro zvětšení klikněte\" alt=\"OP7\" src=\"http://www.spaletova-okna.com/root/sortiment/poutce/8.png\" /></a><a title=\"pro zvětšení klikněte\" target=\"_blank\" class=\"galleryslide\" href=\"http://www.spaletova-okna.com/root/sortiment/poutce/6a.png\"><img height=\"108\" title=\"OP8 pro zvětšení klikněte\" alt=\"OP8\" src=\"http://www.spaletova-okna.com/root/sortiment/poutce/6.png\" /></a><img height=\"108\" title=\"OP9 pro zvětšení klikněte\" alt=\"OP9\" src=\"http://www.spaletova-okna.com/root/sortiment/poutce/3.png\" /></div>\r\n<p>&#160;</p>',NULL,NULL,'',0,NULL,'',''),
