(1759,7,'3. Klapačky','<p>&#160;</p>\r\n<h1>KLAPAČKY</h1>\r\n<p>Historický vzhled dávají špaletovým oknům rovněž ozdobné klapačky  nejrůznějších rustikálních profilů. Kromě klapaček z naší nabídky umíme  vyrobit také jiné profily buď podle dodaných výkresů nebo podle vzorku  původního okna.</p>\r\n<div class=\"border\"><a href=\"http://www.spaletova-okna.com/root/sortiment/klapacky/6a.png\" class=\"galleryslide\" target=\"_blank\" title=\"pro zvětšení klikněte\"><img height=\"108\" src=\"http://www.spaletova-okna.com/root/sortiment/klapacky/6a-%E2%80%93-kopie.png\" alt=\"OK0\" title=\"OK0 pro zvětšení klikněte\" /></a><a href=\"http://www.spaletova-okna.com/root/sortiment/klapacky/5a.png\" class=\"galleryslide\" target=\"_blank\" title=\"pro zvětšení klikněte\"><img height=\"108\" src=\"http://www.spaletova-okna.com/root/sortiment/klapacky/5a-%E2%80%93-kopie.png\" alt=\"OK1\" title=\"OK1 pro zvětšení klikněte\" /></a><a href=\"http://www.spaletova-okna.com/root/sortiment/klapacky/1a.png\" class=\"galleryslide\" target=\"_blank\" title=\"pro zvětšení klikněte\"><img height=\"108\" src=\"http://www.spaletova-okna.com/root/sortiment/klapacky/1a-%E2%80%93-kopie.png\" alt=\"OK2\" title=\"OK2 pro zvětšení klikněte\" /></a><a href=\"http://www.spaletova-okna.com/root/sortiment/klapacky/4a.png\" class=\"galleryslide\" target=\"_blank\" title=\"pro zvětšení klikněte\"><img height=\"108\" src=\"http://www.spaletova-okna.com/root/sortiment/klapacky/4a-%E2%80%93-kopie.png\" alt=\"OK3\" title=\"OK3 pro zvětšení klikněte\" /></a><a href=\"http://www.spaletova-okna.com/root/sortiment/klapacky/7a.png\" class=\"galleryslide\" target=\"_blank\" title=\"pro zvětšení klikněte\"><img height=\"108\" src=\"http://www.spaletova-okna.com/root/sortiment/klapacky/7a-%E2%80%93-kopie.png\" alt=\"OK4\" title=\"OK4 pro zvětšení klikněte\" /></a><a href=\"http://www.spaletova-okna.com/root/sortiment/klapacky/3a.png\" class=\"galleryslide\" target=\"_blank\" title=\"pro zvětšení klikněte\"><img hei