(1762,7,'6. Kliky','<h1>KLIKY</h1>\r\n<p>Špaletové okno je<span style=\"mso-spacerun:yes\">&#160; </span>možno osadit  jakoukoliv klikou či kličkou dostupnou na trhu s&#160;okenním kováním, volí  se obvykle klika dle přání zákazníka nebo požadavků památkových úřadů.  Nejčastěji používané kličky na špaletová okna jsou Elegant a Alt Wien.</p>\r\n<p>Typy klik:</p>\r\n<ul>\r\n    <li>Rozvora - okenní klika pro dvoukřídlou část špaletová okna s drátěným zamykacím systémem</li>\r\n    <li>Půloliva - okenní klika pro jednokřídlou část špaletová okna</li>\r\n    <li>Oliva - okenní klika pro dvoukřídlou část špaletová okna s celoobvodovým kováním nebo kováním se střelkou</li>\r\n</ul>\r\n<div id=\"gallery\">\r\n<h2>ALT WIEN</h2>\r\n<div>\r\n<p>Povrchy: OLV - mosaz leštěná, lesklá; OFS - mosaz, bronz česaný  satinovaný; OC - chrom lesklý; OCS - chrom satinovaný, broušený, matný;  ONS - nikl satinovaný, broušený, matný</p>\r\n</div>\r\n<div class=\"border\"><a title=\"pro zvětšení klikněte\" target=\"_blank\" class=\"galleryslide\" href=\"http://www.spaletova-okna.com/root/sortiment/kliky/altwien/aw_rozvora_2.png\"><img height=\"108\" title=\"rozvora pro zvětšení klikněte\" alt=\"rozvora\" src=\"http://www.spaletova-okna.com/root/sortiment/kliky/altwien/aw_rozvora.png\" /></a></div>\r\n<div class=\"border\"><a title=\"pro zvětšení klikněte\" target=\"_blank\" class=\"galleryslide\" href=\"http://www.spaletova-okna.com/root/sortiment/kliky/altwien/aw_puloliva1_2.png\"><img height=\"108\" title=\"puloliva pro zvětšení klikněte\" alt=\"puloliva\" src=\"http://www.spaletova-okna.com/root/sortiment/kliky/altwien/aw_puloliva1.png\" /></a></div>\r\n<div class=\"border\"><a title=\"pro zvětšení klikněte\" target=\"_blank\" class=\"galleryslide\" href=\"http://www.spaletova-okna.com/root/sortiment/kliky/altwien/aw_puloliva2velka_2.png\"><img height=\"108\" title=\"puloliva velká pro zvětšení klikněte\" alt=\"puloliva velká\" src=\"http://www.spaletova-okna.com/root/sortiment/kliky/altwien/aw_puloliva2velka.png\" /></a></div>\r\n<div class=\"border\"><a title=\"pro zvětšení klikněte\" target=\"_blank\" class=\"galleryslide\" href=\"http://www.spaletova-okna.com/root/sortiment/kliky/altwien/aw_oliva_2.png\"><img height=\"108\" title=\"oliva pro zvětšení klikněte\" alt=\"oliva\" src=\"http://www.spaletova-okna.com/root/sortiment/kliky/altwien/aw_oliva.png\" /></a></div>\r\n<div class=\"border\"><a title=\"pro zvětšení klikněte\" target=\"_blank\" class=\"galleryslide\" href=\"http://www.spaletova-okna.com/root/sortiment/kliky/altwien/aw_balkon_2.png\"><img height=\"108\" title=\"balkonová klika pro zvětšení klikněte\" alt=\"balkonová klika\" src=\"http://www.spaletova-okna.com/root/sortiment/kliky/altwien/aw_balkon.png\" /></a></div>\r\n</div>\r\n<div id=\"gallery\">\r\n<h2>ELEGANT</h2>\r\n<div>\r\n<p>Povrchy: OLV - mosaz leštěná, lesklá; OFS - mosaz, bronz česaný  satinovaný; OC - chrom lesklý; OCS - chrom satinovaný, broušený, matný;  ONS - nikl satinovaný, broušený, matný; SCS - samet chrom; SNS - samet  nikl</p>\r\n</div>\r\n<div class=\"border\"><a title=\"pro zvětšení klikněte\" target=\"_blank\" class=\"galleryslide\" href=\"http://www.spaletova-okna.com/root/sortiment/kliky/altwien/elegant/e_rozvora_2.png\"><img height=\"108\" title=\"rozvora pro zvětšení klikněte\" alt=\"rozvora\" src=\"http://www.spaletova-okna.com/root/sortiment/kliky/altwien/elegant/e_rozvora.png\" /></a></div>\r\n<div class=\"border\"><a title=\"pro zvětšení klikněte\" target=\"_blank\" class=\"galleryslide\" href=\"http://www.spaletova-okna.com/root/sortiment/kliky/altwien/elegant/e_puloliva_2.png\"><img height=\"108\" title=\"puloliva pro zvětšení klikněte\" alt=\"puloliva\" src=\"http://www.spaletova-okna.com/root/sortiment/kliky/altwien/elegant/e_puloliva.png\" /></a></div>\r\n<div class=\"border\"><a title=\"pro zvětšení klikněte\" target=\"_blank\" class=\"galleryslide\" href=\"http://www.spaletova-okna.com/root/sortiment/kliky/altwien/elegant/e_pulolivavelka_2.pn