(468,7,'Reference','<p><span style=\"font-weight: bold;\"><a href=\"http://www.dvere.com/reference#rs\">seznam klientů</a><br />\r\n<br />\r\n<table valign=\"top\" cellspacing=\"5\" cellpadding=\"0\" border=\"0\" width=\"90%\">\r\n    <tbody>\r\n        <tr>\r\n            <td><span style=\"font-weight: bold;\">Česká spořitelna</span><br />\r\n            Administrativní budova<br />\r\n            České spořitelny v Praze na Pankráci, <br />\r\n            investor SUBTERRA, a.s.,<br />\r\n            objem 6,700 mil. Kč</td>\r\n            <td><img src=\"/Image/sporitelna.jpg\" alt=\"\" align=\"right\" height=\"137\" width=\"200\" /></td>\r\n        </tr>\r\n        <tr>\r\n            <td><strong>SONY</strong><br />\r\n            Administrativní budova<br />\r\n            Sony a Contactel,<br />\r\n            Vinohradská 174,<br />\r\n            investor Bess Group,<br />\r\n            objem 3,500 mil. Kč</td>\r\n            <td><img src=\"http://www.dvere.com/Image/sony.jpg\" alt=\"\" align=\"right\" height=\"184\" width=\"200\" /></td>\r\n        </tr>\r\n        <tr>\r\n            <td><span style=\"font-weight: bold;\">Hotel </span><br />\r\n            Hradební 9</td>\r\n            <td><img src=\"http://www.dvere.com/Image/hotel-hradebni-9.jpg\" alt=\"\" align=\"right\" height=\"150\" width=\"200\" /></td>\r\n        </tr>\r\n        <tr>\r\n            <td><span style=\"font-weight: bold;\">AssiDoman</span><br />\r\n            Administrativní budova továrny na výrobu  vlnité lepenky AssiDoman v Žebráku, investor SKANSKA-stav, s.r.o., objem 1,100 mil. Kč\r\n            <div>&#160;</div>\r\n            </td>\r\n            <td><img alt=\"\" src=\"http://www.dvere.com/Image/asidomain300px.jpg\" align=\"right\" height=\"120\" width=\"200\" /></td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n</span></p>\r\n<p>&#160;</p>\r\n<p><font face=\"Times New Roman\"><font face=\"Arial\"><span class=\"Title\">\r\n<p>&#160;</p>\r\n<em> </em>  </span></font> </fon