aňská investor NFO AISA , NIKON  1,350 mil. Kč<br />\r\n<br />\r\n</font></div>\r\n<div><font face=\"Arial\"> </font></div>\r\n<div><font face=\"Arial\">- dodávka a montáž dveří a zárubní do admin. Budovy Palác Kodaňská etapa 2.,Office Park Praha Tiskárna ADORE Praha 4 Modřany,&#160; Hasičská zbrojnice Lipence, investor MÚ Lipence, stavbyvedoucí J. Sehnal, DPS Zbraslav, BD Øehořova, Hotel Hradební 9 Praha 1, a řadu RD v Praze a okolí.</font></div>\r\n<div><font face=\"Arial\">   </font></div>\r\n<div><font face=\"Arial\"><br />\r\nDále jsme vybavili jsme řadu rodinných domů a bytů pro občany.<br />\r\n<br />\r\nSpolečnost Antrea, s.r.o. má smlouvy o obchodním zastoupení s firmami Barausse, SAPELI, ALIA, LOPRAIS, LIJA, BEDEX, CAG, COBRA, DIPRO, COLOMBO,FENSTAR , IEG, VKV, OLIVARI, MaT. Dále spolupracujeme s firmami ROSTEX, FAB, HEFA, Jakov, KRONODOOR, DORMA, Dierre, atd.</font></div>',NULL,NULL,'',7049,'','',''),
(469,7,'Jak nakupovat','<h1><strong>Dodací podmínky</strong></h1>\r\n<h2><br />\r\nTermíny dodání:</h2>\r\n<p>foliované dveře: vybrané modely skladem, atypické či posuvné dveře 5-6 týdnů, italské dveře Alpeaporte 3-5 týdnů, FererroLegno 9-10 týdnů.</p>\r\n<p>dveře s laminátovým povrchem CPL: omezené množství&#160; skladem, výroba standardních dveří 4 týdny, atypické či posuvné dveře 5 týdnů</p>\r\n<p>dýhované dveře a s laminátovým povrchem: 5 týdnů</p>\r\n<p>bezpečnostní dveře: 2-6 týdnů</p>\r\n<p>dveře Lualdi: skryté zárubně 14 dní, dveře 9-10 týdnů</p>\r\n<p>ostatní italské dveře: 10 týdnů</p>\r\n<p>kování: většina sortimentu do 3 dnů, jinak 2-5 týdnů</p>\r\n<p>stavební pouzdra: 2 dny</p>\r\n<h2><br />\r\n<br />\r\nObjednávka nových dveří, kování a služeb</h2>\r\n<p>Pro nákup kování je možno použít E-shop, je nutno se zaregistrovat a pak již jednoduše nakupovat - přidávat do košíku. Platby jsou možné převodem, hotově při převzetí, dobírkou.</p>\r\n<p>Co není v E-shopu ocěněno, je třeba objednat standardním způsobem, tedy zasláním objednávky na e-mail info@dvere.com nebo použijte kontaktní formulář.</p>\r\n<p>Samozřejmě je možné přijít sjednat objednávku také k nám do vzorkové prodejny a podívat se na vzorky celých dveří,&#160; povrchových úprav dveří, kování.</p>\r\n<h2><br />\r\n<br />\r\nObjednávka bazar</h2>\r\n<ul>\r\n    <li>vyberte dveře z nabídky bazaru</li>\r\n    <li>přidejte vybrané dveře do košíku</li>\r\n    <li>vyplňte kontaktní údaje</li>\r\n    <li>pokud požadujete dopravu, napište to do poznámky</li>\r\n</ul>',NULL,NULL,'',13332,'','',''),
(796,7,'BEDEX Vario V3 jednokřídlové','<p><strong>Bezpečnostní dveře BEDEX Vario V3 jednokřídlové</strong> <br />\r\n<br />\r\nPopis a užití Bezpečnostní dveře vhodné do stávajících i nových zárubní k ochraně domů, bytů, kanceláří a jiných prostor v domech, vyrábí se jako dveře otevírané VEN z chráněného prostoru <br />\r\nStandardní rozměry Š. 800 - 1 200 mm, v. 1 970 - 2 500 <br />\r\nBezpečnostní třída 3 dle ENV 1627 <br />\r\nStupeň utajení Tajné <br />\r\nPožární odolnost <br />\r\nVzduchová neprůzvučnost Rw 33 dB <br />\r\nCertifikáty výrobku Centrum stavebního inženýrství a. s. Praha <br />\r\nTREZOR TEST s. r. o. <br />\r\nNárodní bezpečnostní úřad ČR <br />\r\nKonstrukce Oboustranná ocelová konstrukce s jeklovým rámem, obvodové těsnění <br />\r\nSoučinitel prostupu tepla k &lt; 2, 8 W. m-2K -1 <br />\r\nPovrch Speciální dveřní fólie dle výběru ze 17 odstínů, případně čalounění , nástřik dvousložkovým polyuretanovým emailem nebo kazetový obklad <br />\r\nVnitřní výbava Vnitřní antikorozní nátěr, rozvorový zámek MUL-T-LOCK 235, 10-bodový rozvorový mechanismus, 7 aktivních a 2 pevné čepy proti vysazení mezi závěsy, izolační výplň <br />\r\nZárubeň Možnost montáže i do stávající ocelové zárubně nebo se zárubní MRB <br />\r\nDoporučená výbava Individuální výběr z aktuální nabídky bezpečnostního kování, zámků a vložek <br />\r\nVýroba Zakázková <br />\r\nCena od 12 890,- bez DPH (včetně rozvorového zámku a obvod.těsnění ) <br />\r\n<br />\r\n<br />\r\n<br />\r\n<strong>Bezpečnostní dveře BEDEX Vario V3 jednokřídlové <br />\r\ns požární odolností EI, EW 30D1</strong> <br />\r\n<br />\r\n<br />\r\nPopis a užití Bezpečnostní dveře vhodné do stávajících i nových zárubní k ochraně domů, bytů, kanceláří a jiných prostor v domech, vyrábí se jako dveře otevírané VEN z chráněného prostoru <br />\r\nStandardní rozměry 800 - 900 / 1970 , atypické rozměry - š. i v. plus 15%, nebo 20% plochy <br />\r\nBezpečnostní třída 3 dle ENV 1627 <br />\r\nStupeň utajení Tajné <br />\r\nPožární odolnost EI, EW 30 D1 <br />\r\nVzduchová neprůzvučnost Rw 33 dB <br />\r\nCertifikáty výrobku Centrum stavebního inženýrství a. s. Praha <br />\r\nTREZOR TEST s. r. o. <br />\r\nNárodní bezpečnostní úřad ČR <br />\r\nLIGNOTESTING, a.s. SK <br />\r\nKonstrukce Oboustranná ocelová konstrukce s jeklovým rámem, obvodové a protipožární těsnění <br />\r\nSoučinitel prostupu tepla „U“ k &lt; 3, 5 W/(m2 k), splňuje požadavek ČSN 73 0540 <br />\r\nPovrch Speciální dveřní fólie dle výběru ze 17 odstínů, případně čalounění , nástřik dvousložkovým polyuretanovým emailem nebo kazetový obklad <br />\r\nVnitřní výbava Vnitřní antikorozní nátěr, rozvorový zámek MUL-T-LOCK 235, 10-bodový rozvorový mechanismus, 7 aktivních a 2 pevné čepy proti vysazení mezi závěsy, izolační výplň <br />\r\nZárubeň Možnost montáže i do stávající ocelové zárubně nebo se zárubní MRB <br />\r\nDoporučená výbava Individuální výběr z aktuální nabídky bezpečnostního kování, zámků a vložek <br />\r\nVýroba Zakázková <br />\r\nCena od 14 600,- bez DPH (včetně rozvorového zámku) <br />\r\n<br />\r\n</p>',NULL,NULL,'',1904,'','',''),
