(701,7,'Bedex Standard 2','<p><strong>Bezpečnostní dveře BEDEX STANDARD 2 </strong><br />\r\ns požární odolností EI 30 D2<br />\r\n<br />\r\nBezpečnostní dveře vhodné do stávajících i nových zárubní k ochraně domů, bytů, kanceláří a jiných prostor v domech, vyrábí se jako dveře otevírané DO chráněného prostoru <br />\r\n<br />\r\nStandardní rozměry 800 - 900 / 1970 mm , atypické rozměry - š. i v. plus 15%, nebo 20% plochy - výroba jen ve větších sériích<br />\r\nBezpečnostní třída 2 dle ENV 1627 <br />\r\nStupeň utajení Důvěrné<br />\r\nPožární odolnost EI 30D2<br />\r\nVzduchová neprůzvučnost Rw 36 dB<br />\r\nCertifikáty výrobku Centrum stavebního inženýrství a. s. Praha<br />\r\nTREZOR TEST s. r. o. <br />\r\nNárodní bezpečnostní úřad ČR<br />\r\nLIGNOTESTING, a.s. SK<br />\r\nKonstrukce Ocelový rám, vnější ocelový hlubokotažný plech, vnitřní laminovaná protipožární deska, obvodové a protipožární těsnění<br />\r\nSoučinitel prostupu tepla <br />\r\nPovrch Speciální dveřní fólie d-c-fix dle výběru ze vzorníku a laminovaná protipožární deska, odstíny z výběru <br />\r\nVnitřní výbava Vnitřní antikorozní a protipožární nátěr, pětibodový aktivní rozvorový mechanismus, minerální vata Orsil<br />\r\nZárubeň Možnost montáže i do stávající ocelové zárubně nebo se zárubní MRB<br />\r\nDoporučená výbava Individuální výběr z aktuální nabídky bezpečnostního kování, zámků a vložek<br />\r\nVýroba Sériová i zakázková<br />\r\nCena od 11 675,- bez DPH (včetně rozvorového zámku MUL-T-LOCK a obvodového těsnění)<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<strong>Bezpečnostní dveře BEDEX STANDARD 2 </strong><br />\r\nbez požární odolnosti<br />\r\n<br />\r\nPopis a užití Bezpečnostní dveře vhodné do stávajících i nových zárubní k ochraně domů, bytů, kanceláří a jiných prostor v domech, vyrábí se jako dveře otevírané DO chráněného prostoru <br />\r\n<br />\r\nStandardní rozměry 800 - 900 / 1970 mm, atypické rozměry - š. i v. plus 15%, nebo 20% plochy - výroba jen ve větších sériích<br />\r\nBezpečnostní třída 2 dle ENV 1627<br />\r\nStupeň utajení Důvěrné<br />\r\nPožární odolnost <br />\r\nVzduchová neprůzvučnost <br />\r\nCertifikáty výrobku Centrum stavebního inženýrství a. s. Praha<br />\r\nTREZOR TEST s. r. o. <br />\r\nNárodní bezpečnostní úřad ČR<br />\r\nKonstrukce Ocelový rám, vnější ocelový hlubokotažný plech, vnitřní laminovaná DTD (dřevotříska), obvodové těsnění<br />\r\nSoučinitel prostupu tepla <br />\r\nPovrch Speciální dveřní fólie d-c-fix dle výběru ze vzorníku a laminovaná DTD (dřevotříska), odstíny z výběru <br />\r\nVnitřní výbava Vnitřní antikorozní nátěr, pětibodový aktivní rozvorový mechanismus, minerální vata <br />\r\nZárubeň Možnost montáže i do stávající ocelové zárubně nebo se zárubní MRB<br />\r\nDoporučená výbava Individuální výběr z aktuální nabídky bezpečnostního kování, zámků a vložek<br />\r\nVýroba Sériová i zakázková<br />\r\nCena od 10 140,- bez DPH (včetně rozvorového zámku MUL-T-LOCK a obvodového těsnění)</p>',NULL,NULL,'',3315,'','',''),
(702,7,'Bedex Standard 3','<p>Bezpečnostní dveře BEDEX STANDARD 3 s požární odolností EI 30 D2<br />\r\n<br />\r\nBezpečnostní dveře vhodné do stávajících i nových zárubní k ochraně domů, bytů, kanceláří a jiných prostor v domech, vyrábí se jako dveře otevírané DO chráněného prostoru<br />\r\nStandardní rozměry 800 - 900 / 1970 mm, atypické rozměry - š. i v. plus 15%, nebo 20% plochy - výroba jen ve větších sériích<br />\r\nBezpečnostní třída 3 dle ENV 1627 <br />\r\nStupeň utajení Tajné<br />\r\nPožární odolnost EI 30D2<br />\r\nVzduchová neprůzvučnost Rw 36 dB<br />\r\nCertifikáty výrobku Centrum stavebního inženýrství a. s. Praha<br />\r\nTREZOR TEST s. r. o. <br />\r\nNárodní bezpečnostní úřad ČR<br />\r\nLIGNOTESTING, a.s. SK<br />\r\nKonstrukce Ocelový rám, vnější ocelový hlubokotažný plech, vnitřní laminovaná protipožární deska<br />\r\nSoučinitel prostupu tepla <br />\r\nPovrch Speciální dveřní fólie d-c-fix dle výběru ze vzorníku a laminovaná protipožární deska, odstíny z výběru<br />\r\nVnitřní výbava Vnitřní antikorozní a protipožární nátěr, osmibodový aktivní rozvorový mechanismus, minerální vata <br />\r\nZárubeň Možnost montáže i do stávající ocelové zárubně nebo se zárubní MRB<br />\r\nDoporučená výbava Individuální výběr z aktuální nabídky bezpečnostního kování, zámků a vložek<br />\r\nVýroba Sériová i zakázková<br />\r\nCena od 12 575,- bez DPH (včetně rozvorového zámku Mul-t-lock a obvodového těsnění)</p>\r\n<p>&#160;</p>\r\n<p><b>Nově lze dveře koupit i bez požární odolnosti, cena od 11 040,- Kč bez DPH</b></p>',NULL,NULL,'',2838,'','',''),
(704,7,'Bedex vario D3','<p><strong>Bezpečnostní dveře BEDEX Vario D3</strong><br />\r\n-jednokřídlé<br />\r\n<br />\r\nBezpečnostní dveře vhodné do stávajících i nových zárubní k ochraně domů, bytů, kanceláří a jiných prostor v domech, vyrábí se jako dveře otevírané DO chráněného prostoru <br />\r\nStandardní rozměry Š. 800 - 1 200 mm, v. 1 970 - 2 500<br />\r\nBezpečnostní třída 3 dle ENV 1627 <br />\r\nStupeň utajení Tajné<br />\r\nPožární odolnost na přání (EI, EW 30D3)<br />\r\nVzduchová neprůzvučnost Rw 33 dB<br />\r\nCertifikáty výrobku Centrum stavebního inženýrství a. s. Praha<br />\r\nTREZOR TEST s. r. o. <br />\r\nNárodní bezpečnostní úřad ČR <br />\r\nKonstrukce Ocelová konstrukce s jeklovým rámem a DTD na vnitřní straně, 7 aktivních uzamykatelných čepů (mimo zámek a závěsy), rozvorový zámek MUL-T-LOCK 235, povrch z výběrů 17 odstínů nebo základní nástřik, izolační výplň, obvodové těsnění<br />\r\nSoučinitel prostupu tepla k &lt; 1, 7 W. m-2K -1<br />\r\nPovrch Speciální dveřní fólie d-c-fix dle výběru ze vzorníku a laminovaná DTD potažená fólií, případně čalounění , nástřik dvousložkovým polyuretanovým emailem nebo kazetový obklad <br />\r\nVnitřní výbava Vnitřní antikorozní nátěr, pětibodový aktivní rozvorový mechanismus, minerální vata <br />\r\nZárubeň Možnost montáže i do stávající ocelové zárubně nebo se zárubní MRB<br />\r\nDoporučená výbava Individuální výběr z aktuální nabídky bezpečnostního kování, zámků a vložek<br />\r\nVýroba Zakázková<br />\r\nCena od 12 750,- bez DPH (vč.rozvorového zámku a obvod.těsnění)</p>',NULL,NULL,'',2656,'','',''),
(705,7,'Bedex vario D4','<p><strong>Bezpečnostní dveře BEDEX Vario D4</strong> <br />\r\njednokřídlé</p>\r\n<p>Popis a užití:  Bezpečnostní dveře s ocelovou profilovou zárubní na zazdění, vhodné k ochraně domů, bytů, kanceláří a jiných prostor v domech, vyrábí se jako dveře otevírané DO chráněného prostoru <br />\r\nStandardní rozměry: Š. 800 - 1 200 mm, v. 1 970 - 2 500 <br />\r\nBezpečnostní třída: 4 dle ENV 1627</p>\r\n<p>Stupeň utajení: Přísně tajné</p>\r\n<p>Vzduchová neprůzvučnost: Rw 33 dB <br />\r\nCertifikáty výrobku Centrum stavebního inženýrství a. s. Praha <br />\r\nTREZOR TEST s. r. o. <br />\r\nNárodní bezpečnostní úřad ČR <br />\r\nKonstrukce: Oboustranně ocelová konstrukce s jeklovým rámem, speciální výztuhy <br />\r\nSoučinitel prostupu tepla: „U“ k &lt; 2, 9 W. m-2K -1 <br />\r\nPovrch: Povrch z výběrů 17 odstínů nebo základní nástřik, případně čalounění, nástřik dvousložkovým polyuretanovým emailem nebo kazetový obklad <br />\r\nVnitřní výbava: Vnitřní antikorozní nátěr, 15-bodový rozvorový mechanismus, 12 aktivních a 2 pasivní čepy proti vysazení mezi závěsy, zámek MUL-T-LOCK 235, izolační výplň, obvodové těsnění <br />\r\nZárubeň: Typ MRB, ocelový hlubokotažný plech s. 2 mm, základní nástřik <br />\r\nDoporučená výbava: Individuální výběr z aktuální nabídky bezpečnostního kování, zámků a vložek <br />\r\nVýroba: Zakázková <br />\r\nCena od 16 400,- bez DPH (včetně rozvorového zámku, obvodového těsnění a zárubně MRB - podmínkou) </p>',NULL,NULL,'',2252,'','',''),
