(707,7,'Bedex KAVAN MTL','<p><strong>Bezpečnostní dveře BEDEX KAVAN MUL-T-LOCK SP</strong></p>\r\n<!-- br-->\r\n<p>s požární odolností EI 30 D3<br />\r\n<br />\r\nBezpečnostní dveře vhodné do stávajících i nových zárubní k ochraně domů, bytů, kanceláří a jiných prostor v domech, vyrábí se jako dveře otevírané DO chráněného prostoru<br />\r\nStandardní rozměry 800 - 900 / 1970 , atypické rozměry - š. i v. plus 15%, nebo 20% plochy - výroba jen ve větších sériích<br />\r\nBezpečnostní třída 3 dle ENV 1627 <br />\r\nStupeň utajení Tajné<br />\r\nPožární odolnost EI 30D3<br />\r\nVzduchová neprůzvučnost Rw 36 dB<br />\r\nCertifikáty výrobku Centrum stavebního inženýrství a. s. Praha<br />\r\nTREZOR TEST s. r. o. <br />\r\nNárodní bezpečnostní úřad ČR <br />\r\nKonstrukce Ocelová konstrukce s jeklovým rámem, ocelovým plechem na vnější straně a laminovou protipožární deskou na straně vnitřní<br />\r\nSoučinitel prostupu tepla k = 2, 2 W. m-2K -1<br />\r\nPovrch Speciální dveřní fólie dle výběru 6-ti odstínů a laminovaná protipožární deska, speciální odstíny z výběru ze vzorníku<br />\r\nVnitřní výbava Vnitřní antikorozní a protipožární nátěr, 11 aktivních uzamykatelných čepů, rozvorový zámek MUL-T-LOCK 235, izolační výplň<br />\r\nZárubeň Možnost montáže i do stávající ocelové zárubně nebo se zárubní MRB<br />\r\nDoporučená výbava Individuální výběr z aktuální nabídky bezpečnostního kování, zámků a vložek MUL-T-LOCK<br />\r\nVýroba Sériová i zakázková<br />\r\nCena od 23 100,- bez DPH (včetně rozvorového zámku model 235, kování Exclusive, vložky Mul-t-lock Interactive a obvodového těsnění)</p>',NULL,NULL,'',3013,'','',''),
(708,7,'Bedex vario D3 dvoukridle','<p><strong>Bezpečnostní dveře BEDEX Vario D3</strong><br />\r\ndvoukřídlé<br />\r\n<br />\r\nBezpečnostní dveře vhodné do stávajících i nových zárubní k ochraně domů, bytů, kanceláří a jiných prostor v domech, vyrábí se jako dveře otevírané DO chráněného prostoru <br />\r\nStandardní rozměry Š. 1 200 - 2 400 mm, v. 1 970 - 2 500<br />\r\nBezpečnostní třída 3 dle ENV 1627 <br />\r\nStupeň utajení Tajné<br />\r\nPožární odolnost <br />\r\nVzduchová neprůzvučnost Rw 33 dB<br />\r\nCertifikáty výrobku Centrum stavebního inženýrství a. s. Praha<br />\r\nTREZOR TEST s. r. o. <br />\r\nNárodní bezpečnostní úřad ČR <br />\r\nKonstrukce Ocelová konstrukce s jeklovým rámem, 4 aktivní, 2 pasivní čepy a zámek MUL-T-LOCK 235 na pohyblivé části, 2 aktivní a 2 pasivní čepy a páka METALUX na pevné části, povrchy z výběrů 17 odstínů nebo základní nástřik, izolační výplň, obvodové těsnění<br />\r\nSoučinitel prostupu tepla k &lt; 1,7 W. m-2K -1<br />\r\nPovrch Speciální dveřní fólie d-c-fix dle výběru ze vzorníku a laminovaná DTD potažená fólií, případně čalounění , nástřik dvousložkovým polyuretanovým emailem nebo kazetový obklad <br />\r\nVnitřní výbava Vnitřní antikorozní nátěr, pětibodový aktivní rozvorový mechanismus a 2 pevné čepy proti vysazení v aktivním křídle, dvoubodový aktivní pákový mechanismus a 2 pevné čepy proti vysazení v pasivním křídle, minerální vata <br />\r\nZárubeň Možnost montáže i do stávající ocelové zárubně nebo se zárubní MRB<br />\r\nDoporučená výbava Individuální výběr z aktuální nabídky bezpečnostního kování, zámků a vložek<br />\r\nVýroba Zakázková<br />\r\nCena od 21 650,- bez DPH (včetně rozvorového zámku, páky ovládající neaktivní křídlo, obvodového těsnění, bez zárubně)</p>',NULL,NULL,'',2652,'','',''),
(795,7,'BEDEX Vario D3 Super','<p><strong>Bezpečnostní dveře BEDEX Vario D3 SUPER</strong> <br />\r\njednokřídlé <br />\r\n<br />\r\nPopis a užití <br />\r\nBezpečnostní dveře vnější i vnitřní, vhodné k ochraně domů, bytů, kanceláří a jiných prostor, vyrábí se jako dveře otevírané DO chráněného prostoru <br />\r\nStandardní rozměry 800, 900 / 2 000 v provedení s EI 60D3 800, 900 / 2 000 v provedení s EI 45D3 atyp. rozm.-š. i v. plus 15%, nebo 20% plochy (EI 45D3) <br />\r\nBezpečnostní třída: 3 dle ENV 1627 <br />\r\nStupeň utajení: Tajné <br />\r\nPožární odolnost: na přání EI, EW 45D3 nebo EI, EW 60D3 <br />\r\nVzduchová neprůzvučnost: Rw 38 dB v provedení s prahovou lištou, resp. s prahem bez těsnění a Rw 41 dB s prahovou lištou a prahem bez těsnění <br />\r\nKouřotěsnost: Na přání <br />\r\nCertifikáty výrobku Centrum stavebního inženýrství a. s. Praha <br />\r\nTREZOR TEST s. r. o. <br />\r\nNárodní bezpečnostní úřad ČR <br />\r\nSoučinitel prostupu tepla: k = 1, 42 W. m-2K -1 <br />\r\nKonstrukce: Ocelová konstrukce s jeklovým rámem, vnější ocelový hlubokotažný plech, oboustranné dřevěné opláštění z výběru 20 modelů, protipožární eventuelně kouřotěsná úprava, obvodové a protipožární těsnění <br />\r\nPovrch: Laminovaný, dýhovaný nebo kazety dle výběru <br />\r\nVnitřní výbava: vnitřní antikorozní a protipožární nátěr, osmibodový aktivní rozvorový mechanismus, rozvorový zámek MUL-T-LOCK 235, minerální vata <br />\r\nZárubeň: Typ MRB s třídílnými závěsy a s oboustrannou hladkou obložkou <br />\r\nDoporučená výbava: Individuální výběr z aktuální nabídky bezpečnostního kování, zámků a vložek <br />\r\nVýroba zakázková <br />\r\nCena od 36 400,- bez DPH (včetně rozvorového zámku) </p>',NULL,NULL,'',1765,'','',''),
