(1532,7,'Klima II','KLIMA II.\r\n\r\ndveře\r\n	\r\n\r\nzárubně\r\n\r\nPlné otočné provedení modelů: NORA, RADKA, ESTER, EXKLUSIV, VENECIE, BERGAMO,\r\nVARIANT, MILÁNO, JANOV, ROMA, PALERMO, SOFTLINE,\r\nELEGANT, FEST, LIPNO, STANDART, DAMIER, TENGA,\r\nALEGRO, TARUGO\r\n	\r\n\r\nPouze otočné provedení obložkové zárubně dýhované nebo CPL.\r\n\r\nCena dveřního křídla\r\n+ příplatek 1 950 Kč\r\n	\r\n\r\nCena obložkové \r\n zárubně + příplatek\r\n 450 Kč\r\n\r\n \r\n\r\n \r\n\r\n \r\n\r\n \r\n\r\n \r\n\r\n \r\n\r\n \r\n\r\n \r\n\r\n \r\n\r\n \r\n\r\n \r\n\r\n  \r\n\r\n \r\n\r\n \r\n\r\n  \r\n\r\n\r\n\r\nDoporučené ceny uvedeny bez DPH. Pozn.: zárubeň ke klima dveřím je osazena třemi závěsy. KLIMA II. a III. nelze bílá na pór. KLIMA DVEØE LZE DODAT I V PROTIPOŽÁRNÍM PROVEDENÍ EI 30 D3 S PØÍPLATKEM 1 950 Kč.',NULL,NULL,'',222,'','',''),
