(797,3,'BEDEX Vario V3 double-leaf','<strong>Security door BEDEX Vario V 3 double-leaf<br />\r\n</strong><br />\r\nSecurity doors  suitable for protection of houses, flats, offices and other spaces in houses.They are produced as doors opened  out of protected space.<br />\r\n<br />\r\nStandard sizes have 1200 - 2400 mm width, 1970 - 2500 mm height<br />\r\n<br />\r\nProtective class: 4 by EVN 1627<br />\r\n<br />\r\nLevel of protection: In confidence<br />\r\n<br />\r\nAir soundproof: Rw 33 dB<br />\r\n<br />\r\nCertificated: in CSI, TREZOR TEST Ltd., NBU<br />\r\n<br />\r\nCoefficient of heat penetration: k &lt; 2,8 W. m-2 K -1<br />\r\n<br />\r\nSurface: special door foil d-c-fix - selection from the sampler, possibly also upholstery, spraying with two-component polyurethane enamel or panel facing<br />\r\n<br />\r\nConstruction: bipartite steel construction with metal profiled frame, 2 passive, 4 active  tampions, wheelbase lock MUL-T-LOCK 240 on the fixed part, 2 active and 2 passive tampions and a lever on the fixed part, surface with selection of 17 shades or basic spraying, isolating strip, circumferential padding<br />\r\n<br />\r\nDoor frame: possibility to fit in existing steel frame or MRB door frame<br />\r\n<br />\r\nInterior: antirust paint, 5 - point wheelbase mechanism, 2 fixed joints against unhinging in the active leaf, 2-points active lever mechanism, 2 fixed joints against unhinging in the passive leaf, mineral cotton<br />\r\n<br />\r\nRecommended facilities: individual choice from selection of security door handles, lockers and inserts<br />\r\n<br />\r\nProduction: individual<br />\r\n<br />\r\nPrice: from CZK 20.400 without VAT, including wheelbase locker and lever controlling non-active leaf, circumferential padding, without door frame<br />\r\n<br />\r\n<br />',NULL,NULL,'',0,'','',''),
(798,3,'BEDEX Vario D4 double leaf','<strong>Security doors BEDEX VARIO D4 </strong><br />\r\nDouble leaf doors<br />\r\n<br />\r\nSecurity doors are suitable for existing or new door frames for protection of houses, flats, offices and other spaces in houses, they are produced as doors opened <strong>into</strong> protected space.<br />\r\n<br />\r\nStandard sizes have 1200-2400 mm width, 1970 – 2500 mm height<br />\r\n<br />\r\nProtective class: 4 by ENV 1627<br />\r\n<br />\r\nLevel of protection: In confidence<br />\r\n<br />\r\nAir soundproof: Rw 33 dB <br />\r\n<br />\r\nCertificated: in Centre of constructing engineering company Prague, TREZOR TEST Ltd., National Security Authority of Czech republic<br />\r\n<br />\r\nCoefficient heat penetration: k < 2, 9 W. m-2K -1<br />\r\nConstruction: both sided steel construction with metal profiled frame, special braces<br />\r\nSurface: surface from selection of 17 shades or basic spraying, trimming is possible, spraying by double-barrelled polyuretan email or cassette veneer<br />\r\n<br />\r\nInterior: interior antirust paint, 9-point wheelbase mechanism, 6 active  and 2 passive tampions against  unhinging between hangings, locker MUL-T-LOCK 235, isolated  fill, circumferential padding<br />\r\n<br />\r\nDoor frame: type MRB door frame, deep-drawing sheet wide 2 mm, basic spraying<br />\r\n<br />\r\nRecommended facilities: individual choice from selection of security door handles, lockers and inserts<br />\r\n<br />\r\nProduction: individual<br />\r\n<br />\r\nPrice: from 24.500,- CZK without VAT,  including wheelbase locker, jacks handling passive leaf, circumferential padding and door frame MRB is necessary',NULL,NULL,'',0,'','',''),
(799,3,'BEDEX Vario EL VD 3','<strong>BEDEX Vario EL VD 3 </strong><br />\r\n<br />\r\nSecurity doors are suitable for current or new door frames for protection of houses, flats, offices and other spaces in houses, they are produced as doors opened into and out of protected space, with possibility of electronic entry control. They are opened with a chip card or a code own by authorized person.<br />\r\n<br />\r\nStandard sizes have 600-900 mm width, 1970 mm height<br />\r\n<br />\r\nProtective class: 4 by ENV 1627<br />\r\n<br />\r\nLevel of protection: In confidence<br />\r\n<br />\r\nAir soundproof: Rw 33 dB <br />\r\n<br />\r\nCertificated: in Centre of constructing engineering company Prague, TREZOR TEST Ltd., National Security Authority of Czech republic<br />\r\n<br />\r\nCoefficient heat penetration: k < 3,5 W. m-2 K -1<br />\r\n<br />\r\nSurface:  with selection of 17 shades or basic spraying<br />\r\n<br />\r\nConstruction: bipartite steel construction with metal profiled frame, special inner braces, 7 passive, 3 active lockable tampions, wheelbase lock MUL-T-LOCK 240 or lock Rostek type 210 in the upper third of the leaf, preparation for self-lockable lock BERA or ABLOY in the are of the main lock (not included in price), cable passage leading into half-groove on the side of hinge, circumferential padding, <br />\r\n<br />\r\nDoor frame: included covering profile and brace of frame with assembly instructions, possibility to fit in existing steel frame or  MRB door frame, basic spraying<br />\r\n<br />\r\nInterior: antirust paint, 10-point wheelbase mechanism, mineral cotton<br />\r\n<br />\r\nRecommended facilities: individual choice from selection of security door handles, lockers and inserts<br />\r\n<br />\r\nProduction: individual<br />\r\n<br />\r\nPrice: from 17.840 CZK without VAT, including wheelbase locker, without electromechanical lock and cabelling<br />\r\n<br />\r\n<br />\r\n<br />',NULL,NULL,'',0,'','',''),
