(802,3,'BEDEX Vario EL VD 4 with fire protection','<strong>BEDEX Vario EL VD 4 with fire protection and MBR frame<br />\r\n</strong><br />\r\n Security doors with fire protection and steel frame are suitable for  protection of houses,  offices and other commercial premises.They are produced as doors opened into and out of protected space, with possibility of electronic entry control. They are opened with a chip card or a code own by authorized person.<br />\r\n<br />\r\nStandard sizes have 600-900 mm width, 1970 mm height<br />\r\n<br />\r\nProtective class: 4 by EVN 1627<br />\r\n<br />\r\nLevel of protection: In confidence<br />\r\n<br />\r\nFire resistance: EI 30 D1 <br />\r\n<br />\r\nAir soundproof: Rw 33 dB<br />\r\n<br />\r\nCertificated: in CSI, TREZOR TEST Ltd., NBU<br />\r\n<br />\r\nCoefficient of heat penetration: k < 3,5 W. m-2 K -1<br />\r\n<br />\r\nSurface: with selection of 17 shades or basic spraying<br />\r\n<br />\r\nConstruction: bipartite steel construction with metal profiled frame, special inner braces, 7 passive, 3 active lockable tampions, wheelbase lock MUL-T-LOCK 240 or lock Rostek type 210 in the upper third of the leaf, preparation for self-lockable lock BERA or ABLOY in the are of the main lock (not included in price), cable passage leading into half-groove on the side of hinge, circumferential padding,<br />\r\n<br />\r\nDoor frame: type MRB for bricking up, steel metal plate - 2mm, basic spraying<br />\r\n<br />\r\nInterior: antirust and antifire paint, 10-point wheelbase mechanism, mineral cotton<br />\r\n<br />\r\nRecommended facilities: individual choice from selection of security door handles, lockers and inserts<br />\r\n<br />\r\nProduction: individual<br />\r\n<br />\r\nPrice: from  CZK 20.620 without VAT, including wheelbase locker and steel door frame, without electromechanical lock and cabelling<br />\r\n<br />',NULL,NULL,'',0,'','',''),
