(467,3,'About us','<br />\r\nAbout us:<br />\r\n<br />\r\nThe history of server Dvere.com dates back to 1999. Company Antrea, Ltd. is the server provider since 2006.<br />\r\n<br />\r\nAntrea, Ltd. is a new company, however managed and built-up during eight years of experiences achieved through managing one of the two units of company FRAGMENT PRAHA Ltd. (sister of building company FRAGMENT Ltd.). FRAGMENT PRAHA Ltd. is focused on door and window sale and assembly.<br />\r\n<br />\r\nThe directors of both companies ANTREA Ltd. and FRAGMENT PRAHA Ltd. have agreed ANTREA would take part of the business.<br />\r\n<br />\r\nTherefore ANTREA Ltd. has leadership and management skills gained in a company with a tradition of a strong  position in the market.<br />\r\n<br />\r\nWe hope that you will have the opportunity to appreciate our professionalism and  high level of customer service.<br />\r\n<br />\r\nReferences:<br />\r\n<br />\r\nCompany FRAGMENT PRAHA Ltd. was established in 1993 as a sister company of constructing company FRAGMENT Ltd.<br />\r\n<br />\r\nA sample of our supply:<br />\r\n<br />\r\n<strong>AssiDoman</strong> - delivery and assembly of 100 pieces interior veneer doors and door frames Sapeli, placed in the tar paper factory in Zebrak, investor SKANSKA-stav Ltd, amount 1,1 mil CZK<br />\r\n<br />\r\n<strong>Sony, Contactel </strong>- delivery and assembly of interior doors and door frames Sapeli and special fire protective steel glass doors placed in the administrative building in Vinohradska 174, investor BESS Group, amount 3,5 mil CZK<br />\r\n<br />\r\n<strong>Ceska sporitelna</strong> - delivery and assembly of interior doors and door frames Sapeli, security doors, fire protective steel doors and fire protective glass walls in administrative building Ceska sporitelna in Prague, Pankrac, investor SUBTERRA, amount 6,7 mil CZK<br />\r\n<br />\r\n<strong>Dwelling-houses Perunova</strong> - delivery and assembly of interior doors and door frames Sapeli in dwelling-house in Prague 4, Podoli, 35 flats, investor KONSTRUKTIVA KONSTI, amount 1,4 mil CZK<br />\r\n<br />\r\n<strong>MEDIATEL</strong> - delivery and assembly of steel fire protective and interior wooden doors, Thamova 16, Prague 8, amount 0,6 mil CZK, investor SUBTERRA<br />\r\n<br />\r\n<strong>Crematorium Strasnice</strong> - delivery and assembly of interior doors and door frames, investor MAJER, 0,25 mil CZK<br />\r\n<br />\r\n<strong>Palace Kodanska</strong> - delivery and assembly of interior doors and door frames into administrative building Palace Kodanska, investor NFO AISA, NIKON, 1,35 mil CZK<br />\r\n<br />\r\n<strong>Dwelling-house Klecany</strong> - delivery and assembly of security entering doors (12 flats), delivery and mounting of interior doors and door frames Sapeli, investor SIMI-Juraj Simaj, amount 0,35 mil CZK<br />\r\n<br />\r\n<strong>Hotel Clarion***</strong>, Hradebni 9, Prague 1, delivery and assembly of special sound protection entering doors of 98 rooms, interior doors and door frames, wooden and steel fire protective glassed walls, investor SUBTERRA, amount 4,7 mil CZK<br />\r\n<br />\r\n<strong>Fire house Lipence</strong> - delivery and assembly of interior and entering doors, entrance gates Hormann, plastic windows, investor Municipality Lipence<br />\r\n<br />\r\n<strong>Dwelling-house Nad Vysehradem</strong> - 33 flats, investor SUBTERRA, amount 2,3 mil CZK<br />\r\n<br />\r\n<strong>Dwelling-house Gutovka</strong> - 1000 interior and entering doors, investor Navatyp, amount 5,5 mil CZK<br />\r\n<br />\r\n<u><font size=\"4\"><strong>Samples of supplies of ANTREA company:</strong></font></u><br />\r\n<strong><br />\r\nDwelling-house NEO City Zlicin</strong>  - delivery and assemlby of interior doors and door frames into 65 flats, amount 2,4 mil CZK<br />\r\n<strong><br />\r\nMetrostav - Businness Park Rudna</strong> - delivery and assembly of interior doors, amount 3 mil CZK<br />\r\n<br />\r\n<strong>Hochtief CZ - revitalisation of KN building</strong> - delivery and assembly of doors, frame doors and windows, amount 0,8 mil CZK<br />\r\n<strong><br />\r\nTop Servis - Praha - </strong>delivery and assembly of doors, frame doors into the office building in Stepanska street, Prague 1, amount 0,36 mil CZK<br />\r\n<br />\r\nand others.....<br />\r\n<br />\r\n<br />\r\n<br />\r\nOur company also delivered doors and door frames in plenty of houses and flats.<br />\r\n<br />\r\nANTREA Ltd. has contracts with producer companies Sapeli, Barausse, Loprais, Bedex, Cobra, Colombo, Olivari, MaT. We also cooperate with other companies as Rostex, Fab, MUL-T-LOCK, Jakov, Kronodoor, Dorma, Dierre etc.',NULL,NULL,'',58,'','',''),
