(469,3,'Help','<strong>Delivery terms</strong><br />\r\nDelivery - Max 8 weeks (selected goods are in stock)<br />\r\n<br />\r\n<strong>Order a new door and services</strong><br />\r\nSend an e-mail to: info@dvere.com or use the contact form<br />\r\n<br />\r\n<strong>Order bazaar<br />\r\n</strong><br />\r\n* Select the door from the fairground<br />\r\n* Add selected doors to shopping basket<br />\r\n* Fill in contact details<br />\r\n* If you require transportation, write it in the remarks',NULL,NULL,'',16,'','',''),
(796,3,'BEDEX Vario V3 single-leaf','<strong>Bezpečnostní dveře BEDEX Vario V3 jednokřídlové</strong><br />\r\n<br />\r\nSecurity doors suitable for protection of houses, flats, offices and other spaces in houses.They are produced as doors opened out of protected space.<br />\r\n<br />\r\nStandard sizes have 800 - 1200 mm width, 1970 - 2500 height<br />\r\n<br />\r\nProtective class: 3 by ENV 1627<br />\r\n<br />\r\nLevel of protection: In confidence<br />\r\n<br />\r\nAir soundproof: Rw 33 dB<br />\r\n<br />\r\nCertificated: in CSI, TREZOR TEST Ltd., NBU<br />\r\n<br />\r\nCoefficient of heat penetration: k < 2, 8 W. m-2K -1 <br />\r\n<br />\r\nSurface: special door foil - selection from 17 shades, possibly also upholstery, spraying with two-component polyurethane enamel or panel facing<br />\r\n<br />\r\nConstruction: bipartite steel construction with metal profiled frame, circumferential  padding<br />\r\n<br />\r\nDoor frame: possibility to fit in existing steel frame or MRB door frame<br />\r\n<br />\r\nInterior: antirust paint, wheelbase locker MUL-T-LOCK 235, 10 - point wheelbase mechanism, 7 active and 2 fixed joints against unhinging in the active leaf, isolating strip<br />\r\n<br />\r\nRecommended facilities: individual choice from selection of security door handles, lockers and inserts<br />\r\n<br />\r\nProduction: individual<br />\r\n<br />\r\nPrice: from CZK  12160 without VAT, including wheelbase locker and  circumferential padding<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<strong>Bezpečnostní dveře BEDEX Vario V3 jednokřídlové<br />\r\ns požární odolností EI, EW 30D1 <br />\r\n<br />\r\n</strong>Security doors suitable for protection of houses, flats, offices and other spaces in houses.They are produced as doors opened out of protected space.<br />\r\n<br />\r\nStandard sizes have 800 - 900/1970 mm width, atypical sizes: width and height plus 15% or 20%<br />\r\n<br />\r\nProtective class: 3 by ENV 1627<br />\r\n<br />\r\nLevel of protection: In confidence<br />\r\n<br />\r\nFire resistance: EI, EW 30 D1<br />\r\n<br />\r\nAir soundproof: Rw 33 dB<br />\r\n<br />\r\nCertificated: in CSI, TREZOR TEST Ltd., NBU<br />\r\n<br />\r\nCoefficient of heat penetration: \\\'\\\'U\\\'\\\' k < 3,5 W. m 2 k, meets CSN 730540 requirements<br />\r\n<br />\r\nSurface: special door foil - selection from 17 shades, possibly also upholstery, spraying with two-component polyurethane enamel or panel facing<br />\r\n<br />\r\nConstruction: bipartite steel construction with metal profiled frame, circumferential and anti-fire padding<br />\r\n<br />\r\nDoor frame: possibility to fit in existing steel frame or MRB door frame<br />\r\n<br />\r\nInterior: antirust paint, wheelbase locker MUL-T-LOCK 235, 10 - point wheelbase mechanism, 7 active and 2 fixed joints against unhinging in the active leaf, isolating strip<br />\r\n<br />\r\nRecommended facilities: individual choice from selection of security door handles, lockers and inserts<br />\r\n<br />\r\nProduction: individual<br />\r\n<br />\r\nPrice: from CZK 13070 without VAT, including wheelbase locker <br />\r\n<br />\r\n<br />\r\n<br />',NULL,NULL,'',0,'','',''),
