(701,3,'Bedex Standard 2','<strong>Bedex Standard 2</strong><br />\r\nWith fire protection EI 30 D2<br />\r\n<br />\r\nSecurity doors are suitable for existing or new door frames for protection of houses, flats, offices and other spaces in houses, they are produced as  doors opened <strong>into</strong> protected space.<br />\r\n<br />\r\nStandard sizes have 800-900 mm width, 1970 mm height, atypical sizes - width and height plus 15 percents, or 20 percents of space - production available only in larger series.<br />\r\n<br />\r\nProtective class 2 by ENV 1627<br />\r\n<br />\r\nLevel of protection: In confidence<br />\r\n<br />\r\nFire protection EI 30 D2<br />\r\n<br />\r\nAir soundproof: Rw 36 dB<br />\r\n<br />\r\nCertificated: in Centre of constructing engineering company Prague, TREZOR TEST Ltd., National Security Authority of Czech republic, LIGNOTESTING company Slovak republic<br />\r\n<br />\r\nConstruction: steel frame, exterior steel deep-drawing sheet, interior laminated fire protective desk, circumferential and fire protective padding<br />\r\n<br />\r\nCoefficient heat penetration<br />\r\n<br />\r\nSurface: special door plastic film d-c-fix - selection from sampler and laminated fire protective desk, choice of color shades<br />\r\n<br />\r\nInterior: interior antirusting and fire protective paint, five point active wheelbase mechanism, mineral padding Orsil<br />\r\n<br />\r\n<br />\r\nDoor frame: fitted on existing or new steel door frame<br />\r\n<br />\r\nRecommended facilities: individual choice from selection of security door handles, lockers and inserts<br />\r\n<br />\r\nProduction: series or individual<br />\r\n<br />\r\nPrice: from 9.450,- CZK without VAT (including wheelbase locker Metalguard and circumferential padding)<br />\r\nfrom 10.355,- CZK without VAT (including wheelbase locker Mult-T-Lock<br />\r\nand circumferential padding)<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<strong>Security doors BEDEX STANDARD 2 </stron