(1521,7,'Pro developery','<p>Jsme společnost, která se zabývá dodávkou a montáží dveří od 1997. Dodáváme a montujeme dveře vstupní, bezpečnostní, interiérové  i speciální  (ocelové, protipožární, protihlukové,  atd.).  <br />\r\nČasto dodáváme dveře do bytových domů a do větších kancelářských či  skladových objektů, máme proto s tímto typem zakázek bohaté zkušenosti.  Můžeme nabídnout levné dveře pro standardní byty, ale také uspokojit  náročného zákazníka individuálním přístupem v naší vzorkové prodejně  a provádět takzvané ,,klientské změny\",  což zákazníky jistě potěší, výběr  dražších dveří pak příznivě navýší Váš zisk ze zakázky. Nabídku  dveří máme obrovskou, zastupujeme několik předních českých  a italských výrobců vnitřních, protipožárních, bezpečnostních či ocelových  dveří: Sapeli, Dierre, Lualdi, Loprais, Bedex, FerreroLegno, Solodoor,  HSE, Ferwall a další, ale protože v tomto oboru působíme dlouho a jsme  oslovováni většinou výrobců, není problém dodat dveře za přijatelnou  cenu  téměř od jakéhokoliv výrobce. Jedná se jak o dveře standardních  typů, které uspokojí přijatelnou cenou, tak dveře na vysoké designové  úrovni nebo luxusní úrovni zpracování, či uspokojující vysoké technické  či odolnostní požadavky.  Ke dveřím dodáváme veškeré příslušenství, jako jsou kliky, vložky  do dveří, zárubně, dveřní zavírače, stavební pouzdra  atd., i zde je  možnost výběru obrovská.  <br />\r\nNa požádání lze zřídit vzorkovnu v místě stavby či blízkém okolí pro  větší komfort zákazníků.   <br />\r\nPokud mate zájem, můžeme dovézt či zaslat  katalogy, vzorky, materiály či podrobnější informace o referenčních stavbách.</p>\r\n<p>Jan Sommer, jednatel společnosti<br />\r\n&#160;</p>',NULL,NULL,'',1347,'','',''),
