(1778,7,'Dveře Alegro','<p>\r\n<header>\r\n<h1>Dveře</h1>\r\n</header>\r\n<aside>\r\n<div class=\"image-detail\"><img width=\"198\" alt=\"Alegro\" src=\"http://cms.www.sapeli.cz/cs/goto/Image/88518382617363238-alegor-javor-am-15-MpHNGdKl.png?_signature=2DFEB16F69&amp;mode=SCALE&amp;width=198\" /></div>\r\n<div class=\"price\">\r\n<p>Cena od</p>\r\n<span><span>4990</span> Kč</span></div>\r\n</aside></p>\r\n<div class=\"top\">\r\n<h2>\r\n<ul class=\"open-detail\">\r\n    <li>\r\n    <ul class=\"modal\">\r\n        <li class=\"main-header\"><span>Alegro</span></li>\r\n        <li class=\"model-slider\">\r\n        <ul class=\"model-selector\">\r\n            <li class=\"itemswitch\" style=\"display: list-item;\"><img height=\"100\" alt=\"Model 10\" src=\"http://cms.www.sapeli.cz/cs/goto/Image/88518382617364063-alegro-10-MGU1NdKl.png?_signature=8D61754888&amp;mode=SCALE&amp;width=47\" /> &#160;<img height=\"100\" alt=\"Model 15\" src=\"http://cms.www.sapeli.cz/cs/goto/Image/88518382617364065-alegro-15-Mp13NdKl.png?_signature=8D61754888&amp;mode=SCALE&amp;width=47\" /> &#160;<img height=\"100\" alt=\"Model 20\" src=\"http://cms.www.sapeli.cz/cs/goto/Image/88518382617364067-alegro-20-M1X3NdKl.png?_signature=8D61754888&amp;mode=SCALE&amp;width=47\" /> &#160;<img height=\"100\" alt=\"Model 40\" src=\"http://cms.www.sapeli.cz/cs/goto/Image/88518382617364069-alegro-40-MO35NdKl.png?_signature=8D61754888&amp;mode=SCALE&amp;width=47\" /> &#160; <img height=\"100\" alt=\"Model 45\" src=\"http://cms.www.sapeli.cz/cs/goto/Image/88518382617364071-alegro-45-Mhe6NdKl.png?_signature=8D61754888&amp;mode=SCALE&amp;width=47\" /> &#160;<img height=\"100\" alt=\"Model 50\" src=\"http://cms.www.sapeli.cz/cs/goto/Image/88518382617364073-alegro-50-MDu7NdKl.png?_signature=8D61754888&amp;mode=SCALE&amp;width=47\" /></li>\r\n        </ul>\r\n        </li>\r\n    </ul>\r\n    </li>\r\n</ul>\r\n</h2>\r\n</div>\r\n<p>&#160;</p>\r\n<div class=\"dynamic-content\">\r\n<div class=\"annotation\">\r\n<p>V