(1763,7,'7. Distančníky','<div id=\"main\">\r\n<div id=\"bg\">\r\n<div id=\"main-wrapper\">\r\n<div id=\"content\">\r\n<div id=\"primary-content\">\r\n<h1>DISTANČNÍKY</h1>\r\n<p>Distančníky jsou opatřena venkovní křídla těch špaletových oken, u  kterých se obě křídla otevírají do interiéru. Jejich účelem je zamezit  střetu kliky venkovního okenního křídla se sklem vnitřního okenního  křídla.</p>\r\n<div id=\"gallery\">\r\n<div class=\"border\"><a title=\"pro zvětšení klikněte\" target=\"_blank\" class=\"galleryslide\" href=\"http://www.spaletova-okna.com/root/sortiment/distancnik/021_1.jpg\"><img height=\"108\" title=\" pro zvětšení klikněte\" alt=\"\" src=\"http://www.spaletova-okna.com/root/sortiment/distancnik/021_1.jpg\" /></a></div>\r\n</div>\r\n</div>\r\n<div id=\"submenu\">\r\n<div id=\"submenu-wrapper\">&#160;</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>',NULL,NULL,'',0,NULL,'',''),
