\r\n            none;border-bottom:solid windowtext 1.0pt;border-right:solid windowtext 1.0pt;\r\n            mso-border-top-alt:solid windowtext .5pt;mso-border-left-alt:solid windowtext .5pt;\r\n            mso-border-alt:solid windowtext .5pt;padding:0cm 5.4pt 0cm 5.4pt\">\r\n            <p class=\"MsoNormal\"><span style=\"font-size:10.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;\">46dB</span></p>\r\n            </td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<h2>Součinitel prostupu tepla oknem (U<sub>w</sub>)</h2>\r\n<p>Nejdůležitější technický parametr okna je součinitel prostupu tepla,  vyjadřuje množství tepelné energie, které pronikne oknem. Jeho velikost  je ovlivněna tepelnými vlastnostmi rámu a zasklení. Čím nižší je tedy  hodnota součinitele prostupu tepla, tím lepší jsou tepelně izolační  vlastnosti.</p>\r\n<h2>Zvukový útlum (Rw)</h2>\r\n<p>Významnou vlastností zejména pro objekty v blízkosti rušných  křižovatek, železnic, letišť jsou dokonalé zvukově izolační vlastnosti  oken. Zvýšení zvukově izolačních vlastností se dosahuje využitím různých  typů skel.</p>\r\n<ul>\r\n    <li>Rw = 32dB - STANDART</li>\r\n    <li>Rw = 35dB - V BLÍZKOSTI SILNICE</li>\r\n    <li>Rw = 38dB - U FREKVENTOVANÉ SILNICE</li>\r\n    <li>Rw = 41dB - V BLÍZKOSTI DÁLNICE, LETIŠTĚ NEBO ŽELEZNICE</li>\r\n</ul>',NULL,NULL,'',0,NULL,'',''),
