(1639,7,'Bezpečnostní dveře Ferwall','<p><span style=\"font-size: larger;\"><span style=\"font-family: Arial;\">Jsme hlavním zástupcem v České republice výrobce bezpečnostních dveří Ferwall. Dovážíme je, prodáváme a montujeme. Jedná se o  výrobce, který nabízí veliký výběr možného provedení dveří, bezpečnostní třídy 2, 3 a 4. Nabízí se výběr z nezpočetného množství plášťů dveří i  variant technických - zateplené dveře, protipožární, vnitřní, vnější,  protihlukové. Montáž je snadná, ale vyžaduje zednickou úpravu - dveře  mají vždy svou vlastní ocelovou dvoudínou zárubeň.</span></span></p>\r\n<p><a href=\"http://www.ferwall.com/\">ODKAZ NA STRÁNKY VÝROBCE</a></p>\r\n<p><a href=\"/file/cat_ridotto.pdf\">KATALOG DVEŘÍ</a></p>\r\n<p><a href=\"/file/LISTINO%202010.pdf\">CENÍK POVRCHOVÝCH ÚPRAV (EURO)</a></p>\r\n<p><a href=\"/file/Cenik%20dveri%20Ferwall.pdf\">CENÍK DVEŘÍ FERWALL</a></p>\r\n<p>&#160;</p>',NULL,NULL,'',81,NULL,'',''),
