td class=\"first\">&#160;</td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<table>\r\n    <tbody>\r\n        <tr class=\"image\">\r\n            <td class=\"caption\">Sklo v ceně:</td>\r\n            <td>&#160;</td>\r\n            <td>&#160;</td>\r\n            <td>&#160;</td>\r\n            <td>&#160;</td>\r\n            <td>&#160;</td>\r\n            <td>&#160;</td>\r\n            <td>&#160;</td>\r\n            <td>&#160;</td>\r\n        </tr>\r\n        <tr class=\"colspan4\">\r\n            <td colspan=\"4\">činčila čiré, float čiré, krizet čiré, kůra čiré,  planibel bronz, sapelux bílé, screen čiré</td>\r\n        </tr>\r\n    </tbody>\r\n</table>',NULL,NULL,'',0,NULL,'',''),
(1796,7,'Rady a informace','<p>\r\n<header data-facebook=\"href\" data-facebook-href=\"http://www.sapeli.cz/cs/rady-a-informace/vse-o-dverich/prakticke-rady/povrchova-uprava\">\r\n<h1 data-facebook=\"title\">Rady a informace</h1>\r\n</header>\r\n</p>\r\n<div class=\"left-side printable-content\">\r\n<h2 data-facebook=\"caption\">Povrchová úprava</h2>\r\n<div class=\"dynamic-content\">\r\n<div data-facebook=\"text\" class=\"annotation\">\r\n<p>Podle  čeho z nabízených možností volit, vždyť výběr je tak široký! V základu  se řiďte tím, co je pro vás přirozené a v čem se cítíte dobře.</p>\r\n<p><img height=\"194\" width=\"700\" src=\"http://cms.www.sapeli.cz/cs/goto/Image/88518382617419767-povrchova-uprava-M9hXLtKl.PNG?_signature=6462A93867&amp;height=194&amp;width=700\" alt=\"\" />&#160;</p>\r\n</div>\r\n<p>A protože příroda na člověka jak dobře působí, tak úchvatně vypadá, obraťte svou pozornost zejména na <strong>PŘÍRODNÍ MATERIÁLY</strong>:</p>\r\n<h3>Dýha</h3>\r\n<p><img height=\"181\" width=\"248\" style=\"float: right;\" src=\"http://cms.www.sapeli.cz/cs/goto/Image/88518382617419770-dyha-MdXAMtKl.PNG?_signature=99161CEA1E&amp;height=181&amp;width=248\" class=\"right-image\" alt=\"\" />Tradiční  povrch dveří s přirozenou texturou dřeva, který je rozhodně nadčasovou a  výjimečnou záležitostí. Dýhovaný model dveří s vámi prožije doslova kus  života a díky široké nabídce uspokojí vaši touhu jak po evropských  dřevinách různých textur a barevných odstínů, tak i po nádherném  exotickém dřevě. Dýha vzniká krájením dřeva na pláty o šíři do 0,5 mm, a  protože žádný strom nevyroste dvakrát stejně, nenaleznete ani vy dvě  vzhledově naprosto stejné textury dýh. Co kus – to originál zde platí  doslova. Pokud by se přeci jen požadavek na úplně sjednocený design  tohoto povrchu objevil, nabízí trh řadu tzv. ARO dýh. Nakrájené pláty  dýh se slepí v různých tvarových šablonách do bloku a ten se znovu  nakrájí. Vzniklé listy dýhy se opět sesadí a výsledkem je jednotně  vypadající přírodní dýha.</p>\r\n<p>&#160;</p>\r\n<h3>Masiv</h3>\r\n<p><img height=\"191\" width=\"248\" style=\"float: right;\" src=\"http://cms.www.sapeli.cz/cs/goto/Image/88518382617419773-masiv-Mr__MtKl.PNG?_signature=1BD0CC4FF1&amp;height=191&amp;width=248\" class=\"right-image\" alt=\"\" />Materiál  určený pro skutečné milovníky přírody. Přírodní dřevo s neopakovatelnou  strukturou a jedinečnou barevností, které svou úlohu v interiéru či  exteriéru splní dokonale. Vzhledem ke skutečně masivnímu materiálu je  ovšem třeba počítat s vyšší finanční investicí, než je tomu v případě  dýhy.</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<h3>Kamenné dýhy</h3>\r\n<p><img height=\"210\" width=\"247\" style=\"float: right;\" src=\"http://cms.www.sapeli.cz/cs/goto/Image/88518382617419776-kamenne-dyhy-MJWnNtKl.PNG?_signature=CD1B9082D6&amp;height=210&amp;width=247\" class=\"right-image\" alt=\"\" />Pokud  je přírodní materiál vaším šálkem kávy, ale rádi byste vyzkoušeli ještě  něco jiného, než dřevo, rozhodně neopomeňte na možnost použít kamenné  dýhy. Na první pohled originální povrchový materiál ze skutečného  štípaného kamene - břidlice, opět přírodní materiál, nikoli ovšem  dřevěný, ale kamenný.</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>Ti, kteří nechtějí mít ve svém interiéru přírodní materiály, ale  dávají přednost jejich umělým náhražkám, mají samozřejmě také z čeho  vybírat. Šíře nabídky <strong>UMĚLÝCH DVEŘNÍCH POVRCHŮ</strong>&#160;je vytvořena materiály rozmanitých vlastností:</p>\r\n<p>&#160;</p>\r\n<h3>Vysoký lesk</h3>\r\n<p>Povrch má tloušťku 0,7 mm a snadno se udžuje. Představuje jednu ze  skutečně luxusních a exkluzivních povrchových úprav, která dveřní křídlo  dolaďuje s interiérovým nábytkem ve vysokém lesku do jednoho uceleného  kompletu.</p>\r\n<p>&#160;</p>\r\n<h3>Vacuo povrch</h3>\r\n<p><img height=\"208\" width=\"245\" style=\"float: right;\" src=\"http://cms.www.sapeli.cz/cs/goto/Image/88518382617419797-vacuo-MKqQVtKl.PNG?_signature=0F4D9630BF&amp;height=208&amp;width=245\" class=\"right-image\" alt=\"\" />Tento  povrchový materiál má tloušťku 0,4 mm. Použitá barevná škála je v  několika trendy odstínech. Speciální fólie představující technologickou  revoluci v zalisování povrchu dveří. Je nanášena v bezprašném prostředí  za využití podtlaku vacua, který zajišťuje zcela ideálního přilnutí k  ploše dveří. Je jako stvořená pro vytvoření 3D motivů a obrázků na  dveřích.&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<p>&#160;</p>\r\n<h3>CPL a HPL lamináty</h3>\r\n<p><img height=\"265\" width=\"249\" style=\"float: right;\" src=\"http://cms.www.sapeli.cz/cs/goto/Image/88518382617419801-cpl-MwYfWtKl.PNG?_signature=7E7DBA807B&amp;height=265&amp;width=249\" class=\"right-image\" alt=\"\" />Vysoce  mechanicky odolné materiály, které dobře snáší náročnější provoz jak v  bytových domech, kancelářských prostorách nebo veřejných budovách, jedná  se o základní umělý materiál imitující texturu dřeva nebo nabízející  širokou barevnou škálu.&#160;<br />\r\nCPL - střednětlaký laminát tloušťky 0,2 mm.  Tento materiál je odolný proti mechanickému poškození, výhodou je i  snadná údržba a odolnost proti běžně používaným čistícím i dezifenkčním  prostředkům, vhodný do rodinných a bytových domů, kancelářských budov  apod. CPL laminát je povrch, který dobře snáší rodinný provoz s malými  dětmi či domácími mazlíčky.&#160;<br />\r\nHPL - vysokotlaký laminát tloušťky 0,8  mm. HPL má vysokou odolnost proti mechanickému poškození a oděru,  výhodou je také snadná údržba a vysoká odolnost vůči čistícím a  dezifenkčním prostředkům používaným zejména ve zdravotnictví. Je vhodný  do extrémně namáhaných prostor, např.: zdravotnická zařízení, školy,  výrobní prostory, sportovní zařízení, supermarkety, apod.&#160;</p>\r\n<p>&#160;</p>\r\n<h3>Fólie</h3>\r\n<p>Cenově výhodný materiál ve zcela přirozeně působících dekorech dřeva,  vhodný do běžně užívaných prostor rodinných domů a bytů. Její hlavní  předností je nízká cena a jednotná barevnost na výrobcích.</p>\r\n<p>&#160;&#160;</p>\r\n<h3>Stone</h3>\r\n<p>Kamenná dýha – kámen je tradiční stavební materiál, ale použití na  dveřích je překvapivé a velmi efektní v každém interiéru. Kamenná dýha  je vyrobena z pravé štípatelné břidlice, tloušťky 1 – 4 mm, což vytváří  unikátní smyslový zážitek.</p>\r\n<p>&#160;&#160;</p>\r\n<h3>Barva</h3>\r\n<p>Povrchová úprava nástřikem barvy. Vybírat nejvhodnější barvu můžete  ze široké škály vzorníku RAL. Nástřik je citlivější na mechanický otěr,  proto jsou tyto dveře určeny pro nízké namáhání.</p>\r\n</div>\r\n</div>',NULL,NULL,'',0,NULL,'',''),
(1799,7,'Dveře Bedex ZK plechové hladké pozink bez p.ú. 600/1970/P','<p>&#160;</p>\r\n<h2>ZK PLECHOVÉ DVEŘE</h2>\r\n<p>ZK plechové dveře jsou tvarovou obdobou klasických dřevěných dveří,  skládají se ze dvou částí: užší části (vany) a širší části (víka). Jsou  hladké, bez požární odolnosti. Jednokřídlové jsou standardně vyrobeny z  pozinkovaného plechu o síle 0,55 mm (lze použít i plech 0,8 za příplatek  450,-), dvoukřídlé jsou vyrobeny vždy z pozinkovaného plechu 0,8mm,  který zaručuje vysokou odolnost proti korozi a umožňuje použití téměř  všech povrchových úprav. Dveře jsou osazeny zámkem FAB 190/140 (rozteč  72 mm). V místě závěsů jsou dveře zesíleny dřevěnými a u zámku  plastovými výztuhami. Ocelový plášť je vyplněn papírovou voštinou. Dveře  jsou atestovány na tepelnou a zvukovou propustnost. Tyto atesty platí  pouze pro dveře jednokřídlové.&#160;<span style=\"font-family: Arial\" class=\"Apple-style-span\">Dveře jsou osazeny dveřními závěsy 80/10 VD M8 Ni.</span></p>\r\n<p>ZK plechové dveře lze vyrobit i jako dvoukřídlové, fixace pasivního křídla je zajištěna zadlabacími zastrčeni.</p>\r\n<p class=\"red\">Vážená neprůzvučnost dle ČSN EN ISO140 - 3, ČSN EN ISO 717 - 1:</p>\r\n<p>a) dveře a zárubeň bez prahu - Rw(C;Ctr) =26 (-1; -3) dB</p>\r\n<p class=\"red\">Vážená neprůzvučnost dle ČSN EN ISO140 - 3, ČSN EN ISO 717 - 1:</p>\r\n<p>b) dveře a zárubeň s prahem - Rw(C;Ctr) =30 (-1; -3) dB</p>\r\n<p>&#160;</p>\r\n<p>Dodací lhůta 3-10 dní</p>\r\n<p>&#160;</p>',NULL,NULL,'',0,NULL,'',''),
(1800,7,'Dveře  Bedex ZK plechové hladké pozink bez p.ú. 700/1970/L','<p>&#160;</p>\r\n<h2>ZK PLECHOVÉ DVEŘE</h2>\r\n<p>ZK plechové dveře jsou tvarovou obdobou klasických dřevěných dveří,  skládají se ze dvou částí: užší části (vany) a širší části (víka). Jsou  hladké, bez požární odolnosti. Jednokřídlové jsou standardně vyrobeny z  pozinkovaného plechu o síle 0,55 mm (lze použít i plech 0,8 za příplatek  450,-), dvoukřídlé jsou vyrobeny vždy z pozinkovaného plechu 0,8mm,  který zaručuje vysokou odolnost proti korozi a umožňuje použití téměř  všech povrchových úprav. Dveře jsou osazeny zámkem FAB 190/140 (rozteč  72 mm). V místě závěsů jsou dveře zesíleny dřevěnými a u zámku  plastovými výztuhami. Ocelový plášť je vyplněn papírovou voštinou. Dveře  jsou atestovány na tepelnou a zvukovou propustnost. Tyto atesty platí  pouze pro dveře jednokřídlové.&#160;<span class=\"Apple-style-span\" style=\"font-family: Arial\">Dveře jsou osazeny dveřními závěsy 80/10 VD M8 Ni.</span></p>\r\n<p>ZK plechové dveře lze vyrobit i jako dvoukřídlové, fixace pasivního křídla je zajištěna zadlabacími zastrčeni.</p>\r\n<p class=\"red\">Vážená neprůzvučnost dle ČSN EN ISO140 - 3, ČSN EN ISO 717 - 1:</p>\r\n<p>a) dveře a zárubeň bez prahu - Rw(C;Ctr) =26 (-1; -3) dB</p>\r\n<p class=\"red\">Vážená neprůzvučnost dle ČSN EN ISO140 - 3, ČSN EN ISO 717 - 1:</p>\r\n<p>b) dveře a zárubeň s prahem - Rw(C;Ctr) =30 (-1; -3) dB</p>\r\n<p>&#160;</p>\r\n<p>Dodací lhůta 3-10 dní</p>\r\n<p>&#160;</p>',NULL,NULL,'',0,NULL,'',''),
