(1810,7,'Dveře Bedex ZK plech. izolované pozink bez p.ú. 600/1970/L','<h2>ZK PLECHOVÉ DVEŘE IZOLOVANÉ</h2>\r\n<p>Plechové dveře ZK izolované jsou tvarovou obdobou klasických  dřevěných dveří, skládají se ze dvou částí: užší části (vany) a širší  části (víka). Jsou hladké, bez požární odolnosti. Jednokřídlové i  dvoukřídlové jsou vždy vyrobeny z pozinkovaného plechu o síle 0,8 mm,  který zaručuje vysokou odolnost proti korozi a umožňuje použití téměř  všech povrchových úprav. Dveře jsou osazeny zámkem FAB 190/140 (rozteč  72 mm). V místě závěsů jsou dveře zesíleny dřevěnými a u zámku  plastovými výztuhami. Ocelový plášť je vyplněn tepelně izolačním  materialem. Dveře jsou atestovány na tepelnou a zvukovou prostupnost.  Tyto atesty platí pouze pro dveře jednokřídlové.&#160;<span style=\"font-family: Arial\" class=\"Apple-style-span\">Dveře jsou osazeny dveřními závěsy 80/10 VD M8 Ni.</span></p>\r\n<p>ZK plechové dveře izolované lze vyrobit i jako dvoukřídlové, fixace pasivního křídla je zajištěna zadlabacími zastrčeni.</p>\r\n<p class=\"red\">Součinitel prostupu tepla dle ČSN EN ISO 12567-1:</p>\r\n<p>U<sub>N(D)</sub> = 1,46 W/(m<sup>2</sup>.K)</p>\r\n<p class=\"red\">Vážená neprůzvučnost dle ČSN EN ISO140 - 3, ČSN EN ISO 717 - 1:</p>\r\n<p>R<sub>W</sub> (C; C<sub>tr</sub>) = 28 (-3; -4) dB</p>\r\n<p><strong>Použití ZK plechových dveří</strong></p>\r\n<p>Tyto dveře se díky svým výhodám používají v celé řadě prostředí jako  jsou kancelářské a správní budovy, půdní vestavby a výrobní prostory,  ale také pro obytné kontejnery a z nich zhotovené modulární stavby. Díky  svému plášti z žárově pozinkovaného plechu se výborně hodí do sklepních  prostor a vlhkého prostředí jako jsou např. veřejné sprchy a bazény.  Dveře lze jednoduše udržovat jednoduchým omytím.</p>\r\n<p>Dodací lhůta 3-10 dní</p>\r\n<p>&#160;</p>',NULL,NULL,'',0,NULL,'',''),
