(1839,7,'Vertigo','<p>&#160;</p>\r\n<div id=\"inner_left\">\r\n<div class=\"left\">\r\n<h1>Řada VERTIGO</h1>\r\n<p>U dveří VERTIGO I až VERTIGO X je kresba na  svislém rámu svisle, na vodorovných příčkách a kazetách je kresba  vodorovně. U dveří VERTIGO XI až XXI a VARIANT je kresba na svislých  rámech a kazetách svisle, vodorovné příčky mají kresbu vodorovně.</p>\r\n</div>\r\n<div class=\"mini\">&#160;</div>\r\n<div class=\"vypis\"><a href=\"http://www.sestavsidvere.cz/cs/vertigo/vertigo-i/\">                                     <strong>VERTIGO I</strong>                                                                             <img src=\"http://www.sestavsidvere.cz/foto/21/b21001203_2400301.jpg\" alt=\"\" />                                                                                                         </a>                                                                                                                                                                    <a href=\"http://www.sestavsidvere.cz/cs/vertigo/vertigo-ii/\">                                     <strong>VERTIGO II</strong>                                                                             <img src=\"http://www.sestavsidvere.cz/foto/21/b21002203.jpg\" alt=\"\" />                                                                                                         </a>                                                                                                                                                                    <a href=\"http://www.sestavsidvere.cz/cs/vertigo/vertigo-iii/\">                                     <strong>VERTIGO III</strong>                                                                             <img src=\"http://www.sestavsidvere.cz/foto/21/b21003203_2400301.jpg\" alt=\"\" />                                                                                                         </a>                                                          