(1849,7,'Otava','<p>&#160;</p>\r\n<div class=\"left\">\r\n<h1>Řada OTAVA</h1>\r\n<p>Vyberte si konkrétní model dveří z modelové  řady OTAVA. V následujících  krocích budete moci libovolně měnit barvu  dezénu i typ skla. Kdykoliv se  můžete vrátit zpět do tohoto kroku a  uvidíte všechny modely ve Vámi  vybraném nastavení.</p>\r\n</div>\r\n<div class=\"mini\">&#160;</div>\r\n<p><a href=\"http://www.sestavsidvere.cz/cs/otava/otava-iv/\">                                     <strong>OTAVA IV</strong>                                                                             <img src=\"http://www.sestavsidvere.cz/foto/12/b12004003_2300005.jpg\" alt=\"\" />                                                                                                         </a>                                                                                                                                                                    <a href=\"http://www.sestavsidvere.cz/cs/otava/otava-v/\">                                     <strong>OTAVA V</strong>                                                                             <img src=\"http://www.sestavsidvere.cz/foto/12/b12005003_2300005.jpg\" alt=\"\" />                                                                                                         </a>                                                                                                                                                                    <a href=\"http://www.sestavsidvere.cz/cs/otava/otava-vi/\">                                     <strong>OTAVA VI</strong>                                                                             <img src=\"http://www.sestavsidvere.cz/foto/12/b12006003_2300005.jpg\" alt=\"\" />                                                                                                         </a>                                                                                                                                