(1850,7,'Solo','<div class=\"left\">\r\n<h1>Řada SOLO</h1>\r\n<p>Rámečky u dveří SOLO jsou vyrobeny z masívu. Vadou není rozdílná barevnost rámečků. Jedná se o přírodní materiál.</p>\r\n</div>\r\n<div class=\"mini\">&#160;</div>\r\n<p><a href=\"http://www.sestavsidvere.cz/cs/solo/solo-i/\">                                     <strong>SOLO I</strong>                                                                             <img src=\"http://www.sestavsidvere.cz/foto/10/b10001003.jpg\" alt=\"\" />                                                                                                         </a>                                                                                                                                                                    <a href=\"http://www.sestavsidvere.cz/cs/solo/solo-iii/\">                                     <strong>SOLO III</strong>                                                                             <img src=\"http://www.sestavsidvere.cz/foto/10/b10003003_2300022.jpg\" alt=\"\" />                                                                                                         </a>                                                                                                                                                                    <a href=\"http://www.sestavsidvere.cz/cs/solo/solo-iv/\">                                     <strong>SOLO IV</strong>                                                                             <img src=\"http://www.sestavsidvere.cz/foto/10/b10004003_2300022.jpg\" alt=\"\" />                                                                                                         </a>                                                                                                                                                                    <a href=\"http://www.sestavsidvere.cz/cs/solo/solo-xiv/\">                                     <strong>SOLO XIV</strong>   