(1851,7,'Klasik','<p>&#160;</p>\r\n<div id=\"inner_left\">\r\n<div class=\"left\">\r\n<h1>Řada KLASIK plné a prosklené</h1>\r\n<div>\r\n<div>\r\n<p>Sestavte si hladké dveře přesně dle Vašich přání. Sestavování dveří  začněte výběrem některé z modelových řad. Vyberete tím styl pro  následující kroky jednotlivých úprav dveří. Pod každou modelovou řadou  se skrývají jednotlivé konkrétní modely, které můžete dále upravit  výměnou dezénu povrchu, typem skla nebo dalších příplatků.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"mini\">&#160;</div>\r\n<div class=\"vypis\"><a href=\"http://www.sestavsidvere.cz/cs/klasik-plne-a-prosklene/klasik-plne/\">                                     <strong>KLASIK PLNÉ</strong>                                                                             <img src=\"http://www.sestavsidvere.cz/foto/1/b01000003.jpg\" alt=\"\" />                                                                                                         </a>                                                                                                                                                                    <a href=\"http://www.sestavsidvere.cz/cs/klasik-plne-a-prosklene/klasik-13-sklo/\">                                     <strong>KLASIK 1/3 SKLO</strong>                                                                             <img src=\"http://www.sestavsidvere.cz/foto/1/b01001003_2300005.jpg\" alt=\"\" />                                                                                                         </a>                                                                                                                                                                    <a href=\"http://www.sestavsidvere.cz/cs/klasik-plne-a-prosklene/klasik-23-sklo/\">                                     <strong>KLASIK 2/3 SKLO</strong>                                                                             <img src=\"http://www.sestavsidvere.cz/foto/1/b01002003_2300005.jpg\" alt=\"\" />                                                                                                         </a>                                                                                                                                                                    <a href=\"http://www.sestavsidvere.cz/cs/klasik-plne-a-prosklene/klasik-33-sklo/\">                                     <strong>KLASIK 3/3 SKLO</strong>                                                                             <img src=\"http://www.sestavsidvere.cz/foto/1/b01003003_2300005.jpg\" alt=\"\" />                                                                                                         </a>                                                                                                                                                                    <a href=\"http://www.sestavsidvere.cz/cs/klasik-plne-a-prosklene/klasik-l2-sklo/\">                                     <strong>KLASIK L2 SKLO</strong>                                                                             <img src=\"http://www.sestavsidvere.cz/foto/1/b01004003_2300005.jpg\" alt=\"\" />                                                                                                         </a></div>\r\n</div>',NULL,NULL,'',0,NULL,'','');
